INSERT INTO `sanpham` (`masp`, `tensp`, `mota`, `ngaythem`, `trangthai`, `maloai`, `math`, `luotmua`, `luotxem`) VALUES
(49, 'Áo bóng đá BARCELONA sân nhà 2023 - 2024 ', '<p>Bộ quần áo bóng đá sân nhà FC Barcelona 2023/24 tôn vinh hành trình 30 năm Đội tuyển nữ được sáp nhập vào câu lạc bộ. Huy hiệu có hình kim cương ẩn đã được đội Nữ sử dụng trong lịch sử và các sọc cổ điển có hoa văn kim cương dọc theo các cạnh. Bộ sưu tập Sân vận động của chúng tôi kết hợp các chi tiết thiết kế sao chép với công nghệ thấm mồ hôi để mang đến cho bạn diện mạo sẵn sàng cho trận đấu lấy cảm hứng từ đội bóng yêu thích của bạn. Công nghệ Nike Dri-FIT di chuyển mồ hôi ra khỏi da để bay hơi nhanh hơn, giúp bạn khô ráo và thoải mái. Thiết kế bản sao cung cấp cho bạn các chi tiết được mô phỏng theo những gì các chuyên gia mặc.</p>', '2024-06-08 05:33:33', 1, 3, 2, 10, 110),
(50, 'ÁO BÓNG ĐÁ CHÍNH HÃNG ARSENAL SÂN NHÀ 2023/24', '<p>ÁO ARSENAL KỶ NIỆM CỦA NGƯỜI HÂM MỘ ARSENAL VỚI CHÙM SÉT VÀ CÁC CHI TIẾT VÀNG.<br>Người ta nói sét đánh không bao giờ hai lần. Và 20 năm sau, Pháo thủ vẫn là câu lạc bộ duy nhất kết thúc mùa giải bóng đá hàng đầu nước Anh với thành tích bất bại.</p><p>Áo thi đấu sân nhà 23/24 của Arsenal kỷ niệm ngày kỷ niệm độc đáo của đội bóng với các tia chớp và các chi tiết bằng vàng. Được tạo ra cho những người ủng hộ trung thành của câu lạc bộ, chiếc áo đấu này có công nghệ AEROREADY thấm mồ hôi giúp bạn luôn cảm thấy khô ráo, trong khi huy hiệu dệt thể hiện niềm tự hào về đội của bạn. Được làm bằng 100% vật liệu tái chế, sản phẩm này chỉ là một trong những giải pháp của chúng tôi nhằm giúp chấm dứt rác thải nhựa.</p><p>Hướng dẫn bảo quản:</p><p>- Dùng nước lạnh hay nước ấm dưới 40 độ C và không giặt chung với quần áo khác.</p><p>- Không sử dụng thuốc tẩy hoặc bột giặt có độ tẩy cao</p><p>- Không ngâm trong nước hay nước xà phòng quá một giờ trước khi giặt.</p><p>- Không được giặt hoặc sấy khô bằng máy.</p><p>- Ủi với nhiệt độ thích hợp cho từng loại vải, tuyệt đối không ủi lên hình in, thêu.</p><p>- Tranh phơi dưới nắng gắt để bảo quản màu sắc.</p>', '2024-06-08 05:51:13', 1, 3, 1, 2, 8),
(51, 'QUẢ BÓNG ĐÁ NIKE FOOTBALL FUTSAL MAESTRO - WHITE/BLACK/MULTICOLOR FJ5547-100-PRO', '<p>Quả b&oacute;ng đ&aacute; Nike Football Futsal Maestro - White/Black/Multicolor FJ5547-100-PRO l&agrave; quả b&oacute;ng đ&aacute; thi đấu futsal&nbsp;c&oacute; thiết kế ch&acirc;n thực. Quả b&oacute;ng nặng hơn một quả b&oacute;ng đ&aacute; th&ocirc;ng thường, n&oacute; kh&ocirc;ng nảy l&ecirc;n khỏi mặt đất - n&oacute; được thiết kế để chơi b&oacute;ng đ&aacute; trong nh&agrave;-futsal. B&oacute;ng c&oacute; k&iacute;ch thước, trọng lượng ch&iacute;nh thức v&agrave; đạt ti&ecirc;u chuẩn futsal quốc tế.</p>\r\n\r\n<p>Về c&ocirc;ng nghệ của phi&ecirc;n bản B&oacute;ng đ&aacute;&nbsp;Nike Football Futsal Maestro:</p>\r\n\r\n<p>Chất liệu: 60% cao su, 15% polyurethane, 13% polyester, 12% EVA.</p>\r\n\r\n<p>Vỏ b&oacute;ng được dập nỗi bằng c&ocirc;ng nghệ kh&acirc;u thủ c&ocirc;ng.</p>\r\n\r\n<p>Buồng kh&ocirc;ng kh&iacute; cao su hỗ trợ duy tr&igrave; &aacute;p suất v&agrave; h&igrave;nh dạng kh&ocirc;ng kh&iacute;.</p>\r\n\r\n<p>Thiết kế 12 tấm da gh&eacute;p.</p>\r\n\r\n<p>Logo NIKE với đồ họa swoosh nổi bật.</p>\r\n', '2024-04-03 01:30:44', 1, 36, 2, 1, 40),
(52, 'QUẢ BÓNG ĐÁ ADIDAS FOOTBALL LEAGUE CHAMPIONS LEAGUE 2023/24 - WHITE/SILVER METALLIC/BLUE', '<p>TRÁI BÓNG TẬP LUYỆN GIÚP MÀN TRÌNH DIỄN BÓNG ĐÁ CỦA BẠN THÊM HẤP DẪN.</p><p>Những cầu thủ giỏi nhất của CLB bóng đá châu Âu đang vai kề vai, hai từ chứa đầy cảm hứng khi bài nhạc nổi tiếng đó vang lên. Với họa tiết graphic lấy cảm hứng từ trái bóng thi đấu chính thức của giải UEFA Champions League, trái bóng tập luyện adidas UCL này là lựa chọn lý tưởng cho tần suất sử dụng cao nhờ kết cấu khâu máy và ruột bóng bằng cao su butyl. Bề mặt sần nổi bật lên dòng chữ \"The Champions\" cùng những nốt nhạc tinh tế và 12 ngôi sao tỏa sáng.</p>', '2024-06-08 05:54:40', 1, 36, 1, 1, 6),
(53, 'BÓNG ĐÁ NIKE FOOTBALL FLIGHT PREMIER LEAGUE - WHITE/BRIGHT CRIMSON/BLACK', '<p>Sẵn s&agrave;ng cho giai đoạn cuối c&ugrave;ng của m&ugrave;a giải Ngoại hạng Anh năm nay, Nike đ&atilde; nhanh ch&oacute;ng ph&aacute;t h&agrave;nh&nbsp;quả b&oacute;ng thi đấu thứ ba - Flight Third&nbsp;với những họa tiết s&aacute;ng tạo v&agrave; bắt mắt, đ&acirc;y sẽ l&agrave; quả b&oacute;ng thi đấu ch&iacute;nh thức cho c&aacute;c trận đấu c&ograve;n lại của m&ugrave;a giải.</p>\r\n\r\n<p>Như một sự n&acirc;ng cấp của hai phi&ecirc;n bản trước đ&oacute;,&nbsp;quả b&oacute;ng thi đấu&nbsp;thứ ba - Nike Flight Third được đầu tư hơn về mặt h&igrave;nh ảnh v&agrave; m&agrave;u sắc đồ họa. C&aacute;c họa tiết chữ &ldquo;X&rdquo; được ph&oacute;ng to hơn v&agrave; c&aacute;ch điệu bằng những đường n&eacute;t g&oacute;c cạnh đầy ấn tượng tr&ecirc;n gam m&agrave;u trắng, tạo n&ecirc;n một giao diện bắt mắt v&agrave; thu h&uacute;t người xem ngay khi quả b&oacute;ng xuất hiện tr&ecirc;n s&acirc;n. Kh&ocirc;ng chỉ thế, việc chữ &ldquo;X&rdquo; được biến tấu mang t&iacute;nh nghệ thuật cao c&ograve;n hỗ trợ cực hiệu quả về mặt h&igrave;nh ảnh, gi&uacute;p người chơi cảm nhận được độ xo&aacute;y v&agrave; tốc độ cực nhanh của quả b&oacute;ng, đồng thời g&oacute;p phần kh&ocirc;ng nhỏ tạo ra những đường b&oacute;ng m&atilde;n nh&atilde;n cho người xem.</p>\r\n\r\n<p>C&ocirc;ng nghệ của quả b&oacute;ng thi đấu Nike Flight Third Premier League 22/23&nbsp;</p>\r\n\r\n<p>Về mặt c&ocirc;ng nghệ, quả b&oacute;ng thi đấu Nike Flight Third Premier League 22/23&nbsp;&nbsp;vẫn giữ được những n&eacute;t đặc trưng c&ocirc;ng nghệ hiện đại nhất của 2 phi&ecirc;n bản trước</p>\r\n\r\n<p>- C&ocirc;ng nghệ AerowSculpt: c&aacute;c r&atilde;nh đ&uacute;c tr&ecirc;n bề mặt quả b&oacute;ng gi&uacute;p lưu th&ocirc;ng kh&ocirc;ng kh&iacute; xung quanh b&oacute;ng gi&uacute;p cải thiện quỹ đạo b&oacute;ng ch&iacute;nh x&aacute;c hơn.</p>\r\n\r\n<p>-&nbsp;Nike All condition Control (ACC)&nbsp;l&agrave; c&ocirc;ng nghệ tạo một lớp phủ l&ecirc;n bề mặt b&oacute;ng, cho ph&eacute;p c&aacute;c cầu thủ kiểm so&aacute;t những c&uacute; s&uacute;t tốt hơn trong mọi điều kiện thời tiết.&nbsp;</p>\r\n\r\n<p>-&nbsp;Mực in 3D&nbsp;tinh tế tr&ecirc;n c&aacute;c &ldquo;micro flaps&rdquo; dọc theo Nike AerowSculpt.</p>\r\n', '2024-04-03 01:33:13', 1, 36, 2, 0, 12),
(54, 'GĂNG TAY THỦ MÔN ADIDAS GOALKEEPER GLOVES PREDATOR TRAINING CRAZYRUSH - FOOTWEAR WHITE/CORE BLACK/LUCID LEMON', '<p>Sẵn sàng cho giai đoạn cuối cùng của mùa giải Ngoại hạng Anh năm nay, Nike đã nhanh chóng phát hành&nbsp;quả bóng thi đấu thứ ba - Flight Third&nbsp;với những họa tiết sáng tạo và bắt mắt, đây sẽ là quả bóng thi đấu chính thức cho các trận đấu còn lại của mùa giải.</p><p>Như một sự nâng cấp của hai phiên bản trước đó,&nbsp;quả bóng thi đấu&nbsp;thứ ba - Nike Flight Third được đầu tư hơn về mặt hình ảnh và màu sắc đồ họa. Các họa tiết chữ “X” được phóng to hơn và cách điệu bằng những đường nét góc cạnh đầy ấn tượng trên gam màu trắng, tạo nên một giao diện bắt mắt và thu hút người xem ngay khi quả bóng xuất hiện trên sân. Không chỉ thế, việc chữ “X” được biến tấu mang tính nghệ thuật cao còn hỗ trợ cực hiệu quả về mặt hình ảnh, giúp người chơi cảm nhận được độ xoáy và tốc độ cực nhanh của quả bóng, đồng thời góp phần không nhỏ tạo ra những đường bóng mãn nhãn cho người xem.</p><p>Công nghệ của quả bóng thi đấu Nike Flight Third Premier League 22/23&nbsp;</p><p>Về mặt công nghệ, quả bóng thi đấu Nike Flight Third Premier League 22/23&nbsp;&nbsp;vẫn giữ được những nét đặc trưng công nghệ hiện đại nhất của 2 phiên bản trước</p><p>- Công nghệ AerowSculpt: các rãnh đúc trên bề mặt quả bóng giúp lưu thông không khí xung quanh bóng giúp cải thiện quỹ đạo bóng chính xác hơn.</p><p>-&nbsp;Nike All condition Control (ACC)&nbsp;là công nghệ tạo một lớp phủ lên bề mặt bóng, cho phép các cầu thủ kiểm soát những cú sút tốt hơn trong mọi điều kiện thời tiết.&nbsp;</p><p>-&nbsp;Mực in 3D&nbsp;tinh tế trên các “micro flaps” dọc theo Nike AerowSculpt.</p>', '2024-06-04 09:25:35', 1, 6, 1, 8, 1),
(55, 'GĂNG TAY THỦ MÔN NIKE GOALKEEPER GLOVES MATCH READY - BRIGHT CRIMSON/BLACK/WHITE', '<p>Găng tay thủ m&ocirc;n Nike Goalkeeper Gloves Match Ready - Bright Crimson/Black/White&nbsp;sẵn s&agrave;ng c&ugrave;ng bạn trong mọi pha cứu thua. Lớp đệm mềm, hỗ trợ trong c&aacute;c pha bắt b&oacute;ng. Thiết kế bề mặt nhẵn gi&uacute;p bạn dễ d&agrave;ng cầm nắm d&ugrave; trong điều kiện ẩm ướt hay kh&ocirc; r&aacute;o.</p>\r\n\r\n<p>TH&Ocirc;NG SỐ</p>\r\n\r\n<p>Lớp đệm trong l&ograve;ng b&agrave;n tay cung cấp gi&uacute;p hấp thụ va chạm.<br />\r\nPhối lưới tho&aacute;ng kh&iacute; cho cảm gi&aacute;c m&aacute;t mẻ, kh&ocirc; r&aacute;o.<br />\r\nBề mặt l&ograve;ng b&agrave;n tay nhẵn gi&uacute;p bạn cầm b&oacute;ng tốt hơn.<br />\r\nD&acirc;y đeo cổ tay c&oacute; thể điều chỉnh tạo sự vừa vặn an to&agrave;n.</p>\r\n', '2024-04-03 01:38:59', 1, 6, 2, 1, 4),
(56, 'PUMA ULTRA ULTIMATE CAGE CAGE \'BREAKTHROUGH\' PACK', '<p>Tên sản phẩm: Puma Ultra Ultimate Cage TT (Giày đá bóng sân cỏ nhân tạo)<br>Hãng: Puma<br>Màu sắc: Trắng/Đỏ<br>Bộ sưu tập: Breakthrough Pack (2023)<br>Mã sản phẩm: 107502 01<br>Loại đế giày: Turf (TF dành cho mặt sân cỏ nhân tạo)<br>Phân khúc: Ultimate (Cao cấp)<br>Lưỡi gà: Dạng cổ thun&nbsp;<br>Form chân phù hợp: Thon, Bè vừa<br>Thời điểm ra mắt: 2023<br>Phong cách thi đấu: Tốc độ, Dứt điểm, Phòng ngự (Tiền đạo cánh, Hậu vệ)<br>Những cầu thủ đại diện: Maguire, Walker, Antoine Griezmann..</p>', '2024-05-26 05:15:54', 1, 1, 3, 2, 0),
(57, 'adidas Al Rihla World Cup 2022', '<p>T&ecirc;n sản phẩm: adidas X Speedportal .1 TF&nbsp;<br />\r\nM&agrave;u sắc: Xanh/Nhiều m&agrave;u<br />\r\nBộ sưu tập: Al Rihla Pack (2022)<br />\r\nM&atilde; sản phẩm: GW8972<br />\r\nLoại đế gi&agrave;y: Turf (TF d&agrave;nh cho mặt s&acirc;n cỏ nh&acirc;n tạo)<br />\r\nPh&acirc;n kh&uacute;c: .1 (Cao cấp)<br />\r\nTrọng lượng: 241 gram/chiếc (Size 41)<br />\r\nLưỡi g&agrave;: Dạng cổ thun&nbsp;<br />\r\nForm ch&acirc;n ph&ugrave; hợp: Thon, B&egrave; vừa<br />\r\nThời điểm ra mắt: 2022<br />\r\nPhong c&aacute;ch thi đấu: Tốc độ, Dứt điểm (Tiền đạo, Chạy c&aacute;nh)<br />\r\nNhững cầu thủ đại diện: Lionel Messi, Rafael Leao, Mohamed Salah, Son Heung-min, &hellip;<br />\r\nC&ocirc;ng nghệ, chất liệu:<br />\r\n- Form d&aacute;ng thon gọn, tốc độ.<br />\r\n- Chất liệu Speedskin bền bỉ, mỏng nhẹ kết hợp với gai nhỏ tăng khả năng kiểm so&aacute;t b&oacute;ng.<br />\r\n- Phần cổ thun được l&agrave;m bằng sợi dệt Primeknit độc quyền v&agrave; được xẻ th&ecirc;m gi&uacute;p &ocirc;m trọn cổ ch&acirc;n.<br />\r\n- Bộ đế được chia l&agrave;m hai mảnh tăng t&iacute;nh linh hoạt khi di chuyển v&agrave; bứt tốc.<br />\r\n- Bộ đệm độc quyền Lightstrike nhẹ nh&agrave;ng, &ecirc;m &aacute;i l&ograve;ng b&agrave;n ch&acirc;n v&agrave; hỗ trợ tạo động lực cho những pha bứt tốc.</p>\r\n', '2024-04-03 01:44:44', 1, 1, 1, 0, 0),
(58, 'NIKE  MERCURIAL VAPOR 13 ACADEMY TF ', '<p>Tên sản phẩm: Nike Mercurial Vapor 13 Academy TF&nbsp;<br>Màu sắc: Vàng<br>Mã sản phẩm: AT7996-801<br>Loại đế giày: Turf (TF dành cho mặt sân cỏ nhân tạo)<br>Phân khúc: Academy<br>Lưỡi gà: Dạng Lưỡi gà rời<br>Thời điểm ra mắt: 2021<br>Phong cách thi đấu: Tiền đạo, chạy cánh, tốc độ<br>Những cầu thủ đại diện: Bruno Fernandes, Lewandowski,...</p>', '2024-05-26 05:16:07', 1, 1, 2, 13, 3),
(59, 'adidas COPA PURE.3 TF \'CRAZYRUSH\' PACK', '<p>Tên sản phẩm: adidas Copa Pure.3 TF (Giày đá bóng sân cỏ nhân tạo)<br>Màu sắc: Trắng/Xanh lá<br>Bộ sưu tập: Crazyrush Pack (2023)<br>Mã sản phẩm: GZ2522<br>Loại đế giày: Turf (TF dành cho mặt sân cỏ nhân tạo)<br>Phân khúc: .3 (Phổ thông)<br>Lưỡi gà: Dạng cổ rời<br>Form chân phù hợp: Thon, Bè vừa<br>Thời điểm ra mắt: 2023<br>Phong cách thi đấu: Cầm bóng, điều phối bóng (Tiền vệ)<br>Những cầu thủ đại diện: Pedri, Gundogan...</p>', '2024-05-26 05:13:40', 1, 1, 1, 0, 1),
(60, 'NIKE JR. TIEMPO 10 ACADEMY TF \'PEAK READY\' PACK', '<p><strong>T&ecirc;n sản phẩm:&nbsp;</strong>Nike Jr. Tiempo 10&nbsp;Academy TF (Gi&agrave;y đ&aacute; b&oacute;ng s&acirc;n cỏ nh&acirc;n tạo)</p>\r\n\r\n<p><strong>M&agrave;u sắc:&nbsp;</strong>Xanh lục/T&iacute;m</p>\r\n\r\n<p><strong>Bộ sưu tập:&nbsp;</strong>Peak Ready Pack</p>\r\n\r\n<p><strong>M&atilde; sản phẩm:&nbsp;</strong>DV4351-300</p>\r\n\r\n<p><strong>Loại đế gi&agrave;y:&nbsp;</strong>Turf (TF d&agrave;nh cho mặt s&acirc;n cỏ nh&acirc;n tạo)</p>\r\n\r\n<p><strong>Ph&acirc;n kh&uacute;c:&nbsp;</strong>Academy (Phổ th&ocirc;ng/Mid-end)</p>\r\n\r\n<p><strong>Trọng lượng:&nbsp;</strong>236 gram/chiếc (Size 41)</p>\r\n\r\n<p><strong>Lưỡi g&agrave;:&nbsp;</strong>Dạng lưỡi g&agrave; rời&nbsp;</p>\r\n\r\n<p><strong>Form ch&acirc;n ph&ugrave; hợp:&nbsp;</strong>Thon -&gt;&nbsp;B&egrave; nhiều</p>\r\n\r\n<p><strong>Thời điểm ra mắt:&nbsp;</strong>2023</p>\r\n\r\n<p><strong>Phong c&aacute;ch thi đấu:&nbsp;</strong>Kiểm so&aacute;t b&oacute;ng, Chuyền b&oacute;ng, Dứt điểm, Chia b&agrave;i (Tiền vệ, Hậu vệ)</p>\r\n\r\n<p><strong>Những cầu thủ đại diện:&nbsp;</strong>Virgil Van Dijk, Jordan Henderson, Tonali</p>\r\n\r\n<p><strong>C&ocirc;ng nghệ, chất liệu:</strong></p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Form d&aacute;ng chắc chắn, b&egrave; nhiều.</p>\r\n	</li>\r\n</ul>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Chất liệu da Flytouch Lite si&ecirc;u mềm mại, được thiết kế nhiều v&ugrave;ng chạm b&oacute;ng để tăng khả năng kiểm so&aacute;t b&oacute;ng.</p>\r\n	</li>\r\n	<li>\r\n	<p>Được trang bị lưỡi g&agrave; rời dễ d&agrave;ng thao t&aacute;c mang th&aacute;o gi&agrave;y.</p>\r\n	</li>\r\n	<li>\r\n	<p>Bộ đế gồm những đinh nhiều h&igrave;nh dạng kh&aacute;c nhau với mật độ nhiều tăng khả năng b&aacute;m s&acirc;n.</p>\r\n	</li>\r\n	<li>\r\n	<p>Bộ đệm độc quyền EVA mềm mại, tăng độ &ecirc;m &aacute;i khi thi đấu với thời gian d&agrave;i.</p>\r\n	</li>\r\n</ul>\r\n', '2024-04-03 01:51:14', 1, 1, 2, 1, 2),
(61, 'PUMA KING ULTIMATE FG/AG \'SUPERCHARGE\' PACK', '<p>T&ecirc;n sản phẩm: Puma King Ultimate (Gi&agrave;y đ&aacute; b&oacute;ng s&acirc;n cỏ tự nhi&ecirc;n)<br />\r\nH&atilde;ng: Puma<br />\r\nM&agrave;u sắc: Trắng/Xanh Dương<br />\r\nBộ sưu tập: Supercharge (2023)<br />\r\nM&atilde; sản phẩm: 107097 01<br />\r\nLoại đế gi&agrave;y: Firm Ground (FG d&agrave;nh cho mặt s&acirc;n tự nhi&ecirc;n)<br />\r\nPh&acirc;n kh&uacute;c: Ultimate (Cao cấp)<br />\r\nLưỡi g&agrave;: Dạng cổ thun&nbsp;<br />\r\nForm ch&acirc;n ph&ugrave; hợp: Thon, B&egrave; vừa<br />\r\nThời điểm ra mắt: 2023<br />\r\nPhong c&aacute;ch thi đấu: Tốc độ, Dứt điểm (Tiền đạo, Chạy c&aacute;nh)<br />\r\nNhững cầu thủ đại diện: Pulisic, Antony, Kingsley Coman,...</p>\r\n', '2024-04-03 01:52:27', 1, 1, 3, 0, 3),
(62, 'Đai bảo vệ gối thoáng khí có đai cuốn Aolikes AL7720 (1 cặp)', '<h3><strong>ĐAI BẢO VỆ GỐI AL7720&nbsp;DÀNH CHO NHỮNG AI?</strong></h3><ul><li>Thích hợp sử dụng cho người chơi thể thao: Bóng đá, cầu lông, đạp xe, chạy bộ, leo núi…</li><li>Các trường hợp chấn thương hậu phẫu, cố định đầu gối theo chỉ định của bác sĩ.</li><li>Đai bảo vệ gối AL7720 giúp những người gặp chấn thương vùng gối nhưng không muốn sử dụng miếng đệm Silicone gây khó chịu. Dây đai với điểm gắn cố định từ dây chằng chéo sau được quấn ra đằng trước(phần trên và dưới mặt gối) giúp giảm áp lực tối đa lên vùng xương bánh chè, xương dưới sụn, dây chằng và gân</li><li>Ưu tiên sử dụng loại chất liệu vải Spandex thoáng khí, thoát mồ hôi tốt. Dây đai Latex siêu co giãn phù hợp bó chắc chân và đầu gối người dùng. Sản phẩm băng thun đầu gối cũng có miếng dán vuông làm điểm bám cho phần dính của dây đai, không dễ bung tuột</li></ul><p><img src=\"https://www.thethaoaolikes.com/upload/public/88888df0439145fd6f300067c7bb3d6a.jpg\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://www.thethaoaolikes.com/upload/public/bc2e011c6b8e919a0ad872b381732632.jpg\" width=\"600\" height=\"600\"></p><p><img src=\"https://www.thethaoaolikes.com/upload/public/21d9ed0265efeac943248dbbb92121cc.jpg\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><p>&nbsp;</p><h3><strong>LÝ DO KHIẾN BẠN NÊN SỬ DỤNG&nbsp;ĐAI BẢO VỆ GỐI AL7720</strong></h3><ul><li>&nbsp;Bảo vệ gối sau phẫu thuật, cố định đầu gối</li><li>&nbsp;Không sử dụng miếng Silicone gây khó chịu</li><li>&nbsp;Siêu co giãn và chắc chắn, sử dụng loại chất liệu vải Spandex thoáng khí, thoát mồ hôi tốt</li><li>&nbsp;Dây đai với điểm gắn cố định từ dây chằng chéo sau</li><li>&nbsp;Miếng dán chắc chắn làm điểm bám cho dây đai, không dễ bung tuột</li><li>&nbsp;Lý tưởng cho cả nam và nữ</li></ul><p>&nbsp;</p><p>&nbsp;</p><p>Thiết kế đai gối dạng ống dễ đeo. Bộ đôi dây đai bao quanh vùng trên và dưới khớp gối bó chắc vùng khớp gối, xương bánh chè, dây chằng.&nbsp;Bó gối thể thao&nbsp;có khả năng chống sốc, giảm áp lực rất tốt.</p><p><img src=\"https://aolikesvietnam.com/wp-content/uploads/2019/05/Dai-bao-ve-goi-thoang-khi-co-dai-cuon-Aolikes_1.jpg\" alt=\"Những tính năng vượt trội của bó gối thể thao Aolikes \" width=\"961\" height=\"847\"></p><p><img src=\"https://aolikesvietnam.com/wp-content/uploads/2019/05/Dai-bao-ve-goi-thoang-khi-co-dai-cuon-Aolikes_4.jpg\" alt=\"Cận cảnh chất liệu vải co giãn 4 chiều \" width=\"961\" height=\"813\"></p><p><img src=\"https://aolikesvietnam.com/wp-content/uploads/2019/05/Dai-bao-ve-goi-thoang-khi-co-dai-cuon-Aolikes_6.jpg\" alt=\"Miếng dán dày dặn, chắc chắn \" width=\"961\" height=\"801\"></p><p>&nbsp;</p><p>Sản phẩm chính hãng&nbsp;Aolikes Việt Nam&nbsp;”Ăn điểm” tuyệt đối với những người gặp chấn thương vùng gối nhưng không muốn sử dụng miếng đệm Silicone gây khó chịu. Dây đai với điểm gắn cố định từ dây chằng chéo sau được quấn ra đằng trước (Phần trên và dưới mặt gối) giúp giảm áp lực tối đa lên vùng xương bánh chè, xương dưới sụn, dây chằng và gân.</p><p>&nbsp;</p><p>&nbsp;</p><h3><strong>HƯỚNG DẪN SỬ DỤNG</strong></h3><ul><li>Luồn chân vào đai bảo vệ (Đầu rộng lên phần đùi)</li><li>Cuốn dây đai từ sau ra trước và dán tại điểm ô vuông</li></ul><p><img src=\"https://aolikesvietnam.com/wp-content/uploads/2019/05/Dai-bao-ve-goi-thoang-khi-co-dai-cuon-Aolikes_3.jpg\" alt=\"Cách sử dụng đai bảo vệ gối Aolikes AL7720\" width=\"961\" height=\"1110\"><img src=\"https://aolikesvietnam.com/wp-content/uploads/2019/05/AL7720-1.jpg\" alt=\"Thông tin chi tiết sản phẩm đai bảo vệ gối Aolikes AL7720 \" width=\"961\" height=\"1185\"></p>', '2024-05-18 22:39:42', 1, 4, 6, 0, 1),
(63, 'Bộ bó gối đàn hồi bảo vệ khớp Aolikes AL7718 (1 cặp)', '<p>Bộ b&oacute; gối đ&agrave;n hồi bảo vệ khớp Aolikes AL7718 (1 cặp)<br />\r\nBạn đ&atilde; thực sự biết c&aacute;ch bảo vệ bản th&acirc;n khi chơi b&oacute;ng đ&aacute;? Việc sử dụng phụ kiện bảo vệ c&aacute;c khớp, nhất l&agrave; đầu gối l&agrave; một phần cực kỳ quan trọng trong b&oacute;ng đ&aacute;, ảnh hưởng trực tiếp đến chất lượng chơi b&oacute;ng của bạn. C&aacute;c loại chấn thương thường gặp trong b&oacute;ng đ&aacute; li&ecirc;n quan đến vị tr&iacute; gối như gi&atilde;n&nbsp;d&acirc;y chằng, đứt d&acirc;y chằng trước/sau, vi&ecirc;m sụn tr&ecirc;n gối...&nbsp;Đừng để m&igrave;nh gặp chấn thương ảnh hưởng đến sức khỏe lập tức v&agrave; đau nhức l&acirc;u d&agrave;i. Trang bị&nbsp;B&oacute; gối đ&agrave;n hồi bảo vệ khớp Aolikes AL7718&nbsp;trước khi bắt đầu tập luyện, ngo&agrave;i ra bộ phụ kiện c&ograve;n hỗ trợ rất tốt cho những người đang bị chấn thương m&agrave; cần tập luyện, hỗ trợ chấn thương gi&uacute;p cầu thủ sớm hồi phục v&agrave; quay lại s&acirc;n cỏ.</p>\r\n', '2024-04-03 01:55:53', 1, 4, 6, 1, 1),
(64, 'Mizuno Morelia Neo IV Beta Elite FG - Dyna Pack', '<p>MIZUNO MORELIA NEO III ELITE FG<br />\r\nT&ecirc;n sản phẩm:&nbsp;Mizuno Morelia Neo IV Beta&nbsp;Elite FG (Gi&agrave;y đ&aacute; b&oacute;ng s&acirc;n cỏ tự nhi&ecirc;n)<br />\r\nM&agrave;u sắc: Xanh lục<br />\r\nM&atilde; sản phẩm:&nbsp;P1GA244245<br />\r\nThương hiệu: Mizuno (Nhật Bản)<br />\r\nLoại đế gi&agrave;y: FG d&agrave;nh cho mặt s&acirc;n cỏ tự nhi&ecirc;n<br />\r\nPh&acirc;n kh&uacute;c:&nbsp;Elite&nbsp;(Cao cấp)<br />\r\nForm gi&agrave;y:&nbsp;Tương đối thoải m&aacute;i, ph&ugrave; hợp ch&acirc;n thon đến&nbsp;b&egrave;<br />\r\nLưỡi g&agrave;:&nbsp;dạng lưỡi g&agrave; rời, chất liệu da tự nhi&ecirc;n<br />\r\nChất liệu Upper:&nbsp;chất liệu da tự nhi&ecirc;n<br />\r\nNăm sản xuất:&nbsp;2023<br />\r\nPhong c&aacute;ch thi đấu:&nbsp;Mọi vị tr&iacute; tr&ecirc;n s&acirc;n</p>\r\n', '2024-04-03 01:57:09', 1, 1, 5, 0, 3),
(65, 'Mizuno Morelia Neo IV Pro FG - Aurum Pack', '<p>MIZUNO MORELIA NEO IV PRO FG<br />\r\nT&ecirc;n sản phẩm:&nbsp;Mizuno Morelia Neo IV Pro FG (Gi&agrave;y đ&aacute; b&oacute;ng s&acirc;n cỏ tự nhi&ecirc;n)<br />\r\nM&agrave;u sắc: Đen/Gold<br />\r\nM&atilde; sản phẩm:&nbsp;P1GA2334-50<br />\r\nThương hiệu: Mizuno (Nhật Bản)<br />\r\nLoại đế gi&agrave;y: FG d&agrave;nh cho mặt s&acirc;n cỏ tự nhi&ecirc;n<br />\r\nPh&acirc;n kh&uacute;c:&nbsp;Pro (Mid-end)<br />\r\nForm gi&agrave;y:&nbsp;Tương đối thoải m&aacute;i, ph&ugrave; hợp ch&acirc;n thon đến&nbsp;b&egrave;<br />\r\nLưỡi g&agrave;:&nbsp;dạng lưỡi g&agrave; rời, chất liệu da tự nhi&ecirc;n<br />\r\nChất liệu Upper:&nbsp;chất liệu da tự nhi&ecirc;n<br />\r\nNăm sản xuất:&nbsp;2023<br />\r\nPhong c&aacute;ch thi đấu:&nbsp;Mọi vị tr&iacute; tr&ecirc;n s&acirc;n</p>\r\n', '2024-04-03 01:58:14', 1, 1, 5, 0, 1),
(66, 'Mizuno Alpha Elite FG - Prism Gold', '<p>MIZUNO ALPHA ELITE FG<br />\r\nT&ecirc;n sản phẩm:&nbsp;Mizuno Alpha Elite FG (Gi&agrave;y đ&aacute; b&oacute;ng s&acirc;n cỏ tự nhi&ecirc;n)<br />\r\nM&agrave;u sắc: Trắng<br />\r\nM&atilde; sản phẩm:&nbsp;P1GA244245<br />\r\nThương hiệu: Mizuno (Nhật Bản)<br />\r\nLoại đế gi&agrave;y: FG d&agrave;nh cho mặt s&acirc;n cỏ tự nhi&ecirc;n<br />\r\nPh&acirc;n kh&uacute;c:&nbsp;Elite&nbsp;(Cao cấp)<br />\r\nForm gi&agrave;y:&nbsp;Tương đối thoải m&aacute;i, ph&ugrave; hợp ch&acirc;n thon đến&nbsp;b&egrave;<br />\r\nLưỡi g&agrave;:&nbsp;dạng lưỡi g&agrave; rời, chất liệu da tự nhi&ecirc;n<br />\r\nChất liệu Upper:&nbsp;chất liệu tổng hợp<br />\r\nNăm sản xuất:&nbsp;2023<br />\r\nPhong c&aacute;ch thi đấu:&nbsp;Mọi vị tr&iacute; tr&ecirc;n s&acirc;n</p>\r\n', '2024-04-03 01:59:15', 1, 1, 5, 8, 8),
(67, 'BỌC ỐNG ĐỒNG NIKE SHIN PADS MERCURIAL HARD SHELL READY - BRIGHT CRIMSON/BLACK', '<p>Bọc ống đồng Nike Shin Pads Mercurial Hard Shell Ready - Bright Crimson/Black được ra mắt trong năm 2023, cung cấp cho người chơi cảm gi&aacute;c thoải m&aacute;i khi sử dụng, lớp vỏ bền chắc chắn được thiết kế nhỏ gọn bằng chất liệu nhựa Resin. Ngo&agrave;i ra, b&ecirc;n trong được cấu tạo đệm Foam &ecirc;m &aacute;i chống va đập, tho&aacute;ng kh&iacute;. Chắc chắn đ&acirc;y l&agrave; d&ograve;ng phụ kiện kh&ocirc;ng thể thiếu cho những t&iacute;n đồ đam m&ecirc; Mercurial.</p>\r\n', '2024-04-03 02:00:21', 1, 4, 2, 3, 18),
(68, 'BỌC ỐNG ĐỒNG PREDATORS 20 SHIN GUARDS - WHITE', '<p>BỌC ỐNG ĐỒNG PREDATORS 20 SHIN GUARDS - WHITE được ra mắt trong năm 2023, cung cấp cho người chơi cảm gi&aacute;c thoải m&aacute;i khi sử dụng, lớp vỏ bền chắc chắn được thiết kế nhỏ gọn bằng chất liệu nhựa Resin. Ngo&agrave;i ra, b&ecirc;n trong được cấu tạo đệm Foam &ecirc;m &aacute;i chống va đập, tho&aacute;ng kh&iacute;.</p>\r\n', '2024-04-03 02:01:19', 1, 4, 1, 0, 8),
(69, 'Puma ONE 5.4 IT', '<p>T&ecirc;n sản phẩm:&nbsp;Puma ONE 5.4 IT&nbsp;(Gi&agrave;y đ&aacute; b&oacute;ng s&acirc;n Futsal)<br />\r\nH&atilde;ng:&nbsp;Puma<br />\r\nM&agrave;u sắc:&nbsp;Đỏ<br />\r\nM&atilde; sản phẩm:&nbsp;105654 01<br />\r\nLoại đế gi&agrave;y:&nbsp;Indoor Court&nbsp;(IC d&agrave;nh cho mặt s&acirc;n Trong nh&agrave;)<br />\r\nLưỡi g&agrave;:&nbsp;Dạng cổ rời<br />\r\nForm ch&acirc;n ph&ugrave; hợp:&nbsp;Thon, B&egrave; vừa, B&egrave;<br />\r\nThời điểm ra mắt:&nbsp;2022<br />\r\nPhong c&aacute;ch thi đấu:&nbsp;R&ecirc; gầm, chuyền chọc&nbsp;(Đặc điểm thuộc c&aacute;c vị tr&iacute; như Ala)</p>\r\n', '2024-04-03 02:03:01', 1, 1, 3, 1, 7),
(70, 'Puma Future 3.4 TT - Fearless Pack', '<p>PUMA FUTURE 3.4 TT &#39;FEARLESS&#39; PACK</p>\r\n\r\n<p>Puma sẽ l&agrave; thương hiệu gi&agrave;y đ&aacute; b&oacute;ng tiếp theo cho ra mắt phối m&agrave;u d&agrave;nh cho World Cup 2022 mang t&ecirc;n &ldquo;The Fearless&rdquo; (Sự can đảm). Bộ sưu tập n&agrave;y tạo động lực cho c&aacute;c cầu thủ thể hiện&nbsp;lối chơi b&oacute;ng s&aacute;ng tạo với diện mạo mới đầy sức sống của Puma Ultra Ultimate v&agrave; Future Z.</p>\r\n', '2024-04-03 02:04:43', 1, 1, 3, 1, 17),
(71, 'ÁO BÓNG ĐÁ CHÍNH HÃNG REAL MADRID SÂN NHÀ 2023/24', '<p>Real Madrid, một c&aacute;i t&ecirc;n kh&ocirc;ng thể thiếu khi nhắc đến những c&acirc;u lạc bộ b&oacute;ng đ&aacute; h&agrave;ng đầu thế giới. D&ugrave; m&ugrave;a giải trước kh&ocirc;ng diễn ra như mong đợi, c&acirc;u lạc bộ vẫn lu&ocirc;n nằm trong danh s&aacute;ch những đội b&oacute;ng th&agrave;nh c&ocirc;ng nhất mọi thời đại. V&agrave; với lịch sử đầy tự h&agrave;o đ&oacute; đ&atilde; trở th&agrave;nh nguồn cảm hứng cho Adidas tạo n&ecirc;n một t&aacute;c phẩm độc đ&aacute;o - chiếc &aacute;o đấu s&acirc;n nh&agrave; mới nhất m&ugrave;a giải 23/24 - Bộ &aacute;o m&agrave;u trắng truyền thống, nay được thiết kế với một hơi thở mới.</p>\r\n\r\n<p>Với nguồn cảm hứng từ những thiết kế trong qu&aacute; khứ, đặc biệt l&agrave; chiếc &aacute;o m&ugrave;a giải 2011/12, những chi tiết m&agrave;u v&agrave;ng từ c&aacute;c bộ &aacute;o trước được t&aacute;i xuất c&ugrave;ng với khung m&agrave;u hải qu&acirc;n. Ch&uacute;ng xuất hiện tr&ecirc;n logo ba sọc của Adidas tr&ecirc;n vai, v&agrave; quanh cổ &aacute;o v&agrave; cổ tay &aacute;o, ph&ugrave; hợp với huy hiệu nh&agrave; v&ocirc; địch Club World Cup, nằm tr&ecirc;n logo Adidas tr&ecirc;n ngực.&nbsp;</p>\r\n\r\n<p>C&aacute;c chi tiết m&agrave;u hải qu&acirc;n h&ograve;a quyện một c&aacute;ch tinh tế với m&agrave;u v&agrave;ng v&agrave; tạo điểm nhất tr&ecirc;n c&aacute;c panel b&ecirc;n v&agrave; qua gấu &aacute;o ph&iacute;a sau. Một họa tiết in sublimation tổng thể l&agrave; một bản cập nhật tinh tế cho m&agrave;u trắng truyền thống, trong khi d&ograve;ng chữ &quot;&iexcl;Hala Madrid!&rdquo; xuất hiện ở ph&iacute;a sau cổ &aacute;o như một dấu ấn th&uacute; vị.</p>\r\n\r\n<p>C&ocirc;ng nghệ được sử dụng cho &aacute;o thi đấu s&acirc;n nh&agrave; Real Madrid</p>\r\n\r\n<p>&Aacute;o thi đấu s&acirc;n&nbsp;nh&agrave; Real Madrid si&ecirc;u nhẹ nhờ sử dụng phương ph&aacute;p hơi nhiệt cho nhiều chi tiết tr&ecirc;n &aacute;o, nhằm giảm thiểu trọng lượng tối đa, gi&uacute;p c&aacute;c cầu thủ lu&ocirc;n duy tr&igrave; được phong độ cao trong suốt 90 ph&uacute;t thi đấu.&nbsp;</p>\r\n\r\n<p>Những mảng lưới được đặt ở những khu vực &aacute;o tiếp x&uacute;c với phần cơ thể c&oacute; nhiệt độ cao&nbsp;tăng cường khả năng lưu th&ocirc;ng kh&iacute;.&nbsp;C&ocirc;ng nghệ HEAT.RDY của Adidas&nbsp;đảm bảo rằng bạn lu&ocirc;n cảm thấy&nbsp;m&aacute;t mẻ, kh&ocirc; r&aacute;o v&agrave; thoải m&aacute;i&nbsp;d&ugrave; trong những buổi tập luyện gắt gao hay những ph&uacute;t cuối căng thẳng của c&aacute;c trận đấu quyết định.</p>\r\n\r\n<p>Được sản xuất từ 100% polyester t&aacute;i chế, chiếc &aacute;o n&agrave;y l&agrave; sự lựa chọn ho&agrave;n hảo cho những người h&acirc;m mộ Real Madrid &yacute; thức được tầm quan trọng của việc bảo vệ m&ocirc;i trường v&agrave; muốn đ&oacute;ng g&oacute;p phần l&agrave;m n&ecirc;n sự kh&aacute;c biệt.</p>\r\n\r\n<p>Hướng dẫn bảo quản:</p>\r\n\r\n<p>- D&ugrave;ng nước lạnh hay nước ấm dưới 40 độ C v&agrave; kh&ocirc;ng giặt chung với quần &aacute;o kh&aacute;c.</p>\r\n\r\n<p>- Kh&ocirc;ng sử dụng thuốc tẩy hoặc bột giặt c&oacute; độ tẩy cao</p>\r\n\r\n<p>- Kh&ocirc;ng ng&acirc;m trong nước hay nước x&agrave; ph&ograve;ng qu&aacute; một giờ trước khi giặt.</p>\r\n\r\n<p>- Kh&ocirc;ng được giặt hoặc sấy kh&ocirc; bằng m&aacute;y.</p>\r\n\r\n<p>- Ủi với nhiệt độ th&iacute;ch hợp cho từng loại vải, tuyệt đối kh&ocirc;ng ủi l&ecirc;n h&igrave;nh in, th&ecirc;u.</p>\r\n\r\n<p>- Tranh phơi dưới nắng gắt để bảo quản m&agrave;u sắc.</p>\r\n', '2024-04-03 02:06:54', 1, 3, 1, 11, 36),
(72, 'VỚ BÓNG ĐÁ ADIDAS FOOTBALL SOCKS MILANO 23 WHITE', '<p>Đ&Ocirc;I TẤT THẤM H&Uacute;T ẨM C&Oacute; SỬ DỤNG CHẤT LIỆU T&Aacute;I CHẾ.<br />\r\nGiờ đ&acirc;y bạn c&oacute; thể tr&uacute;t bỏ mọi vướng bận tr&ecirc;n đ&ocirc;i ch&acirc;n v&agrave; tập trung cho m&agrave;n thể hiện đẹp mắt.&nbsp;Đ&ocirc;i tất đ&aacute; b&oacute;ng cao cổ&nbsp;hiệu năng cao n&agrave;y của adidas c&oacute; c&aacute;c v&ugrave;ng n&acirc;ng đỡ v&ograve;m b&agrave;n ch&acirc;n v&agrave; v&ugrave;ng đệm tại những vị tr&iacute; cần thiết. C&ocirc;ng nghệ AEROREADY thấm h&uacute;t ẩm gi&uacute;p đ&ocirc;i ch&acirc;n bạn lu&ocirc;n kh&ocirc; r&aacute;o khi trau chuốt kỹ năng. L&agrave;m từ một loạt chất liệu t&aacute;i chế v&agrave; c&oacute; chứa tối thiểu 40% th&agrave;nh phần t&aacute;i chế, sản phẩm n&agrave;y đại diện cho một trong số rất nhiều c&aacute;c giải ph&aacute;p của ch&uacute;ng t&ocirc;i hướng tới chấm dứt r&aacute;c thải nhựa.</p>\r\n\r\n<p>Chiều d&agrave;i đến đầu gối</p>\r\n\r\n<p>99% polyester t&aacute;i chế, 1% elastane</p>\r\n\r\n<p>C&aacute;c v&ugrave;ng đệm</p>\r\n\r\n<p>AEROREADY</p>\r\n\r\n<p>Gấu quần bo g&acirc;n</p>\r\n\r\n<p>N&acirc;ng đỡ v&ograve;m b&agrave;n ch&acirc;n</p>\r\n\r\n<p>Vải lưới tho&aacute;ng kh&iacute;</p>\r\n\r\n<p>Đường may phẳng ở mũi ch&acirc;n</p>\r\n', '2024-04-03 02:08:04', 1, 4, 1, 4, 12),
(73, 'PACK 3 ĐÔI VỚ BÓNG ĐÁ NIKE SOCKS DRY CUSHION CREW - WHITE/WOLF GREY/BLACK', '<p>Ưu điểm sản phẩm</p>\r\n\r\n<p>C&ocirc;ng nghệ Dri-FIT gi&uacute;p bạn lu&ocirc;n kh&ocirc; r&aacute;o v&agrave; thoải m&aacute;i.<br />\r\nĐế b&ocirc;ng d&agrave;y mang lại sự thoải m&aacute;i v&agrave; giảm chấn.<br />\r\nSợi ma s&aacute;t cao ở đế gi&agrave;y gi&uacute;p giảm trượt.<br />\r\nVải lưới ở phần tr&ecirc;n của b&agrave;n ch&acirc;n mang đến sự th&ocirc;ng tho&aacute;ng.</p>\r\n\r\n<p>TH&Ocirc;NG SỐ&nbsp;</p>\r\n\r\n<p>Sản phẩm c&oacute; thể giặt m&aacute;y<br />\r\nM&atilde; sản phẩm:&nbsp;SX5547-100</p>\r\n\r\n<p>Chất liệu: 85%Polyester13%Nylon2%Spandex<br />\r\n&nbsp;</p>\r\n', '2024-04-03 02:08:51', 1, 4, 2, 8, 61),
(74, 'adidas X Crazyfast Elite + FG - Energy Citrus Pack', '<p><strong>ADIDAS X CRAZYFAST ELITE +&nbsp;FG&nbsp;\'SOLAR ENERGY\' PACK</strong></p><p><strong>Tên sản phẩm: </strong>adidas X Crazyfast Elite +&nbsp;FG<br><strong>Màu sắc:&nbsp;</strong>Xanh lá/Đen/Trắng<br><strong>Bộ sưu tập: </strong>Solar Energy&nbsp;Pack (2024)<br><strong>Mã sản phẩm:</strong>&nbsp;IE2375<br><strong>Loại đế giày:</strong> FG (Firm Ground&nbsp;dành cho mặt sân cỏ tự nhiên)<br><strong>Phân khúc:</strong>&nbsp;Elite +&nbsp;(Cao cấp - Top-end)<br><strong>Trọng lượng:</strong>&nbsp; gram/chiếc (Size 41)<br><strong>Lưỡi gà:</strong> Dạng cổ thun<br><strong>Form chân phù hợp:</strong> Thon, Bè vừa<br><strong>Thời điểm ra mắt:</strong> 2024<br><strong>Phong cách thi đấu:</strong> Tốc độ, Dứt điểm (Tiền đạo, Chạy cánh)<br><strong>Những cầu thủ đại diện:</strong> Lionel Messi, Rafael Leao, Mohamed Salah, Son Heung-min, …</p>', '2024-05-07 13:11:21', 1, 1, 1, 8, 0),
(75, 'adidas X Crazyfast Elite TF - Energy Citrus Pack', '<p><strong>ADIDAS X CRAZYFAST ELITE TF - ENERGY CITRUS&nbsp;PACK</strong></p><p><strong>Tên sản phẩm: </strong>adidas X Crazyfast&nbsp;Elite TF&nbsp;(Giày đá bóng sân cỏ nhân tạo)<br><strong>Màu sắc:&nbsp;</strong>Cam<br><strong>Bộ sưu tập: </strong>Energy Citrus Pack (2024)<br><strong>Mã sản phẩm:</strong>&nbsp;IF0663<br><strong>Loại đế giày:</strong> TF (Turf&nbsp;dành cho mặt sân cỏ tự nhiên)<br><strong>Phân khúc:</strong>&nbsp;Elite (High-end: Cao&nbsp;cấp)<br><strong>Trọng lượng:</strong> 241 gram/chiếc (Size 41)<br><strong>Lưỡi gà:</strong> Dạng cổ thun<br><strong>Form chân phù hợp:</strong> Thon, Bè vừa<br><strong>Thời điểm ra mắt:</strong> 2024<br><strong>Phong cách thi đấu:</strong> Tốc độ, Dứt điểm (Tiền đạo, Chạy cánh)<br><strong>Những cầu thủ đại diện:</strong> Lionel Messi, Rafael Leao, Mohamed Salah, Son Heung-min, …</p>', '2024-05-07 13:18:51', 1, 1, 1, 24, 0),
(76, 'Nike Phantom GX Elite DF FG - Luminous Pack', '<p><strong>Nike Phantom GX DF Elite FG \'Luminous\'&nbsp;Pack</strong></p><p><strong>Tên sản phẩm</strong>: Nike Phantom GX Elite DF FG<br><strong>Màu sắc</strong>: Trắng/Xanh<br><strong>Bộ sưu tập</strong>: Luminous Pack (2023)<br><strong>Mã sản phẩm</strong>:&nbsp;DC9969-705<br><strong>Loại đế giày</strong>: Firm Ground (FG dành cho mặt sân cỏ tự nhiên)<br><strong>Phân khúc</strong>: Elite (Top-end)<br><strong>Lưỡi gà</strong>: Dạng cổ thun&nbsp;<br><strong>Form chân phù hợp</strong>: Thon, Bè<br><strong>Thời điểm ra mắt</strong>: 2022<br><strong>Phong cách thi đấu</strong>: Kiểm soát bóng, Sút<br><strong>Những cầu thủ đại diện</strong>: Kevin De Bruyne, Harry Kane, Ruben Dias<br><strong>Công nghệ, chất liệ</strong>u:<br>- Chất liệu Nikeskin mềm mại giúp giày co giãn tốt.<br>- Phần cổ thun được làm bằng sợi dệt ôm chân tốt.<br>- Bộ đệm độc quyền React ở gót tạo độ êm ái và phản lực khi bứt tốc.<br>- Bộ đế gồm nhiều hình dạng đinh khác nhau tăng độ bền và bám sân.</p>', '2024-05-26 05:16:38', 1, 1, 2, 17, 0),
(77, 'Nike Tiempo Legend 10 Academy TF - Emerald', '<p><strong>NIKE TIEMPO 10 ACADEMY&nbsp;TF \'EMERALD\' PACK</strong></p><p><strong>Tên sản phẩm:&nbsp;</strong>Nike Tiempo 10 Academy&nbsp;TF (Giày đá bóng sân cỏ nhân tạo)<br><strong>Màu sắc: </strong>Xanh ngọc<br><strong>Bộ sưu tập: </strong>Emerald<br><strong>Mã sản phẩm:&nbsp;</strong>FQ3245-300<br><strong>Loại đế giày: </strong>Turf (TF dành cho mặt sân cỏ nhân tạo)<br><strong>Phân khúc: </strong>Academy<br><strong>Trọng lượng: </strong>236 gram/chiếc (Size 41)<br><strong>Lưỡi gà: </strong>Dạng cổ rời&nbsp;<br><strong>Form chân phù hợp: </strong>Thon -&gt;&nbsp;Bè nhiều<br><strong>Thời điểm ra mắt: </strong>2023<br><strong>Phong cách thi đấu: </strong>Kiểm soát bóng, Chuyền bóng, Dứt điểm, Chia bài (Tiền vệ, Hậu vệ)<br><strong>Những cầu thủ đại diện: </strong>Virgil Van Dijk, Jordan Henderson, Tonali,...<br><strong>Công nghệ, chất liệu:</strong></p><ul><li>Form dáng chắc chắn, bè nhiều.</li><li>Chất liệu da Flytouch Lite siêu mềm mại, được thiết kế nhiều vùng chạm bóng để tăng khả năng kiểm soát bóng.</li><li>Được trang bị cổ thun liền giúp giày ôm chắc chân.</li><li>Bộ đế gồm những đinh nhiều hình dạng khác nhau với mật độ nhiều tăng khả năng bám sân.</li><li>Bộ đệm độc quyền EVA mềm mại, tăng độ êm ái khi thi đấu với thời gian dài.</li></ul>', '2024-05-07 13:33:26', 1, 1, 2, 3, 0),
(78, 'Găng Tay Thủ Môn Nike Vapor Grip 3 - Mad Ready Pack', '<p><strong>NIKE&nbsp;VAPOR GRIP 3 \"MAD READY\" PACK</strong></p><p><strong>Tên sản phẩm:&nbsp;</strong>Găng Tay Thủ Môn Nike Vapor Grip 3<br><strong>Màu sắc: </strong>Trắng/Nâu<br><strong>Bộ sưu tập: </strong>Mad&nbsp;Ready Pack<br><strong>Mã sản phẩm:</strong>&nbsp;FB2999-011<br><strong>Phân khúc:</strong> Vapor&nbsp;(cao cấp)<br><strong>Loại găng:</strong>&nbsp;Sân cỏ tự nhiên, Sân 7 nhân tạo<br><strong>Mút:</strong>&nbsp;4mm Contact với công nghệ grip 3 phủ các lớp mút ở ngón trỏ và ngón út giúp bạn cầm và bắt bóng dính hơn.&nbsp;<br><strong>Xương bảo vệ:&nbsp;</strong>ngón Hybrid Flat kết hợp 2 kiểu ngón giúp cho vùng tiếp xúc bóng nhiều hơn và bắt bóng an toàn hơn.<br><strong>Mặt sau găng:</strong>&nbsp;chất liệu co giãn tốt.<br><strong>Băng cổ tay:</strong>&nbsp;băng quấn cổ tay đc điều chỉnh phía dưới cổ tay giúp cho bạn hoạt động cổ tay thoải mái mà vẫn khóa cổ tay chắc chắn.<br><strong>Những cầu thủ đại diện:&nbsp;</strong>Sam JohnStone, Ochoa, Burki,....</p><p><img src=\"https://file.hstatic.net/1000403328/file/1035673456.jpg.0_62c88edcf9c44aacbc81678d56fb5202_1024x1024.jpg\" width=\"1024\" height=\"683\"></p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/gk_guillermo-ochoa-vs-crc_30400dfefbcf4409841845f02a2a86f4_1024x1024.jpeg\" width=\"1024\" height=\"683\"></p>', '2024-05-07 13:45:40', 1, 6, 2, 0, 0),
(79, 'Puma King Ultimate FG/AG - Voltage Pack', '<p><br><strong>PUMA KING ULTIMATE FG/AG \'VOLTAGE\' PACK</strong><br><br><strong>Tên sản phẩm: </strong>Puma King Ultimate&nbsp;(Giày đá bóng sân cỏ tự nhiên)<br><strong>Hãng:</strong> Puma<br><strong>Màu sắc:&nbsp;</strong>Trắng/Xanh Dương<br><strong>Bộ sưu tập: </strong>Voltage (2024)<br><strong>Mã sản phẩm:</strong>&nbsp;107563 05<br><strong>Loại đế giày:</strong>&nbsp;Firm Ground&nbsp;(FG&nbsp;dành cho mặt sân tự nhiên)<br><strong>Phân khúc:</strong>&nbsp;Ultimate&nbsp;(Cao cấp)<br><strong>Lưỡi gà:</strong> Dạng cổ thun&nbsp;<br><strong>Form chân phù hợp:</strong> Thon, Bè vừa<br><strong>Thời điểm ra mắt:</strong> 2023<br><strong>Phong cách thi đấu:</strong> Tốc độ, Dứt điểm (Tiền đạo, Chạy cánh)<br><strong>Những cầu thủ đại diện:</strong>&nbsp;Xavi Simons, Matteo Kovacic...</p><p>&nbsp;</p><p>&nbsp;</p>', '2024-05-07 13:52:11', 1, 1, 3, 8, 0),
(80, 'Găng Tay Thủ Môn Adidas Predator League Gloves - Own Your Football pack', '<p><strong>ADIDAS PREDATOR LEAGUE GLOVES \"OWN YOUR FOOTBALL\" PACK</strong></p><p><strong>Tên sản phẩm:&nbsp;</strong>Găng Tay Thủ Môn Adidas Predator Competition Gloves<br><strong>Màu sắc: </strong>Đen/hồng<br><strong>Bộ sưu tập:&nbsp;</strong>Own Your Football<br><strong>Mã sản phẩm:</strong>&nbsp;HN7993<br><strong>Phân khúc:&nbsp;</strong>League<br><strong>Loại găng:</strong>&nbsp;Sân cỏ tự nhiên, Sân 7 nhân tạo (có thể sử dụng đá sân 5)<br><strong>Mút:</strong>&nbsp;URG 2.0S, 100% bọt cao su&nbsp;tăng cường độ bám dính cũng như hỗ trợ độ bền cao hơn các dòng găng cùng loại.<br><strong>Xương bảo vệ:&nbsp;</strong>Không xương<br><strong>Mặt sau găng:</strong>&nbsp;Phủ một lớp Zone Skin trên kiểm soát bóng tốt và có nhữn cú đấm bóng chắc chắn.<br><strong>Băng cổ tay:</strong>&nbsp;băng quấn cổ tay đc điều chỉnh phía dưới cổ tay giúp cho bạn hoạt động cổ tay thoải mái mà vẫn khóa cổ tay chắc chắn.<br><strong>Những cầu thủ đại diện:</strong>&nbsp;Ter Stergen, Kepa,&nbsp;Emiliano Martínez...</p><p><img src=\"https://file.hstatic.net/1000403328/file/library_upload_21_2023_02_996x664_emiliano-martinez_b81fc9a_cdf38e16ed004b57a29d265e8119ae1e_1024x1024.jpg\" width=\"810\" height=\"540\"></p>', '2024-05-07 14:15:21', 1, 6, 1, 1, 0),
(81, 'Găng Tay Thủ Môn Sells Total Contact Aqua Prime', '<p><strong>SELLS TOTAL CONTACT AQUA PRIME</strong></p><p><strong>Tên sản phẩm: </strong>Găng Tay Thủ Môn Sells Total Contact Aqua Prime<br><strong>Màu sắc: </strong>Trắng<br><strong>Mã sản phẩm:</strong> SGP202310G<br><strong>Loại găng:</strong> Sân cỏ tự nhiên, Sân 7 nhân tạo<br><strong>Mút:</strong> Adhesion Magnet Ultra siêu dính như nam châm bám dính bóng cho hiệu suất đáng kinh ngạc trong thời tiết ẩm ướt<br><strong>Xương bảo vệ: </strong>Không xương<br><strong>Băng cổ tay:</strong> Neoprene dập nổi mở rộng để tăng độ ổn định<br><strong>Những cầu thủ đại diện:</strong> Dean Henderson, Nick Pope, Navas...</p><p><img src=\"https://file.hstatic.net/1000403328/file/4_a0f5154c71f34fce9200c4b44f0964f6_1024x1024.jpg\" width=\"960\" height=\"960\"></p><p><img src=\"https://file.hstatic.net/1000403328/file/d22e0710-1714-11ed-9789-cbbc7c09cba1_227d5bfb575846bcb6681b7d7d910a44_1024x1024.jpg\" width=\"1024\" height=\"576\"></p><p> </p>', '2024-05-07 14:21:26', 1, 6, 7, 0, 0),
(82, 'Găng Tay Thủ Môn Adidas Predator Pro - Solar Energy Pack', '<p><strong>ADIDAS PREDATOR PRO&nbsp;\"SOLAR ENERGY\" PACK</strong></p><p><strong>Tên sản phẩm:&nbsp;</strong>Găng Tay Thủ Môn Adidas Predator Pro<br><strong>Màu sắc: </strong>Đen<br><strong>Bộ sưu tập:</strong> Solar Energy Pack (2024)<br><strong>Mã sản phẩm:</strong>&nbsp;IQ4034<br><strong>Phân khúc: </strong>Pro (cao cấp)<br><strong>Loại găng:</strong>&nbsp;Sân cỏ tự nhiên, Sân 7 nhân tạo<br><strong>Mút:</strong>&nbsp;Mút URG 2.0S cho khả năng hấp thụ va chạm và bảo vệ mút cao.<br><strong>Xương bảo vệ:&nbsp;</strong>Không xương<br><strong>Mặt sau găng:</strong>&nbsp;Phủ một lớp Zone Skin trên kiểm soát bóng tốt và có nhữn cú đấm bóng chắc chắn.<br><strong>Băng cổ tay:</strong>&nbsp;Không dùng băng quấn cổ tay. với các đường chỉ được nén lại giúp ôm sát cổ tay 1 cách tự nhiên.<br><strong>Những cầu thủ đại diện:</strong>&nbsp;Ter Stergen, Kepa,&nbsp;Emiliano Martínez...</p><p>&nbsp;</p>', '2024-05-07 14:25:12', 1, 6, 1, 0, 0),
(83, 'Găng Tay Thủ Môn Adidas Copa GL Pro - Solar Energy Pack', '<p><strong>ADIDAS COPA GL PRO - \"SOLAR ENERGY\" PACK</strong></p><p><strong>Tên sản phẩm:&nbsp;</strong>Găng Tay Thủ Môn Adidas&nbsp;Copa GL Pro<br><strong>Màu sắc:&nbsp;</strong>Màu da<br><strong>Bộ sưu tập: </strong>Solar Energy&nbsp;Pack (2024)<br><strong>Mã sản phẩm:</strong>&nbsp;IQ4013<br><strong>Phân khúc: </strong>Pro (cao cấp)<br><strong>Loại găng:</strong>&nbsp;Sân cỏ tự nhiên, Sân 7 nhân tạo<br><strong>Mút:</strong>&nbsp;URG 2.0S độ bám dính và độ bền cao<br><strong>Xương bảo vệ:&nbsp;</strong>Có&nbsp;xương<br><strong>Mặt sau găng:</strong>&nbsp;Lớp đệm bằng bọt ở mặt mu bàn tay giúp bảo vệ khỏi va đập<br><strong>Băng cổ tay:</strong>&nbsp;Dây đeo cổ tay co giãn giúp cố định găng tay</p>', '2024-05-07 14:28:17', 1, 6, 1, 0, 0),
(84, 'adidas X Speedportal.3 FG - Heatspawn Pack', '<p><strong>ADIDAS X SPEEDPORTAL .3&nbsp;FG \'HEATSPAWN\' PACK</strong></p><p><strong>Tên sản phẩm: </strong>adidas X Speedportal .3&nbsp;FG (Giày đá bóng sân cỏ tự nhiên)<br><strong>Màu sắc: </strong>Đen/Cam<br><strong>Bộ sưu tập: </strong>Heatspawn Pack&nbsp;(2023)<br><strong>Mã sản phẩm:</strong>&nbsp;GZ5077<br><strong>Loại đế giày:</strong> FG (Firm Ground&nbsp;dành cho mặt sân cỏ tự nhiên)<br><strong>Phân khúc:</strong> .3&nbsp;(Tầm trung)<br><strong>Trọng lượng:</strong> 241 gram/chiếc (Size 41)<br><strong>Lưỡi gà:</strong> Dạng cổ thun<br><strong>Form chân phù hợp:</strong> Thon, Bè vừa<br><strong>Thời điểm ra mắt:</strong> 2023<br><strong>Phong cách thi đấu:</strong> Tốc độ, Dứt điểm (Tiền đạo, Chạy cánh)<br><strong>Những cầu thủ đại diện:</strong> Lionel Messi, Rafael Leao, Mohamed Salah, Son Heung-min, …</p>', '2024-05-07 14:30:00', 1, 1, 1, 8, 0),
(85, 'Nike Air Zoom Mercurial Vapor 15 Elite FG - Dream Speed 007', '<p><strong>NIKE AIR&nbsp;ZOOM MERCURIAL VAPOR 15&nbsp;ELITE FG - DREAM SPEED 007</strong></p><p><strong>Tên sản phẩm</strong>: Nike Air Zoom Mercurial Vapor 15&nbsp;Elite FG&nbsp;<br><strong>Màu sắc</strong>: Đỏ<br><strong>Bộ sưu tập</strong>: Dream Speed 007&nbsp;(2024)<br><strong>Mã sản phẩm</strong>:&nbsp;FD1165-600<br><strong>Loại đế giày</strong>: Firm Ground (FG&nbsp;dành cho mặt sân cỏ tự nhiên)<br><strong>Phân khúc</strong>: Elite<br><strong>Trọng lượng</strong>: 241 gram/chiếc (Size 41)<br><strong>Lưỡi gà</strong>: Dạng Lưỡi gà thun<br><strong>Thời điểm ra mắt</strong>: 2024<br><strong>Phong cách thi đấu</strong>: Tiền đạo, chạy cánh, tốc độ<br><strong>Những cầu thủ đại diện</strong>: Bruno Fernandes, Lewandowski,...<br><strong>Công nghệ, chất liệu</strong>:<br>- Chất liệu Nikeskin tạo độ nhám khi tiếp xúc bóng.<br>- Khung Speedcage phía dưới upper tăng độ ôm chân khi di chuyển và giữ form giày tốt.<br>- Phần cổ thun Dynamic Fit co giãn, ôm chân tốt.<br>- Bộ đệm độc quyền Air Zoom ở gót tạo độ êm ái và phản lực khi bứt tốc.<br>- Bộ đế gồm nhiều hình dạng đinh khác nhau tăng độ bền và bám sân.</p><p>&nbsp;</p><p>&nbsp;</p><p><strong>Vẻ đẹp tốc độ đến từ thế hệ thứ 8 của Nike Mercurial Dream Speed - MDS008</strong></p><p>&nbsp;</p><p>Cristiano Ronaldo - CR7, siêu sao người Bồ với bảng thành tích, danh hiệu cực kỳ khổng lồ, một cầu thủ đại diện cho sự nỗ lực không ngừng để vươn đến đỉnh cao nhất của bóng đá. Cũng vì thế, anh luôn là tấm gương để các cầu thủ trẻ, các vận động viên thể thao hay cả những vị trí trong nhiều ngành nghề khác noi theo và học hỏi. Mặc dù đã rời xa sàn đấu đỉnh cao châu Âu, nhưng CR7 vẫn luôn được dõi theo không ngừng. Hiểu được tâm nguyện của các fan bóng đá, Nike đã bắt tay với Ronaldo và phát triển một dòng giày mang tên ‘Mercurial Dream Speed’ thể hiện được ý chí và phần nào đó truyền động lực đến người chơi bóng đá khi trên chân mẫu giày này.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/565823c13c3274a82dc75578e0834b4f_0d1410dd3e7c469f93dbc682cab19084_1024x1024.jpg\" width=\"819\" height=\"1024\"></p><p>&nbsp;</p><p>Được chính thức phát hành vào tháng 9/2019, đến nay đã hơn 4 năm và dòng giày MDS đã chính thức bước sang thế hệ thứ 8, như thường lệ, Nike MDS luôn làm chấn động thị trường giày đá bóng với thiết kế đặc sắc bằng những màu sắc nổi bật, những họa tiết thiết kế độc đáo mà chỉ có thể xuất hiện trên các mẫu giày của Dream Speed.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/untitled-1_749c1c20880f44b7a71dc0720e557624_1024x1024.jpg\" width=\"1024\" height=\"642\"></p><p>&nbsp;</p><p>Đến với đời thứ 8 của seri Mercurial Dream Speed, Nike x CR7 mang đến một màu xanh lá cây, phần nào đó liên tưởng đến mẫu giày Nike Mercurial Superfly V ‘Radiation Flare’ Pack, mẫu giày từng gắn bó với CR7 ở giai đoạn thăng hoa tại Real Madrid. Trên upper thể hiện những họa tiết tạo cảm giác tốc độ bằng nhiều tông màu xanh lục khác nhau trải dài từ mũi giày, đây cũng chính là nét chung trên các mẫu giày MDS - họa tiết mang đến cảm giác tốc độ và sự chuyển động.&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/ds-3-min_7d3847a0b14949929744f69ae3d0c1cf_1024x1024.jpg\" width=\"706\" height=\"1024\"></p><p><img src=\"https://file.hstatic.net/1000403328/file/ds-2-min_291d2b3925914dbda3c41ff7a004461b_1024x1024.jpg\" width=\"706\" height=\"1024\"></p><p>&nbsp;</p><p>Với mục đích tạo động lực và truyền cảm hứng, MDS008 xuất hiện với câu thần chú rằng \"những thách thức và thất bại xảy ra với tất cả mọi người, nhưng chính cách chúng ta chọn cách phản ứng lại chúng mới định nghĩa nên chúng ta. Sự vĩ đại không được ban tặng, nhưng bằng cách tập trung vào ước mơ của mình, bạn có thể tìm thấy sức mạnh để đột phá”. Trong tâm lý học màu sắc, màu xanh lá cây tượng trưng cho năng lượng, sự tích cực và sự nổi bật, do đó, Nike đã áp dụng cho phiên bản Mercurial Dream Speed ​​mới nhất này.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/ds-5-min_80336957399f4063b39041aa55250b21_1024x1024.jpg\" width=\"706\" height=\"1024\"></p><p><img src=\"https://file.hstatic.net/1000403328/file/ds-6-min_21fec5071689497fb75b164c176c0347_1024x1024.jpg\" width=\"706\" height=\"1024\"></p><p>&nbsp;</p><p>Nổi bật nhất phải kể đến chính là logo Swoosh được thiết kế lớn độc đáo bằng cách sử dụng nhiều đường thẳng nổi song song với kích thước khác nhau, với hình dạng những đường thẳng cũng khiến ta nhớ đến các họa tiết được in trên chiếc túi gymsack của đôi Nike Mercurial Superfly V ‘Radiation Flare’ Pack ngày trước.</p><p>Bộ đế giày trên phiên bản này cũng được sử dụng toàn bộ là màu xanh lục đồng bộ với upper của giày. Xung quanh giày không thể thiếu những chi tiết đặc trưng khác của đôi giày này được làm nổi lên màu đen như logo MDS, lót giày CR7, …</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/ds-8-min_d7a547bb5c2148f9bf2388a810c4346f_1024x1024.jpg\" width=\"706\" height=\"1024\"></p><p><img src=\"https://file.hstatic.net/1000403328/file/ds-7-min_38fc93ca475944faaa11e9655d3863a9_1024x1024.jpg\" width=\"706\" height=\"1024\"></p><p>&nbsp;</p><p>Nike x CR7 Mercurial Dream Speed 008 không đơn thuần chỉ đánh dấu dòng thứ 8 của thương hiệu được Cristiano Ronaldo trực tiếp phát triển, mà nó còn đánh dấu tuổi 39 của huyền thoại người Bồ khi chỉ ra mắt ít ngày sau sinh nhật anh. Hi vọng thương hiệu Mercurial Dream Speed này sẽ luôn được duy trì và phát triển qua nhiều năm, vì đây chính là di sản, là nguồn động lực cho chúng ta phát triển bản thân lên một tầm cao mới.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/mds-02_97ec960355784cbe8f78484dc969e6b2_1024x1024.jpg\" width=\"1024\" height=\"576\"></p><p><img src=\"https://file.hstatic.net/1000403328/file/maxresdefault_915ae552e95344b7b8d09afdf247e609_1024x1024.jpg\" width=\"1024\" height=\"576\"></p><p>&nbsp;</p><p>Phiên bản này sẽ mở bán giới hạn các phân khúc Pro và với mức giá cao hơn một chút so với các mẫu Mercurial khác, thế nên, anh em nào là fan CR7 hay là fan của các dòng giày MDS thì đây chính là mẫu giày rất đáng để anh em sở hữu nhé.</p><p>&nbsp;</p><p>Picture: soccerbible</p>', '2024-05-07 14:32:11', 1, 1, 2, 0, 0),
(86, 'Nike Retro Air Zoom Mercurial Vapor 15 SE Elite FG', '<p><strong>NIKE RETRO AIR&nbsp;ZOOM MERCURIAL VAPOR 15&nbsp;ELITE SE&nbsp;FG</strong></p><p><strong>Tên sản phẩm</strong>: Nike Air Zoom Mercurial Vapor 15&nbsp;Elite FG&nbsp;<br><strong>Màu sắc</strong>: Đen<br><strong>Bộ sưu tập</strong>: Retro Mercurial SE&nbsp;(2022)<br><strong>Mã sản phẩm</strong>:&nbsp;DQ7788-001<br><strong>Loại đế giày</strong>: Firm Ground (FG&nbsp;dành cho mặt sân cỏ tự nhiên)<br><strong>Phân khúc</strong>: Elite<br><strong>Trọng lượng</strong>: 241 gram/chiếc (Size 41)<br><strong>Lưỡi gà</strong>: Dạng Lưỡi gà thun<br><strong>Thời điểm ra mắt</strong>: 2024<br><strong>Phong cách thi đấu</strong>: Tiền đạo, chạy cánh, tốc độ<br><strong>Những cầu thủ đại diện</strong>: Bruno Fernandes, Lewandowski,...<br><strong>Công nghệ, chất liệu</strong>:<br>- Chất liệu Nikeskin tạo độ nhám khi tiếp xúc bóng.<br>- Khung Speedcage phía dưới upper tăng độ ôm chân khi di chuyển và giữ form giày tốt.<br>- Phần cổ thun Dynamic Fit co giãn, ôm chân tốt.<br>- Bộ đệm độc quyền Air Zoom ở gót tạo độ êm ái và phản lực khi bứt tốc.<br>- Bộ đế gồm nhiều hình dạng đinh khác nhau tăng độ bền và bám sân.</p>', '2024-05-07 14:34:30', 1, 1, 2, 0, 0);
INSERT INTO `sanpham` (`masp`, `tensp`, `mota`, `ngaythem`, `trangthai`, `maloai`, `math`, `luotmua`, `luotxem`) VALUES
(87, 'Găng Tay Thủ Môn One Apex Pro Amped Negative - Trắng/Hồng', '<p><strong>ONE APEX PRO AMPED NEGATIVE CUT - TRẮNG/HỒNG</strong><br>&nbsp;</p><p><strong>Tên sản phẩm:&nbsp;</strong>Găng Tay Thủ Môn One Apex Pro Amped Negative - Trắng/Hồng<br><strong>Màu sắc: </strong>Trắng/Hồng<br><strong>Bộ sưu tập: </strong>One<br><strong>Mã sản phẩm:</strong>&nbsp;APEXAMPED<br><strong>Phân khúc: </strong>Pro (Cao cấp)<br><strong>Loại găng:</strong>&nbsp;Sân cỏ tự nhiên, Sân 7 nhân tạo (có thể đá sân 5)<br><strong>Ngón tay:</strong>&nbsp;Ngón Negative ôm ngón và một lớp vải bao bọc ngón trách tróc mút ở các đầu ngón + thêm xương ngón tay có thể tháo lấp được.<br><strong>Mút:</strong>&nbsp;4mm Pro Grade contact cho độ dính cao nhất.<br><strong>Xương bảo vệ:&nbsp;</strong>Có thể tháo rời<br><strong>Mặt&nbsp;găng:</strong>&nbsp;Bằng cao su tổng hợp và đệm mút thoải mái tay. Lớp D-Flex giúp đấm bóng mạnh hơn.<br><strong>Mặt sau găng:</strong>&nbsp;Hệ thống AirLite™ breathable body thoáng mát , thoáng khí .<br><strong>Băng cổ tay:</strong>&nbsp;Hệ thống dây đeo Midsplit® co giãn khi mang găng vào dễ dàng.<br><strong>Những cầu thủ đại diện:&nbsp;</strong>David Raya, Martin Dubravka, Fraser Forster, Macus Bettinelli</p><p><img src=\"https://file.hstatic.net/1000403328/file/snapinsta.app_352927140_801685618282985_4693127358568317075_n_1080_e10d2a836b454b33be7a57e42066e18c_1024x1024.jpg\" width=\"1024\" height=\"665\"></p>', '2024-05-07 14:37:12', 1, 6, 8, 0, 0),
(88, 'Găng Tay Thủ Môn Puma Ultra Ultimate Hybird - Eclipse Pack', '<p><strong>PUMA ULTRA ULTIMATE HYBRID \"ECLIPSE\" PACK</strong><br>&nbsp;</p><p><strong>Tên sản phẩm:&nbsp;</strong>Găng Tay Thủ Môn Puma Ultra Ultimate Hybird - Voltage Pack<br><strong>Màu sắc: </strong>Vàng<br><strong>Bộ sưu tập: </strong>Eclipse Pack<br><strong>Mã sản phẩm:</strong>&nbsp;041858-03<br><strong>Phân khúc: </strong>Ultimate (Cao cấp)<br><strong>Loại găng:</strong>&nbsp;Sân cỏ tự nhiên, Sân 7 nhân tạo (có thể đá sân 5)<br><strong>Ngón tay:</strong>&nbsp;Kết hợp ngón Negative được làm bè để tăng diện tích tiếp xúc bóng và cải thiện độ vừa với lòng bàn tay.<br><strong>Mút:</strong>&nbsp;4mm Grip Superior 90%&nbsp; được làm từ chất liệu tái chế&nbsp;hoàn toàn mới mang lại độ bám tuyệt vời trong điều kiện ẩm ướt và khô.<br><strong>Xương bảo vệ:&nbsp;</strong>Không xương<br><strong>Mặt&nbsp;găng:</strong>&nbsp;Vải tổng hợp và vật liệu nhẹ giúp cho găng tay nhẹ nhàng và linh hoạt hơn khi bắt bóng.<br><strong>Băng cổ tay:</strong>&nbsp;Chất liệu đàn hồi giúp khóa cổ tay chắc chắn.<br><strong>Những cầu thủ đại diện:&nbsp;</strong>Bend Leno, Jordan Pickford,...&nbsp;</p>', '2024-05-07 14:40:11', 1, 6, 3, 0, 0),
(89, 'Găng Tay Thủ Môn Puma Ultra Ultimate Hybird - Phenomenal Pack', '<p><strong>PUMA ULTRA ULTIMATE HYBRID \"PHENOMENAL\" PACK</strong><br>&nbsp;</p><p><strong>Tên sản phẩm:&nbsp;</strong>Găng Tay Thủ Môn Puma Ultra Ultimate Hybird - Phenomenal Pack<br><strong>Màu sắc: </strong>Hồng<br><strong>Bộ sưu tập: </strong>Phenomenal Pack<br><strong>Mã sản phẩm:</strong>&nbsp;041858-08<br><strong>Phân khúc: </strong>Ultimate (Cao cấp)<br><strong>Loại găng:</strong>&nbsp;Sân cỏ tự nhiên, Sân 7 nhân tạo (có thể đá sân 5)<br><strong>Ngón tay:</strong>&nbsp;Kết hợp ngón Negative được làm bè để tăng diện tích tiếp xúc bóng và cải thiện độ vừa với lòng bàn tay.<br><strong>Mút:</strong>&nbsp;4mm Grip Superior 90%&nbsp; được làm từ chất liệu tái chế&nbsp;hoàn toàn mới mang lại độ bám tuyệt vời trong điều kiện ẩm ướt và khô.<br><strong>Xương bảo vệ:&nbsp;</strong>Không xương<br><strong>Mặt&nbsp;găng:</strong>&nbsp;Vải tổng hợp và vật liệu nhẹ giúp cho găng tay nhẹ nhàng và linh hoạt hơn khi bắt bóng.<br><strong>Băng cổ tay:</strong>&nbsp;Chất liệu đàn hồi giúp khóa cổ tay chắc chắn.<br><strong>Những cầu thủ đại diện:&nbsp;</strong>Bend Leno, Jordan Pickford,...&nbsp;</p>', '2024-05-07 14:41:52', 1, 6, 3, 0, 0),
(90, 'Găng tay thủ môn Uhlsport Super Resist + Half Negative', '<p><strong>UHISPORT&nbsp;SUPER RESIST+ HALF NEGATIVE</strong></p><p><strong>Tên sản phẩm:&nbsp;</strong>Găng Tay Uhlsport Super Resist + Half Negative<br><strong>Màu sắc:</strong>&nbsp;Cam<br><strong>Bộ sưu tập:&nbsp;</strong><br><strong>Mã sản phẩm:</strong>&nbsp;101127301<br><strong>Phân khúc:&nbsp;</strong><br><strong>Loại găng:</strong>&nbsp;Sân cỏ tự nhiên, Sân 7 nhân tạo<br><strong>Mút Super Resist: </strong>Mút chống mài mòn độc quyền của Uhlsport, giúp găng tay bền bỉ hơn trên sân cỏ nhân tạo.<br><strong>Mặt cắt Classic Cut: </strong>Mặt cắt hiện đại ôm sát tay, mang lại cảm giác bóng cực tốt.<br><strong>Chất liệu dệt thoáng khí: </strong>Chất liệu dệt thoáng khí giúp găng tay luôn khô thoáng, thoải mái khi đeo.<br><strong>Dây đeo cao su quấn quanh và băng đầy đủ: </strong>Dây đeo cao su quấn quanh và băng đầy đủ giúp cố định cổ tay chắc chắn.<br><strong>Backhand Rebound Zone dập nổi 3D: </strong>Backhand Rebound Zone dập nổi 3D cung cấp tính linh hoạt và khả năng đấm hoàn hảo.<br><strong>Những cầu thủ đại diện:</strong>&nbsp;Mike Maignan,…</p>', '2024-05-07 14:43:35', 1, 6, 9, 1, 0),
(91, 'Găng Tay Thủ Môn Uhlsport Powerline Elite Supergrip+ Half Negative', '<p><strong>UHISPORT&nbsp;POWERLINE SUPERGRIP+ HALF NEGATIVE</strong></p><p><strong>Tên sản phẩm:&nbsp;</strong>Găng Tay Thủ Môn Uhlsport Powerline Elite Supergrip+ Half Negative<br><strong>Màu sắc:</strong>&nbsp;Đen<br><strong>Bộ sưu tập:&nbsp;</strong><br><strong>Mã sản phẩm:</strong>&nbsp;1013013012023<br><strong>Phân khúc: </strong>Elite<br><strong>Loại găng:</strong>&nbsp;Sân cỏ tự nhiên, Sân 7 nhân tạo<br><strong>Ngón tay:</strong>&nbsp;Half Negative&nbsp;Cut , Mặt cắt&nbsp;Half Negative: Cắt âm thanh giúp giảm tiếng ồn khi bắt bóng.<br><strong>Công nghệ SUPERGRIP+: </strong>Công nghệ này sử dụng latex nguyên chất không có chất tạo màu, kết hợp với các hạt cao su \"High Grip\" để tạo ra độ bám bóng vượt trội.<br><strong>Lớp đệm Latex: </strong>Lớp đệm latex dày dặn giúp bảo vệ bàn tay khỏi chấn thương khi bắt bóng.<br><strong>Dây buộc cổ tay: </strong>Dây buộc cổ tay giúp cố định găng tay chắc chắn trên tay.<br><strong>Những cầu thủ đại diện:</strong>&nbsp;Mike Maignan,…</p>', '2024-05-07 14:45:03', 1, 6, 9, 1, 0),
(92, 'Găng Tay Thủ Môn Uhlsport Supergrip+ Half Negative Maignan', '<p><strong>UHISPORT&nbsp;SUPERGRIP+ HALF NEGATIVE&nbsp;MAIGNAN</strong></p><p><strong>Tên sản phẩm:&nbsp;</strong>Găng Tay Thủ Môn Uhlsport Supergrip+ Half Negative Maignan<br><strong>Màu sắc:</strong>&nbsp;Trắng/Đỏ/Đen<br><strong>Bộ sưu tập:&nbsp;</strong>Maignan<br><strong>Mã sản phẩm:</strong>&nbsp;1011304012001<br><strong>Phân khúc:&nbsp;</strong><br><strong>Loại găng:</strong>&nbsp;Sân cỏ tự nhiên, Sân 7 nhân tạo<br><strong>Ngón tay:</strong>&nbsp;Half Negative&nbsp;Cut , Mặt cắt&nbsp;Half Negative cho cảm giác bóng tốt và sự linh hoạt cao.<br><strong>Mút: </strong>Mút&nbsp;xốp SUPERGRIP+ độc quyền của Uhlsport mang lại độ bám tối ưu trong mọi điều kiện thời tiết.<br>Găng tay thủ môn chính hãng Uhlsport, được thiết kế dành riêng cho Mike Maignan, thủ môn số 1 của AC Milan và đội tuyển quốc gia Pháp.&nbsp;Mẫu găng tay đặc biệt với số 16 của Maignan được in trên mu bàn tay và cổ tay.<br><strong>Chất liệu: </strong>Chất liệu<strong>&nbsp;</strong>AIRPRENE mới cho khả năng thoáng khí và thoải mái tối đa.<br><strong>Những cầu thủ đại diện:</strong>&nbsp;Mike Maignan,...</p>', '2024-05-09 21:40:42', 1, 6, 9, 0, 0),
(93, 'Găng Tay Thủ Môn Uhlsport Supersoft Maignan', '<p><strong>UHLSPORT&nbsp;SUPERSOFT MAIGNAN</strong></p><p><strong>Tên sản phẩm:&nbsp;</strong>Găng Tay Thủ Môn Uhlsport Supersoft Maignan<br><strong>Màu sắc:</strong>&nbsp;Trắng/Đỏ/Đen<br><strong>Bộ sưu tập:&nbsp;</strong>Maignan<br><strong>Mã sản phẩm:</strong>&nbsp;1011309012001<br><strong>Phân khúc:&nbsp;</strong><br><strong>Loại găng:</strong>&nbsp;Sân cỏ tự nhiên, Sân 7 nhân tạo<br><strong>Ngón tay:</strong>&nbsp;Flat Palm Cut , Mặt cắt ngón tay phẳng giúp cải thiện khả năng kiểm soát bóng và tiếp xúc với bóng.<br>Bọt dính mềm mại cung cấp độ bám và đệm tuyệt vời.<br>Lớp đệm ngón tay giúp bảo vệ khỏi va đập.<br>Cổ tay co giãn giúp cố định và thoải mái.<br><strong>Những cầu thủ đại diện:</strong>&nbsp;Mike Maignan,…</p>', '2024-05-09 21:42:25', 1, 6, 9, 0, 0),
