(95, 'Găng Tay Thủ Môn Puma Ultra Ultimate Hybird - Breakthrough Pack', '<p><strong>PUMA ULTRA ULTIMATE HYBRID \"BREAKTHROUGH\" PACK</strong><br>&nbsp;</p><p><strong>Tên sản phẩm:&nbsp;</strong>Găng Tay Thủ Môn Puma Ultra Ultimate Hybrid<br><strong>Màu sắc: </strong>Nhiều màu<br><strong>Bộ sưu tập:&nbsp;</strong>Breakthrough Pack<br><strong>Mã sản phẩm:</strong>&nbsp;041858-01<br><strong>Phân khúc: </strong>Ultimate (Cao cấp)<br><strong>Loại găng:</strong>&nbsp;Sân cỏ tự nhiên, Sân 7 nhân tạo (có thể đá sân 5)<br><strong>Ngón tay:</strong>&nbsp;Kết hợp ngón Negative được làm bè để tăng diện tích tiếp xúc bóng và cải thiện độ vừa với lòng bàn tay.<br><strong>Mút:</strong>&nbsp;4mm Grip Superior 90%&nbsp; được làm từ chất liệu tái chế&nbsp;hoàn toàn mới mang lại độ bám tuyệt vời trong điều kiện ẩm ướt và khô.<br><strong>Xương bảo vệ:&nbsp;</strong>Không xương<br><strong>Mặt&nbsp;găng:</strong>&nbsp;Vải tổng hợp và vật liệu nhẹ giúp cho găng tay nhẹ nhàng và linh hoạt hơn khi bắt bóng.<br><strong>Băng cổ tay:</strong>&nbsp;Chất liệu đàn hồi giúp khóa cổ tay chắc chắn.<br><strong>Những cầu thủ đại diện:&nbsp;</strong>Bend Leno, Jordan Pickford,...&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/jordan-pickford-everton-premier-league-847341473_1d915b8a8ad64f7f91f4220b19cb91f9_1024x1024.jpg\" width=\"1024\" height=\"576\"></p>', '2024-05-09 21:50:20', 1, 6, 3, 0, 0),
(96, 'Găng Tay Thủ Môn Puma Ultra Pro Regular Cut - Phenomenal Pack', '<p><strong>PUMA ULTRA PRO REGULAR CUT \"PHENOMENAL\" PACK</strong><br>&nbsp;</p><p><strong>Tên sản phẩm:&nbsp;</strong>Găng Tay Thủ Môn Puma Ultra Pro Regular Cut<br><strong>Màu sắc: </strong>Hồng<br><strong>Bộ sưu tập:&nbsp;</strong>Phenomenal Pack<br><strong>Mã sản phẩm:</strong>&nbsp;041859-08<br><strong>Phân khúc: </strong>Pro (Cao cấp)<br><strong>Loại găng:</strong>&nbsp;Sân cỏ tự nhiên, Sân 7 nhân tạo (có thể đá sân 5)<br><strong>Ngón tay:</strong>&nbsp;Thiết kế ngón Flat cho diện tích tiếp xúc bóng rộng hơn, hỗ trợ bắt bóng tốt hơn.<br><strong>Mút:</strong>&nbsp;Mút 4mm Ultimate dày và cho độ bám dính tốt, giúp kiểm soát bóng hiệu quả.<br><strong>Xương bảo vệ:&nbsp;</strong>Không xương<br><strong>Mặt&nbsp;găng:</strong>&nbsp;Logo Puma nổi bật trên găng tay, tạo điểm nhấn ấn tượng.<br><strong>Băng cổ tay:</strong>&nbsp;Cổ tay băng quắn rộng xiết chặc cổ tay, giúp cố định cổ tay và giảm thiểu chấn thương.<br><strong>Những cầu thủ đại diện:&nbsp;</strong>Bend Leno, Jordan Pickford,...&nbsp;</p><p><img src=\"https://cdn1.everton.news/uploads/21/2024/02/GettyImages-2025330041-1140x760.jpg\" width=\"1140\" height=\"760\"></p>', '2024-05-09 21:52:32', 1, 6, 3, 0, 0),
(97, 'Găng Tay Thủ Môn Puma Ultra Ultimate 1 Negative Cut - Supercharge Pack', '<p><strong>PUMA ULTRA ULTIMATE 1 NEGATIVE CUT \"SUPERCHARGE\" PACK</strong><br>&nbsp;</p><p><strong>Tên sản phẩm:&nbsp;</strong>Găng Tay Thủ Môn Puma Ultra&nbsp;Ultimate 1 Negative Cut<br><strong>Màu sắc:</strong>&nbsp;Xanh dương<br><strong>Bộ sưu tập: </strong>Supercharge Pack<br><strong>Mã sản phẩm:</strong>&nbsp;041813-05<br><strong>Phân khúc: </strong>Ultimate&nbsp;(cao cấp)<br><strong>Loại găng:</strong>&nbsp;Sân cỏ tự nhiên, Sân 7 nhân tạo<br><strong>Ngón tay:</strong>&nbsp;Negative&nbsp;Cut&nbsp;, Mặt cắt Negative độc đáo&nbsp;tăng độ bảo vệ các lớp ngón tay gấp 2 lần. Ngón tay kép và viền latex giúp tối đa hóa diện tích tiếp xúc với quả bóng.<br><strong>Mút:</strong>&nbsp;4mm ELITE +&nbsp;cho độ bám tuyệt vời trong cả điều kiện khô và ướt.<br><strong>Xương bảo vệ:&nbsp;</strong>Không xương.<br><strong>Mặt&nbsp;găng:</strong>&nbsp;GRDKXN&nbsp;độc quyền của Puma giúp kiểm soát bóng tối ưu.<br><strong>Băng cổ tay:</strong>&nbsp;Không có băng quấn cổ tay.&nbsp;<br><strong>Những cầu thủ đại diện:</strong>&nbsp;Jan Oblak, Sommer...</p><p><img src=\"https://file.hstatic.net/1000403328/file/gettyimages-1469533182_58a513b678124dd39dc3e8c0bd078b8d_1024x1024.jpg\" width=\"1024\" height=\"683\"></p>', '2024-05-10 13:39:00', 1, 6, 3, 0, 0),
(98, 'Găng Tay Thủ Môn Puma Future Ultimate Negative Cut - Eclipse Pack', '<p><strong>PUMA FUTURE ULTIMATE NEGATIVE CUT \"ECLIPSE\" PACK</strong><br>&nbsp;</p><p><strong>Tên sản phẩm:&nbsp;</strong>Găng Tay Thủ Môn Puma Future Ultimate Negative Cut<br><strong>Màu sắc:</strong> Đen<br><strong>Bộ sưu tập: </strong>Eclipse<br><strong>Mã sản phẩm:</strong>&nbsp;041841-04<br><strong>Phân khúc: </strong>Ultimate&nbsp;(cao cấp)<br><strong>Loại găng:</strong>&nbsp;Sân cỏ tự nhiên, Sân 7 nhân tạo<br><strong>Ngón tay:</strong>&nbsp;Negative&nbsp;Cut&nbsp;, Mặt cắt Negative độc đáo&nbsp;tăng độ bảo vệ các lớp ngón tay gấp 2 lần.<br><strong>Mút:</strong>&nbsp;4mm ELITE + Dual Latex: các hạt chất liệu dính thêm mang lại độ bám dính tuyệt vời trong mọi điều kiện thời tiết.<br><strong>Xương bảo vệ:&nbsp;</strong>Không xương<br><strong>Mặt&nbsp;găng:</strong>&nbsp;Mặt găng mút dày 4mm kết hợp với cao su mềm 3D.&nbsp;<br><strong>Băng cổ tay:</strong>&nbsp;Không có băng quấn cổ tay.&nbsp;<br><strong>Những cầu thủ đại diện:</strong>&nbsp;Jan Oblak, Sommer...</p><p><img src=\"https://file.hstatic.net/1000403328/file/jan_oblakk_7d3966578eaa40df82acb0a2e2de2cdc_1024x1024.jpg\" width=\"1024\" height=\"576\"></p>', '2024-05-10 13:54:55', 1, 6, 3, 0, 0),
(99, 'Găng Tay Thủ Môn Puma Ultra Ultimate Hybird - Gear Up Pack', '<p><strong>PUMA ULTRA ULTIMATE HYBRID ENERGY \"GEAR UP\" PACK</strong><br>&nbsp;</p><p><strong>Tên sản phẩm:&nbsp;</strong>Găng Tay Thủ Môn Puma Ultra Ultimate Hybrid Energy<br><strong>Màu sắc: </strong>Xanh dương<br><strong>Bộ sưu tập:&nbsp;</strong>Gear Up Pack<br><strong>Mã sản phẩm:</strong>&nbsp;041858-02<br><strong>Phân khúc: </strong>Ultimate (Cao cấp)<br><strong>Loại găng:</strong>&nbsp;Sân cỏ tự nhiên, Sân 7 nhân tạo (có thể đá sân 5)<br><strong>Ngón tay:</strong>&nbsp;Kết hợp ngón Negative được làm bè để tăng diện tích tiếp xúc bóng và cải thiện độ vừa với lòng bàn tay.<br><strong>Mút:</strong>&nbsp;4mm Grip Superior 90%&nbsp; được làm từ chất liệu tái chế&nbsp;hoàn toàn mới mang lại độ bám tuyệt vời trong điều kiện ẩm ướt và khô.<br><strong>Xương bảo vệ:&nbsp;</strong>Không xương<br><strong>Mặt&nbsp;găng:</strong>&nbsp;Vải tổng hợp và vật liệu nhẹ giúp cho găng tay nhẹ nhàng và linh hoạt hơn khi bắt bóng.<br><strong>Băng cổ tay:</strong>&nbsp;Chất liệu đàn hồi giúp khóa cổ tay chắc chắn.<br><strong>Những cầu thủ đại diện:&nbsp;</strong>Bend Leno, Jordan Pickford,...&nbsp;</p><p><img src=\"https://www.mancity.com/meta/media/rsmhgzgm/eddy.jpg?width=1620\" width=\"1620\" height=\"929\"></p>', '2024-05-10 14:06:51', 1, 6, 3, 0, 0),
