(108, 'Mizuno Morelia Neo III Pro FG - Gold/Trắng', '<p><strong>MIZUNO MORELIA NEO IV PRO AS - CHARGE PACK</strong></p><p><strong>Tên sản phẩm</strong>: Mizuno Morelia Neo IV Pro FG<br><strong>Màu sắc</strong>: Trắng<br><strong>Bộ sưu tập</strong>:&nbsp;&nbsp;Trắng/Đen<br><strong>Mã sản phẩm</strong>:&nbsp;P1GA233409<br><strong>Loại đế giày:</strong>&nbsp;FG (Dành cho sân cỏ tự nhiên)<br><strong>Phân khúc</strong>: Pro (Mid-end: phân khúc trung cấp)<br><strong>Trọng lượng</strong>: 197 gram/chiếc (Size 41)<br><strong>Lưỡi gà</strong>: Lưỡi gà rời<br><strong>Form chân phù hợp</strong>:&nbsp;Bè vừa - Bè nhiều<br><strong>Thời điểm ra mắt</strong>: 2024<br><strong>Phong cách thi đấu</strong>: Kiểm soát bóng, dứt điểm<br><strong>Những cầu thủ đại diện</strong>:&nbsp;<br><strong>Công nghệ, chất liệu</strong>:</p><ul><li>Trọng lượng siêu nhẹ thuộc top đầu các mẫu giày đá bóng sân cỏ nhân tạo.</li><li>Chất liệu da Kangaroo siêu mềm đã được Mizuno sử dụng hiệu quả ở phần Upper giày, hỗ trợ tối đa cho các cầu thủ khi nhận bóng, đi bóng, những pha sút mu uy lực và tạo cảm giác như đi chân trần.</li><li>Form giày đặc biệt phù hợp với bàn chân người Việt, những cầu thủ chân bè hoàn toàn có thể sử dụng mà không gặp chút khó khăn nào.</li><li>Là mẫu giày thuộc phân khúc cao cấp, Morelia Neo IV&nbsp;Pro AS được trang bị lớp đệm giảm chấn ấn tượng, cực kỳ êm ái và thoải mái cho các cầu thủ trong suốt trận đấu.</li><li>Lót giày êm, chống trượt hiệu quả.</li><li>Dàn đinh dăm được thiết kế vô cùng đặc biệt và dàn trải trên toàn mặt đế, giúp các cầu thủ xoay chuyển linh hoạt và hỗ trợ bám sân hiệu quả ngay cả khi thời tiết không thuận lợi.</li><li>Gót giày chắc chắn và cứng cáp, giữ form giày cực tốt và bảo vệ chân cầu thủ.</li></ul>', '2024-05-10 14:25:12', 1, 1, 5, 0, 0),
