(116, 'Mizuno Alpha Pro AS TF - Prism Gold Pack', '<p><strong>Tên sản phẩm</strong>: Mizuno Alpha Pro AS - Prism Gold Pack<br><strong>Màu sắc</strong>: Trắng/Vàng gold<br><strong>Bộ sưu tập</strong>:&nbsp;&nbsp;Prism Gold Pack<br><strong>Mã sản phẩm</strong>:&nbsp;P1GD246450<br><strong>Loại đế giày:</strong>&nbsp;AS&nbsp;(Dành cho sân cỏ nhân tạo)<br><strong>Phân khúc</strong>: Pro (Mid-end: phân khúc trung cấp)<br><strong>Trọng lượng</strong>: 205 gram/chiếc (Size 41)<br><strong>Lưỡi gà</strong>: Lưỡi gà rời<br><strong>Form chân phù hợp</strong>:&nbsp;Bè vừa - Bè nhiều<br><strong>Thời điểm ra mắt</strong>: 2021<br><strong>Phong cách thi đấu</strong>: Tốc độ, kiểm soát bóng, dứt điểm<br><strong>Những cầu thủ đại diện</strong>: Sergio Ramos<br><strong>Công nghệ, chất liệu</strong>:</p><ul><li>Mizuno α Pro AS Mizuno α Pro AS là dòng giày bóng đá sân cỏ nhân tạo mới ra mắt của Mizuno cuối năm 2022 với trọng lượng rất nhẹ, chỉ 215g cùng thiết kế độc đáo dành cho các cầu thủ ưa thích lối chơi tốc độ. Đây là mẫu giày được tối ưu phần bề mặt nên dù không được làm từ da thật, Mizuno α Pro AS vẫn có độ mềm mại ấn tượng và cảm giác chân rất tốt.</li><li>Với những sự nâng cấp đáng chú ý, Mizuno α Pro AS là mẫu giày vô cùng toàn diện với tốc độ cùng độ ổn định cao, mang tới hiệu suất thi đấu ấn tượng. Những cầu thủ có lối chơi thiên về tốc độ và mong muốn một đôi giày ổn định, nhẹ, êm ái, cảm giác bóng tốt không thể bỏ qua Mizuno α Pro AS.</li><li>Phom giày đặc biệt phù hợp với bàn chân người Việt, những cầu thủ chân bè hoàn toàn có thể sử dụng mà không gặp chút khó khăn nào. + Lót giày áp dụng công nghệ Zeroglide có độ bám cao, giảm thiểu tình trạng trơn trượt và có thể tháo rời.&nbsp;</li><li>Hệ thống đinh dăm trên Mizuno α Pro AS là dạng chữ L quen thuộc với ưu điểm giúp các cầu thủ có thể đổi hướng linh hoạt và rất bám sân ngay cả khi thời tiết không thuận lợi.&nbsp;</li><li>Là mẫu giày thuộc phân khúc cao cấp, Mizuno α Pro AS được trang bị lớp đệm giảm chấn, tạo sự êm ái thoải mái cho các cầu thủ trong suốt trận đấu.&nbsp;</li><li>Chất liệu da tổng hợp kết hợp với cấu trúc Engineered Fit woven giúp bề mặt giày co giãn nhẹ theo chiều ngang mà không bị giãn theo chiều dọc, mang tới sự thoải mái và ôm chân cho dù bạn có bàn chân bè.&nbsp;</li><li>Bên cạnh những điểm nâng cấp mới, Mizuno α Pro AS cũng được trang bị những công nghệ cao cấp quen thuộc ở bộ đế như lớp đệm giảm chấn êm ái, giúp người chơi thoải mái trong suốt quá trình thi đấu và dàn đinh dăm dạng chữ L, bám sân hiệu quả và linh hoạt.&nbsp;</li><li>Đặc trưng của dòng giày này đó là cấu trúc Engineered Fit woven giúp bề mặt giày co giãn nhẹ theo chiều ngang mà không bị giãn theo chiều dọc, mang tới sự thoải mái và ôm chân cho dù bạn có bàn chân bè.</li></ul>', '2024-05-10 14:47:48', 1, 1, 5, 34, 0),
(117, 'adidas X Crazyfast Elite + FG - Solar Energy Pack', '<p><strong>ADIDAS X CRAZYFAST ELITE +&nbsp;FG&nbsp;\'SOLAR ENERGY\' PACK</strong></p><p><strong>Tên sản phẩm: </strong>adidas X Crazyfast Elite +&nbsp;FG<br><strong>Màu sắc:&nbsp;</strong>Xanh lá/Đen/Trắng<br><strong>Bộ sưu tập: </strong>Solar Energy&nbsp;Pack (2024)<br><strong>Mã sản phẩm:</strong>&nbsp;IE2375<br><strong>Loại đế giày:</strong> FG (Firm Ground&nbsp;dành cho mặt sân cỏ tự nhiên)<br><strong>Phân khúc:</strong>&nbsp;Elite +&nbsp;(Cao cấp - Top-end)<br><strong>Trọng lượng:</strong>&nbsp; gram/chiếc (Size 41)<br><strong>Lưỡi gà:</strong> Dạng cổ thun<br><strong>Form chân phù hợp:</strong> Thon, Bè vừa<br><strong>Thời điểm ra mắt:</strong> 2024<br><strong>Phong cách thi đấu:</strong> Tốc độ, Dứt điểm (Tiền đạo, Chạy cánh)<br><strong>Những cầu thủ đại diện:</strong> Lionel Messi, Rafael Leao, Mohamed Salah, Son Heung-min, …<br>&nbsp;</p>', '2024-05-10 14:50:44', 1, 1, 1, 0, 0),
(118, 'Puma Ultra Ultimate FG/AG - Voltage Pack', '<p><strong>PUMA ULTRA ULTIMATE&nbsp;FG/AG \'VOLTAGE\' PACK</strong></p><p><strong>Tên sản phẩm</strong>:&nbsp;Puma Ultra Ultimate FG/AG</p><p><strong>Mã sản phẩm:</strong>&nbsp;107311 04</p><p><strong>Loại đế giày</strong>: dành cho sân cỏ tự nhiên 11&nbsp;người</p><p><strong>Phân khúc:</strong>&nbsp;Ultimate</p><p><strong>Form giày:&nbsp;</strong>From vừa, phù hợp chân thon hoặc bè vừa</p><p><strong>Lưỡi gà:&nbsp;</strong>dạng cổ thun liền&nbsp;với chất liệu cao cấp</p><p><strong>Chất liệu Upper:&nbsp;</strong>&nbsp;upper với công nghệ SPEEDCAGE nổi tiếng giúp hỗ trợ tối đa cho người chơi</p><p><strong>Điểm mới:</strong>&nbsp;Thể hiện tốc độ không tưởng của bạn khi mang giày bóng đá PUMA Ultra 1.4 FG / AG màu xám, có tính năng mới các vết cắt trên ULTRACut ở phần upper&nbsp;cho cảm giác thậm chí còn nhẹ hơn. Tiêu chí&nbsp;nhẹ hơn và nhanh hơn bao giờ hết được áp dụng trên&nbsp;giày bóng đá PUMA Ultra 1.4 FG / AG kết hợp Công nghệ MATRYXEVO dệt thích ứng với microfibre SPEEDCAGE để cung cấp hỗ trợ nhiều lớp trong các chuyển động ở tốc độ cao. Sợi phản ứng của MATRYXEVO rất&nbsp;chắc chắn giúp&nbsp;bạn tiến&nbsp;về phía trước nhanh nhất có thể, trong khi SPEEDCAGE giữ cho bạn ổn định khi bạn thay đổi hướng kèm với&nbsp;tốc độ cao - đó là một giải pháp hoàn hảo trên phiên bản này. Hỗ trợ thêm cũng cho phép giữu&nbsp;trọng lượng ở giữa bàn chân, với các lổ&nbsp;cắt được thiết kế&nbsp;giúp giảm tải trọng của đôi giày&nbsp;để giúp bạn đạt&nbsp;tốc độ cao hơn nữa. Đối với bề mặt upper, lớp phủ GripControl Pro phổ biến ở mặt trên hỗ trợ bạn xử lý các pha bóng theo ý muốn của bạn một cách hoàn hảo. Ở những vị trí&nbsp;khác của đôi giày, hệ thống viền và cổ giày&nbsp;được sắp xếp hợp lý đảm bảo sự thoải mái, vừa vặn an toàn, trong khi chạy bức tốc&nbsp;quen thuộc. Đế ngoài Pebax SpeedUnit lấy cảm hứng từ mũi nhọn mang lại khả năng tăng tốc cực cao.</p><p><strong>Năm sản xuất:&nbsp;</strong>2023</p><p><strong>Phong cách thi đấu:&nbsp;</strong>kỹ thuật, tốc độ, dứt điểm.</p><p><strong>Bộ Sưu Tập: </strong>Voltage&nbsp;Pack</p><p><strong>Những cầu thủ nổi tiếng đại diện:</strong>&nbsp;Antoine Griezmann, Raphael Varane</p><p>&nbsp;</p>', '2024-05-26 05:15:37', 1, 1, 3, 1, 0),
(119, 'adidas X Crazyfast Elite TF - Solar Energy Pack', '<p><strong>ADIDAS X CRAZYFAST ELITE TF - SOLAR ENERGY PACK</strong></p><p><strong>Tên sản phẩm: </strong>adidas X Crazyfast&nbsp;Elite TF&nbsp;(Giày đá bóng sân cỏ nhân tạo)<br><strong>Màu sắc: </strong>Xanh lục<br><strong>Bộ sưu tập: </strong>Solar Energy&nbsp;Pack (2024)<br><strong>Mã sản phẩm:</strong>&nbsp;IF0664<br><strong>Loại đế giày:</strong> TF (Turf&nbsp;dành cho mặt sân cỏ tự nhiên)<br><strong>Phân khúc:</strong>&nbsp;Elite (High-end: Cao&nbsp;cấp)<br><strong>Trọng lượng:</strong> 241 gram/chiếc (Size 41)<br><strong>Lưỡi gà:</strong> Dạng cổ thun<br><strong>Form chân phù hợp:</strong> Thon, Bè vừa<br><strong>Thời điểm ra mắt:</strong> 2024<br><strong>Phong cách thi đấu:</strong> Tốc độ, Dứt điểm (Tiền đạo, Chạy cánh)<br><strong>Những cầu thủ đại diện:</strong> Lionel Messi, Rafael Leao, Mohamed Salah, Son Heung-min, …</p>', '2024-05-10 15:05:55', 1, 1, 1, 0, 0),
(120, 'Puma King Ultimate FG/AG - Breakthrough Pack', '<p><strong>PUMA KING ULTIMATE FG/AG \'SUPERCHARGE\' PACK</strong><br><br><strong>Tên sản phẩm: </strong>Puma King Ultimate&nbsp;(Giày đá bóng sân cỏ tự nhiên)<br><strong>Hãng:</strong> Puma<br><strong>Màu sắc:&nbsp;</strong>Trắng/Xanh Dương<br><strong>Bộ sưu tập: </strong>Supercharge&nbsp;(2023)<br><strong>Mã sản phẩm:</strong>&nbsp;107097 01<br><strong>Loại đế giày:</strong>&nbsp;Firm Ground&nbsp;(FG&nbsp;dành cho mặt sân tự nhiên)<br><strong>Phân khúc:</strong>&nbsp;Ultimate&nbsp;(Cao cấp)<br><strong>Lưỡi gà:</strong> Dạng cổ thun&nbsp;<br><strong>Form chân phù hợp:</strong> Thon, Bè vừa<br><strong>Thời điểm ra mắt:</strong> 2023<br><strong>Phong cách thi đấu:</strong> Tốc độ, Dứt điểm (Tiền đạo, Chạy cánh)<br><strong>Những cầu thủ đại diện:</strong>&nbsp;Pulisic, Antony, Kingsley Coman,…</p>', '2024-05-10 15:08:11', 1, 1, 3, 0, 0),
(121, 'adidas Copa Pure 2 League FG - Solar Energy Pack', '<h2><strong>ADIDAS COPA PURE 2 LEAGUE FG&nbsp;\'SOLAR ENERGY\'&nbsp;PACK</strong></h2><p><strong>Tên sản phẩm: </strong>adidas Copa Pure 2 League FG&nbsp;(Giày đá bóng sân cỏ tự nhiên)<br><strong>Màu sắc:&nbsp;</strong>Cam<br><strong>Bộ sưu tập:</strong> Solar Energy&nbsp;Pack (2024)<br><strong>Mã sản phẩm:&nbsp;</strong>IF5448<br><strong>Loại đế giày:</strong> Firm Ground&nbsp;(FG dành cho mặt sân cỏ tự nhiên)<br><strong>Phân khúc:</strong> League (Mid-end, Trung cấp)</p><p><strong>Trọng lượng: </strong>247 gram/chiếc (size 41)<br><strong>Lưỡi gà:</strong> Dạng cổ rời<br><strong>Form chân phù hợp:</strong> Thon, Bè vừa<br><strong>Thời điểm ra mắt:</strong> 2023<br><strong>Phong cách thi đấu:</strong>&nbsp;Cầm bóng, điều phối bóng (Tiền vệ)<br><strong>Những cầu thủ đại diện: </strong>Pedri, Gundogan.…</p>', '2024-05-26 05:17:46', 1, 1, 1, 10, 0),
(122, 'Nike Air Zoom Mercurial Vapor 15 Academy TF - Dream Speed 008', '<p><strong>NIKE AIR&nbsp;ZOOM MERCURIAL VAPOR 15&nbsp;ACADEMY TF DREAM SPEED 007</strong></p><p><strong>Tên sản phẩm</strong>: Nike Air Zoom Mercurial Vapor 15&nbsp;Academy TF&nbsp;<br><strong>Màu sắc</strong>: Đỏ/Cam<br><strong>Bộ sưu tập</strong>: Dream Speed 007 (2023)<br><strong>Mã sản phẩm</strong>:&nbsp;FD1168-600<br><strong>Loại đế giày</strong>: Turf (TF dành cho mặt sân cỏ nhân tạo)<br><strong>Phân khúc</strong>: Academy<br><strong>Trọng lượng</strong>: 241 gram/chiếc (Size 41)<br><strong>Lưỡi gà</strong>: Dạng Lưỡi gà rời<br><strong>Thời điểm ra mắt</strong>: 2023<br><strong>Phong cách thi đấu</strong>: Tiền đạo, chạy cánh, tốc độ<br><strong>Những cầu thủ đại diện</strong>: Bruno Fernandes, Lewandowski,...<br><strong>Công nghệ, chất liệu</strong>:<br>- Chất liệu Nikeskin tạo độ nhám khi tiếp xúc bóng.<br>- Khung Speedcage phía dưới upper tăng độ ôm chân khi di chuyển và giữ form giày tốt.<br>- Phần cổ thun Dynamic Fit co giãn, ôm chân tốt.<br>- Bộ đệm độc quyền Air Zoom ở gót tạo độ êm ái và phản lực khi bứt tốc.<br>- Bộ đế gồm nhiều hình dạng đinh khác nhau tăng độ bền và bám sân.</p><p>&nbsp;</p>', '2024-05-10 15:13:53', 1, 1, 2, 0, 0),
(123, 'Nike Air Zoom Mercurial Vapor 15 Academy TF - Mad Ready Pack', '<p><strong>NIKE AIR&nbsp;ZOOM MERCURIAL VAPOR 15&nbsp;ACADEMY TF \'MAD READY\' PACK</strong></p><p><strong>Tên sản phẩm</strong>: Nike Air Zoom Mercurial Vapor 15&nbsp;Academy TF&nbsp;<br><strong>Màu sắc</strong>: Trắng/Đen<br><strong>Bộ sưu tập</strong>: Mad&nbsp;Ready Pack (2024)<br><strong>Mã sản phẩm</strong>:&nbsp;DJ5635 700<br><strong>Loại đế giày</strong>: Turf (TF dành cho mặt sân cỏ nhân tạo)<br><strong>Phân khúc</strong>: Academy<br><strong>Trọng lượng</strong>: 241 gram/chiếc (Size 41)<br><strong>Lưỡi gà</strong>: Dạng Lưỡi gà rời<br><strong>Thời điểm ra mắt</strong>: 2022<br><strong>Phong cách thi đấu</strong>: Tiền đạo, chạy cánh, tốc độ<br><strong>Những cầu thủ đại diện</strong>: Bruno Fernandes, Lewandowski,...<br><strong>Công nghệ, chất liệu</strong>:<br>- Chất liệu Nikeskin tạo độ nhám khi tiếp xúc bóng.<br>- Khung Speedcage phía dưới upper tăng độ ôm chân khi di chuyển và giữ form giày tốt.<br>- Lưỡi gà rời dễ dàng thao tác mang cởi và phù hợp chân bè<br>- Bộ đệm độc quyền Air Zoom ở gót tạo độ êm ái và phản lực khi bứt tốc.<br>- Bộ đế gồm nhiều hình dạng đinh khác nhau tăng độ bền và bám sân.</p>', '2024-05-11 22:36:39', 1, 1, 2, 0, 0),
