(127, 'Nike Air Zoom Mercurial Vapor 15 Pro TF - Mad Ready Pack', '<p><strong>NIKE AIR ZOOM MERCURIAL VAPOR 15 PRO TF \'PEAK READY\' PACK</strong></p><p><strong>Tên sản phẩm</strong>: Nike Air Zoom Mercurial Vapor 15 Pro TF (Giày đá bóng sân cỏ nhân tạo)<br><strong>Màu sắc</strong>: Cam<br><strong>Bộ sưu tập</strong>: Mad Ready&nbsp;Pack&nbsp;<br><strong>Mã sản phẩm</strong>:&nbsp;DJ5605-300<br><strong>Loại đế già</strong>y: Turf (TF dành cho mặt sân cỏ nhân tạo)<br><strong>Phân khúc</strong>: Pro<br><strong>Trọng lượng</strong>: 239 gram/chiếc (Size 41)<br><strong>Lưỡi gà</strong>: Dạng cổ thun<br><strong>Form chân phù hợp</strong>: Thon, Bè vừa<br><strong>Thời điểm ra mắt</strong>: 2023<br><strong>Phong cách thi đấu</strong>: Tiền đạo, chạy cánh, tốc độ<br><strong>Những cầu thủ đại diện</strong>: Ronaldo, Mbappe, Bruno Fernandes<br><strong>Công nghệ, chất liệu</strong>:<br>- Chất liệu sợi dệt kết hợp Nikeskin giúp mẫu giày co giãn tốt và thoáng khí.<br>- Công nghệ Hyperscreen trải trên phần lớn Upper tăng ma sát khi tiếp xúc bóng.<br>- Khung Speedcage phía dưới upper tăng độ ôm chân khi di chuyển và giữ form giày tốt.<br>- Cổ giày được làm liền với chất liệu mềm mại dễ dàng mang, tháo giày.<br>- Bộ đệm độc quyền Air Zoom ở gót tạo độ êm ái và phản lực khi bứt tốc.<br>- Bộ đế gồm nhiều hình dạng đinh khác nhau tăng độ bền và bám sân.</p><h3>&nbsp;</h3>', '2024-05-11 22:48:37', 1, 1, 2, 0, 0),
(128, 'Nike Phantom GX II Pro TF - Mad Ready Pack', '<p><strong>Nike Phantom GX II Pro TF&nbsp;\'Mad Ready\' Pack</strong></p><p>&nbsp;</p><p><strong>Tên sản phẩm</strong>: Nike React Phantom GX II Pro TF<br><strong>Màu sắc</strong>: Xanh dương/Trắng<br><strong>Bộ sưu tập</strong>: Mad Ready Pack (2024)<br><strong>Mã sản phẩm</strong>: FJ2583-100<br><strong>Loại đế giày</strong>: Turf (TF dành cho mặt sân cỏ nhân tạo)<br><strong>Phân khúc</strong>: Pro<br><strong>Trọng lượng</strong>: 245 gram/chiếc (Size 41)<br><strong>Lưỡi gà</strong>: Dạng cổ thun&nbsp;<br><strong>Form chân phù hợp</strong>: Thon, Bè vừa<br><strong>Thời điểm ra mắt</strong>: 2024<br><strong>Phong cách thi đấu</strong>: Kiểm soát bóng, Sút<br><strong>Những cầu thủ đại diện</strong>: Kevin De Bruyne, Harry Kane, Ruben Dias<br><strong>Công nghệ, chất liệ</strong>u:<br>- Chất liệu Nikeskin mềm mại giúp giày co giãn tốt.<br>- Phần cổ thun được làm bằng sợi dệt ôm chân tốt.<br>- Bộ đệm độc quyền React ở gót tạo độ êm ái và phản lực khi bứt tốc.<br>- Bộ đế gồm nhiều hình dạng đinh khác nhau tăng độ bền và bám sân.</p>', '2024-05-11 23:35:57', 1, 1, 2, 0, 0),
(129, 'Nike Tiempo Legend 10 Pro TF - Mad Ready Pack', '<p><strong>NIKE TIEMPO 10 PRO TF \'MAD READY\' PACK</strong></p><p><strong>Tên sản phẩm:&nbsp;</strong>Nike Tiempo 10&nbsp;Pro TF (Giày đá bóng sân cỏ nhân tạo)</p><p><strong>Màu sắc: </strong>Cam</p><p><strong>Bộ sưu tập: </strong>Mad<strong>&nbsp;</strong>Ready&nbsp;Pack (2024)</p><p><strong>Mã sản phẩm:&nbsp;</strong>DV4336-700</p><p><strong>Loại đế giày: </strong>Turf (TF dành cho mặt sân cỏ nhân tạo)</p><p><strong>Phân khúc: </strong>Pro (Phổ thông/High-end)</p><p><strong>Trọng lượng: </strong>236 gram/chiếc (Size 41)</p><p><strong>Lưỡi gà: </strong>Dạng cổ liền&nbsp;</p><p><strong>Form chân phù hợp: </strong>Thon -&gt;&nbsp;Bè nhiều</p><p><strong>Thời điểm ra mắt: </strong>2023</p><p><strong>Phong cách thi đấu: </strong>Kiểm soát bóng, Chuyền bóng, Dứt điểm, Chia bài (Tiền vệ, Hậu vệ)</p><p><strong>Những cầu thủ đại diện: </strong>Virgil Van Dijk, Jordan Henderson, Tonali</p><p><strong>Công nghệ, chất liệu:</strong></p><ul><li>Form dáng chắc chắn, bè nhiều.</li><li>Chất liệu da Flytouch Lite siêu mềm mại, được thiết kế nhiều vùng chạm bóng để tăng khả năng kiểm soát bóng.</li><li>Được trang bị cổ thun liền giúp giày ôm chắc chân.</li><li>Bộ đế gồm những đinh nhiều hình dạng khác nhau với mật độ nhiều tăng khả năng bám sân.</li><li>Bộ đệm độc quyền React mềm mại, tăng độ êm ái khi thi đấu với thời gian dài.</li></ul><p>&nbsp;</p><p><br>&nbsp;</p>', '2024-05-11 23:40:34', 1, 1, 2, 0, 0),
(130, 'Nike Air Zoom Mercurial Vapor 15 Academy FG - Peak Ready Pack', '<p><strong>NIKE AIR ZOOM MERCURIAL VAPOR 15 ACADEMY FG - PEAK READY PACK</strong></p><p><strong>Tên sản phẩm:</strong>&nbsp;Nike Air Zoom Mercurial Vapor 15 Academy FG&nbsp; (Giày đá bóng sân cỏ tự nhiên)<br><strong>Hãng: </strong>Nike<br><strong>Màu sắc: </strong>Xanh lục<br><strong>Bộ sưu tập: </strong>Peak Ready Pack (2023)<br><strong>Mã sản phẩm:&nbsp;</strong>DJ5631-300<br><strong>Loại đế giày:</strong> FG (Firm Ground&nbsp;dành cho mặt sân cỏ tự nhiên)<br><strong>Phân khúc:</strong>&nbsp;Academy&nbsp;(Tầm Trung)<br><strong>Trọng lượng:</strong>&nbsp;198&nbsp;gram/chiếc (Size 41)<br><strong>Lưỡi gà:</strong>&nbsp;Lưỡi Gà Rời<br><strong>Form chân phù hợp:</strong> Thon<br><strong>Thời điểm ra mắt:</strong> 2023<br><strong>Phong cách thi đấu:</strong> Tốc độ, Dứt điểm (Tiền đạo, Chạy cánh)<br><strong>Những cầu thủ đại diện:</strong>&nbsp;Bruno Fernandes, Lewandowski,...</p>', '2024-05-11 23:45:23', 1, 1, 2, 0, 0),
(131, 'Puma Future Z 1.4 FG/AG - Fearless Pack', '<p><strong>PUMA FUTURE Z 1.4 FG/AG \'FEARLESS\' PACK</strong></p><p>Puma sẽ là thương hiệu giày đá bóng tiếp theo cho ra mắt phối màu dành cho World Cup 2022 mang tên “The Fearless” (Sự can đảm). Bộ sưu tập này tạo động lực cho các cầu thủ thể hiện&nbsp;lối chơi bóng sáng tạo với diện mạo mới đầy sức sống của Puma Ultra Ultimate và Future Z.</p><p><img src=\"https://file.hstatic.net/1000403328/file/m07_3fae4d80b2c645298ec4fbf7fdadc394_1024x1024.jpg\" width=\"1024\" height=\"512\"></p><p>Thời gian gần đây, Puma đang dần khẳng định vị thế của mình trên thị trường giày đá bóng bằng những cải tiến đáng kinh ngạc về mặt công nghệ lẫn thiết kế dành cho sản phẩm của họ. Bên cạnh đó, nhà Báo đang dần thu hút được những ngôi sao đại diện có sức ảnh hưởng lớn như Antony, Jorginho, Antoine Griezmann, Kingsley Coman và đặc biệt là Neymar Jr. World Cup 2022 chính là sân chơi đỉnh cao nhất cho các ngôi sao của họ có thể tỏa sáng, Puma “The Fearless” sẽ là thứ vũ khí đắc lực trên sân cỏ cho mùa đông sắp tới.&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/neymar_0b0925cb57e949d2857e976acfcb5d00_1024x1024.jpg\" width=\"800\" height=\"600\"></p><p><img src=\"https://file.hstatic.net/1000403328/file/m18geneeration_6ca596f94bca432baacd9373f3fcb5f0_1024x1024.jpg\" width=\"800\" height=\"600\"></p><p><img src=\"https://file.hstatic.net/1000403328/file/mdepay_c5902a12d8df411eb48a7d8780b73d18_1024x1024.jpg\" width=\"800\" height=\"600\"></p><p>“Sometimes you have to be fearless if you want great things to happen” (Đôi lúc ta cần phải can đảm nếu muốn điều tốt đẹp xảy ra) Christian Pulisic chia sẻ.</p><p><img src=\"https://file.hstatic.net/1000403328/file/pulisic_36fddbe30c464863a60c75f161599513_1024x1024.jpg\" width=\"800\" height=\"600\"></p><p><strong>1. Puma Ultra Ultimate “The Fearless”</strong></p><p>Về thiết kế: Bao phủ bởi một màu cam ánh hồng chủ đạo (Fiery Coral), toàn bộ bề mặt giày là những chi tiết dạng mũi tên nhỏ chạy theo những đường song song xuống đến tận khuôn đế tạo nên hiệu ứng rất bắt mắt trên phối màu sáng này. Đặc biệt không thể thiếu là họa tiết Formstripe đặc trưng của Puma nằm trải dài ở phần má ngoài tạo nên cảm giác tốc độ cho dòng giày này. Bộ đế cũng sử dụng phối màu tương tự với upper tạo nên sự liền mạch về phối màu.</p><p>Về công nghệ, mẫu giày cũng sở hữu những trang bị và công nghệ tương tự như các phối màu trước đó của Puma Ultra Ultimate, Chất liệu ULTRAWEAVE mềm, mỏng, siêu nhẹ được trang bị ở phần Upper. PWRTAPE được gia cố thêm ở upper giúp hỗ trợ ôm chân và tăng độ bền. Công nghệ PWRPRINT được thiết kế để cung cấp sự ổn định cũng được trang bị trên mẫu giày này.</p><p><img src=\"https://file.hstatic.net/1000403328/file/fearless-13-min_2d7102cf5f164a13802591c65ea68250_1024x1024.jpg\" width=\"1024\" height=\"667\"></p><p><img src=\"https://file.hstatic.net/1000403328/file/fearless-12-min_efb0b517e658410da8a95dc4222c3c12_1024x1024.jpg\" width=\"1024\" height=\"667\"></p><p><img src=\"https://file.hstatic.net/1000403328/file/fearless-10-min_128ba972d1d84bf5a8bd3999a529eb3f_1024x1024.jpg\" width=\"1024\" height=\"667\"></p><p><img src=\"https://file.hstatic.net/1000403328/file/fearless-11-min_fbead00e5e344cd9a449e7798f816a93_1024x1024.jpg\" width=\"1024\" height=\"667\"></p><p><strong>2. Puma Future Z “The Fearless”</strong></p><p>Về thiết kế: Cũng giống như Puma Ultra, phối màu chính của Future là cam ánh hồng với những chi tiết mũi tên nhỏ xung quanh khu vực upper và đế giày.Ở dòng Puma Future Z, hãng sẽ sử dụng hình ảnh con báo biểu tượng của nhà Puma thay cho họa tiết Formstripe. Hình ảnh này biểu tượng cho sự nhanh nhẹn và dẻo dai của loài báo giống như lối chơi mà dòng giày này mang lại.</p><p>Về công nghệ: Puma Future Z nổi bật với sợi dệt FUZIONFIT+ thế hệ thứ 2 giúp ôm lấy vừa vặn phần bàn chân của người sử dụng và có thể co giãn theo nhiều dạng form chân khác nhau và ta có thể sử dụng giày mà không cần dây. Bộ đế hình chữ Z kết hợp với công nghệ Dynamic Motion System hỗ trợ người chơi trong khả năng bức tốc và xoay chuyển hướng.</p><p><img src=\"https://file.hstatic.net/1000403328/file/fearless-9-min_036175d381e04bf08c40d6925d80f581_1024x1024.jpg\" width=\"1024\" height=\"667\"></p><p><img src=\"https://file.hstatic.net/1000403328/file/fearless-5-min_3baf00e1227f4a47bb07c99cfd45d050_1024x1024.jpg\" width=\"1024\" height=\"667\"></p><p><img src=\"https://file.hstatic.net/1000403328/file/fearless-6-min_b9d8ef5d26154400a7d7819dc9dda5f7_1024x1024.jpg\" width=\"1024\" height=\"667\"></p><p><img src=\"https://file.hstatic.net/1000403328/file/fearless-7-min_db8cac4377344b7f85394e6238f505af_1024x1024.jpg\" width=\"1024\" height=\"667\"></p><p><img src=\"https://file.hstatic.net/1000403328/file/fearless-3-min_16c8ce504fa645af94c58b7a53d1e2c0_1024x1024.jpg\" width=\"1024\" height=\"667\"></p>', '2024-05-11 23:48:18', 1, 1, 3, 5, 0),
(132, 'Puma Ultra Ultimate FG/AG - Supercharge Pack', '<p><strong>PUMA ULTRA ULTIMATE&nbsp;FG/AG \'SUPERCHARGE\' PACK</strong></p><p><strong>Tên sản phẩm</strong>:&nbsp;Puma Ultra Ultimate FG/AG</p><p><strong>Mã sản phẩm:</strong>&nbsp;107163 01</p><p><strong>Loại đế giày</strong>: dành cho sân cỏ tự nhiên 11&nbsp;người</p><p><strong>Phân khúc:</strong>&nbsp;Ultimate</p><p><strong>Form giày:&nbsp;</strong>From vừa, phù hợp chân thon hoặc bè vừa</p><p><strong>Lưỡi gà:&nbsp;</strong>dạng cổ thun liền&nbsp;với chất liệu cao cấp</p><p><strong>Chất liệu Upper:&nbsp;</strong>&nbsp;upper với công nghệ SPEEDCAGE nổi tiếng giúp hỗ trợ tối đa cho người chơi</p><p><strong>Điểm mới:</strong>&nbsp;Thể hiện tốc độ không tưởng của bạn khi mang giày bóng đá PUMA Ultra 1.4 FG / AG màu xám, có tính năng mới các vết cắt trên ULTRACut ở phần upper&nbsp;cho cảm giác thậm chí còn nhẹ hơn. Tiêu chí&nbsp;nhẹ hơn và nhanh hơn bao giờ hết được áp dụng trên&nbsp;giày bóng đá PUMA Ultra 1.4 FG / AG kết hợp Công nghệ MATRYXEVO dệt thích ứng với microfibre SPEEDCAGE để cung cấp hỗ trợ nhiều lớp trong các chuyển động ở tốc độ cao. Sợi phản ứng của MATRYXEVO rất&nbsp;chắc chắn giúp&nbsp;bạn tiến&nbsp;về phía trước nhanh nhất có thể, trong khi SPEEDCAGE giữ cho bạn ổn định khi bạn thay đổi hướng kèm với&nbsp;tốc độ cao - đó là một giải pháp hoàn hảo trên phiên bản này. Hỗ trợ thêm cũng cho phép giữu&nbsp;trọng lượng ở giữa bàn chân, với các lổ&nbsp;cắt được thiết kế&nbsp;giúp giảm tải trọng của đôi giày&nbsp;để giúp bạn đạt&nbsp;tốc độ cao hơn nữa. Đối với bề mặt upper, lớp phủ GripControl Pro phổ biến ở mặt trên hỗ trợ bạn xử lý các pha bóng theo ý muốn của bạn một cách hoàn hảo. Ở những vị trí&nbsp;khác của đôi giày, hệ thống viền và cổ giày&nbsp;được sắp xếp hợp lý đảm bảo sự thoải mái, vừa vặn an toàn, trong khi chạy bức tốc&nbsp;quen thuộc. Đế ngoài Pebax SpeedUnit lấy cảm hứng từ mũi nhọn mang lại khả năng tăng tốc cực cao.</p><p><strong>Năm sản xuất:&nbsp;</strong>2023</p><p><strong>Phong cách thi đấu:&nbsp;</strong>kỹ thuật, tốc độ, dứt điểm.</p><p><strong>Bộ Sưu Tập: </strong>Supercharge Pack</p><p><strong>Những cầu thủ nổi tiếng đại diện:</strong>&nbsp;Antoine Griezmann, Raphael Varane và cầu thủ nữ nổi tiếng&nbsp;Nikita Parris.</p>', '2024-05-11 23:54:13', 1, 1, 3, 0, 0),
(133, 'Puma Ultra Ultimate FG/AG - Pursuit Pack', '<p><strong>PUMA ULTRA ULTIMATE&nbsp;FG/AG \'PURSUIT\' PACK</strong></p><p><strong>Tên sản phẩm</strong>:&nbsp;Puma Ultra Ultimate FG/AG</p><p><strong>Mã sản phẩm:</strong>&nbsp;107163 03</p><p><strong>Loại đế giày</strong>: dành cho sân cỏ tự nhiên 11&nbsp;người</p><p><strong>Phân khúc:</strong>&nbsp;Ultimate</p><p><strong>Form giày:&nbsp;</strong>From vừa, phù hợp chân thon hoặc bè vừa</p><p><strong>Lưỡi gà:&nbsp;</strong>dạng cổ thun liền&nbsp;với chất liệu cao cấp</p><p><strong>Chất liệu Upper:&nbsp;</strong>&nbsp;upper với công nghệ SPEEDCAGE nổi tiếng giúp hỗ trợ tối đa cho người chơi</p><p><strong>Điểm mới:</strong>&nbsp;Thể hiện tốc độ không tưởng của bạn khi mang giày bóng đá PUMA Ultra 1.4 FG / AG màu xám, có tính năng mới các vết cắt trên ULTRACut ở phần upper&nbsp;cho cảm giác thậm chí còn nhẹ hơn. Tiêu chí&nbsp;nhẹ hơn và nhanh hơn bao giờ hết được áp dụng trên&nbsp;giày bóng đá PUMA Ultra 1.4 FG / AG kết hợp Công nghệ MATRYXEVO dệt thích ứng với microfibre SPEEDCAGE để cung cấp hỗ trợ nhiều lớp trong các chuyển động ở tốc độ cao. Sợi phản ứng của MATRYXEVO rất&nbsp;chắc chắn giúp&nbsp;bạn tiến&nbsp;về phía trước nhanh nhất có thể, trong khi SPEEDCAGE giữ cho bạn ổn định khi bạn thay đổi hướng kèm với&nbsp;tốc độ cao - đó là một giải pháp hoàn hảo trên phiên bản này. Hỗ trợ thêm cũng cho phép giữu&nbsp;trọng lượng ở giữa bàn chân, với các lổ&nbsp;cắt được thiết kế&nbsp;giúp giảm tải trọng của đôi giày&nbsp;để giúp bạn đạt&nbsp;tốc độ cao hơn nữa. Đối với bề mặt upper, lớp phủ GripControl Pro phổ biến ở mặt trên hỗ trợ bạn xử lý các pha bóng theo ý muốn của bạn một cách hoàn hảo. Ở những vị trí&nbsp;khác của đôi giày, hệ thống viền và cổ giày&nbsp;được sắp xếp hợp lý đảm bảo sự thoải mái, vừa vặn an toàn, trong khi chạy bức tốc&nbsp;quen thuộc. Đế ngoài Pebax SpeedUnit lấy cảm hứng từ mũi nhọn mang lại khả năng tăng tốc cực cao.</p><p><strong>Năm sản xuất:&nbsp;</strong>2022</p><p><strong>Phong cách thi đấu:&nbsp;</strong>kỹ thuật, tốc độ, dứt điểm.</p><p><strong>Bộ Sưu Tập: </strong>Pursuit&nbsp;Pack</p><p><strong>Những cầu thủ nổi tiếng đại diện:</strong>&nbsp;Antoine Griezmann, Raphael Varane và cầu thủ nữ nổi tiếng&nbsp;Nikita Parris.</p><p>&nbsp;</p>', '2024-05-12 00:05:38', 1, 1, 3, 0, 0),
(134, 'adidas Copa Pure 2.3 FG - Marinerush Pack', '<h2><strong>ADIDAS COPA PURE 2.3 FG&nbsp;\'MARINERUSH\'&nbsp;PACK</strong></h2><p><strong>Tên sản phẩm: </strong>adidas Copa Pure 2.3 FG&nbsp;(Giày đá bóng sân cỏ tự nhiên)<br><strong>Màu sắc:&nbsp;</strong>Xanh/Trắng<br><strong>Bộ sưu tập:</strong> Marinerush Pack (2023)<br><strong>Mã sản phẩm:&nbsp;</strong>IE4896<br><strong>Loại đế giày:</strong> Firm Ground&nbsp;(FG dành cho mặt sân cỏ tự nhiên)<br><strong>Phân khúc:</strong> .3&nbsp;(Phổ thông)</p><p><strong>Trọng lượng: </strong>247 gram/chiếc (size 41)<br><strong>Lưỡi gà:</strong> Dạng cổ rời<br><strong>Form chân phù hợp:</strong> Thon, Bè vừa<br><strong>Thời điểm ra mắt:</strong> 2023<br><strong>Phong cách thi đấu:</strong>&nbsp;Cầm bóng, điều phối bóng (Tiền vệ)<br><strong>Những cầu thủ đại diện: </strong>Pedri, Gundogan.…</p>', '2024-05-26 05:18:10', 1, 1, 1, 6, 0),
(135, 'adidas X Crazyfast Messi .3 FG - Infinito Pack', '<p><strong>ADIDAS X CRAZYFAST MESSI&nbsp;.3 FG \'INFINITO\'</strong></p><p><strong>Tên sản phẩm: </strong>adidas X Crazyfast&nbsp;.3&nbsp;FG (Giày đá bóng sân cỏ tự nhiên)<br><strong>Màu sắc:&nbsp;</strong>Xám<br><strong>Bộ sưu tập: </strong>Infinito&nbsp;Pack (2023)<br><strong>Mã sản phẩm:</strong>&nbsp;IE4078<br><strong>Loại đế giày:</strong> FG (Firm Ground&nbsp;dành cho mặt sân cỏ tự nhiên)<br><strong>Phân khúc:</strong> .3&nbsp;(Tầm trung)<br><strong>Trọng lượng:</strong> 241 gram/chiếc (Size 41)<br><strong>Lưỡi gà:</strong> Dạng cổ thun<br><strong>Form chân phù hợp:</strong> Thon, Bè vừa<br><strong>Thời điểm ra mắt:</strong> 2023<br><strong>Phong cách thi đấu:</strong> Tốc độ, Dứt điểm (Tiền đạo, Chạy cánh)<br><strong>Những cầu thủ đại diện:</strong> Lionel Messi, Rafael Leao, Mohamed Salah, Son Heung-min, …<br>&nbsp;</p>', '2024-05-12 00:21:30', 1, 1, 1, 9, 0),
