(147, 'Balo Nike Jordan Air Patrol Backpack - 9A0172 023 ', '<h2><strong>NIKE JORDAN AIR PATROL BACKPACK</strong></h2><p><strong>Tên sản phẩm</strong>:&nbsp;Nike Jordan Air Patrol Backpack<br><strong>Màu sắc</strong>: Đen<br><strong>Mã sản phẩm</strong>:&nbsp;9A0172 023</p>', '2024-05-17 14:05:40', 1, 37, 2, 1, 0),
(149, 'BÌNH XỊT NANO CHỐNG NƯỚC CREP PROTECT 200ML', '<h2><strong>BÌNH XỊT NANO CHỐNG NƯỚC CREP PROTECT 200ML</strong></h2><p><i><strong>\"Quên đi nỗi lo giày ướt mùa mưa\"</strong></i></p><p><strong>Giới thiệu:</strong></p><p>&nbsp;</p><p><strong>Bình xịt nano chống thấm chống bám dơ Crep Protect Spray 200ml</strong> đây là một sản phẩm thông minh tuyệt vời của <strong>Crep Protect</strong>&nbsp;đem lại cho các bạn mang giày mà sợ dơ bẩn bám lên giày hay dính nước cafe, nước sốt, bị ướt nước, bùn đất,...</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/img_5327_0636bd6b1cd94945bb9489147d8dfc69_grande.jpg\" width=\"600\" height=\"599\"></p><p>&nbsp;</p><p>Những ai mang giày gặp mưa mà sợ dơ, ướt,ố vàng và trong các chuyến đi chơi xa nhưng lại không thể mang nhiều đôi giày&nbsp;thì <strong>Crep Protect Spray</strong> là một sự lựa chọn thông minh. Nó giúp bạn chống thấm, chống bám dơ bẩn lên giày một cách tuyệt vời.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/crepprotect-nano-spray_d6a28f579941422fb081dec692229f3c_grande.jpg\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><p><strong>Cách sử dụng:</strong></p><p>&nbsp;</p><p><strong>Nguyên tắc vàng</strong>&nbsp;để xịt hiệu quả tốt nhất đó là&nbsp;<strong>NHẤN - GIỮ - XỊT</strong>&nbsp;tức là bạn nhấn giữ xịt. Chứ đừng nhấn thả nhấn thả như vậy nó chỉ ra hơi chứ không ra nano. Các bạn lưu ý nhé.</p><p><strong>Bước 1:</strong>&nbsp;Chuẩn bị đôi giày cần xịt bảo vệ.</p><p><img src=\"https://file.hstatic.net/1000403328/file/93859025_2863345410413405_1752792525912932352_o_804916c028614772b675d7bc51aa1f4a_grande.jpg\" width=\"600\" height=\"600\"></p><p><strong>Lưu ý 1:</strong>&nbsp;Đôi giày phải sạch mới xịt lên. Nếu giày đang dơ thì vệ sinh sạch nhé. Bởi vì bình xịt nano Crep Protect Spray có công dụng giúp bạn chống thấm nước, chống bám dơ giữ cho đôi giày bạn luôn sạch.</p><p><strong>Lưu ý 2:</strong>&nbsp;Nếu bạn là người mang giày thường xuyên thì nên xịt 2 lớp theo cách dưới đây. Còn bạn không mang giày thường xuyên lắm thì nên xịt 1 lớp thôi nhé.</p><p><strong>Lưu ý 3:&nbsp;</strong>Cái lỗi này ai cũng mắc phải đó là xịt quá tay làm cho bình nano mau hết. Bạn chỉ cần xịt hơi sương qua thôi không cần xịt kỹ làm cho giày ướt.</p><p><strong>Bước 2:</strong>&nbsp;Lắc đều bình xịt lên rồi sau đó bạn bắt đầu xịt lớp thứ 1 lên giày. Xịt cảm thấy hơi ướt giày là ok nói cho dễ hiểu là xịt hơi sương qua thôi không cần xịt nhiều.</p><p><img src=\"https://file.hstatic.net/1000403328/file/94308136_2863345420413404_696490631366705152_o_dc8666cfe26340a68317274ee1bfa03c_grande.jpg\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><p><strong>Bước 3:</strong>&nbsp;Sau khi xịt xong để khô tự nhiên khoảng 10 phút.</p><p><img src=\"https://file.hstatic.net/1000403328/file/94078652_2863345527080060_6784324564030586880_o_c06328ca4b8345bd8b0366b716f02c25_grande.jpg\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><p><strong>Bước 4:</strong>&nbsp;Xịt thêm lớp thứ 2 lên giày. Nhưng xịt ít hơn lớp thứ 1 nhé. Vì lớp 2 mục đích xịt dậm thêm thôi không cần kỹ quá. Sau khi xịt xong nếu để khô tự nhiên trong nhà thì 15&nbsp;phút trở lên để khô càng lâu càng tốt.</p><p>Lớp thứ 2 rất quan trọng nếu bạn để khô càng lâu hiệu quả chống thấm, chống bám bẩn càng cao và lâu ngày.</p><p><img src=\"https://file.hstatic.net/1000403328/file/94023939_2863345570413389_4623994428330082304_o_124bc97484b94139992e486233ad80d8_grande.jpg\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><p>&nbsp;</p><p>Bình xịt nano chống thấm Crep Protect Spray này bạn xịt được: giày (vải, da lộn, da, cao su…), áo khoác, kính xe, kính bảo hiểm…</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/10616727_301399516709553_139499908_n_257cc7c6f2794ccdb28f69d92c59ecb9_grande.jpg\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><p><strong>Lưu ý: </strong>Trên đây là những cách bước xịt trực tiếp lên giày có chất liệu vải, vải nỉ, nhung, da lộn. Còn đối với những chất liệu như là da bóng, gương xe, gương bảo hiểm nói chung những mặt bóng thì bạn nên xịt gián tiếp bằng cách bạn lắc đều bình xịt nano lên sau đó xịt lên tấm bông hoặc miếng vải nhỏ cho ướt rồi bạn lau nước nano lên bề mặt bạn cần bảo vệ.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/blood_bath_239b183678124e89a005b9d0df717374_grande.jpg\" width=\"600\" height=\"404\"></p><p>&nbsp;</p><p><strong>Lời khuyên:</strong>&nbsp;Tốt nhất bạn để khô tự nhiên đừng nên đem ra nắng phơi nhé. Bởi vì đem ra nắng phơi làm ảnh hưởng tới giày làm cho giày nhanh hư, phai màu của giày.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/lifestyle_c57c6d0aa45b47d183fa05ce1445d8ad_grande.jpg\" width=\"600\" height=\"359\"></p><figure class=\"media\"><oembed url=\"https://www.youtube.com/watch?v=rEh4f0K_d9k\"></oembed></figure>', '2024-05-17 14:10:34', 1, 4, 11, 1, 0),
(150, 'BỘ SẢN PHẨM VỆ SINH GIÀY THE ULTIMATE SNEAKER CARE KIT - CREP PROTECT', '<p><strong>BỘ SẢN PHẨM VỆ SINH GIÀY THE ULTIMATE SNEAKER CARE&nbsp;</strong></p><p><strong>KIT - CREP PROTECT</strong></p><p>&nbsp;</p><p><strong>&nbsp; Giới thiệu:</strong></p><p>&nbsp;</p><ul><li>Nói đến&nbsp;bộ sản phẩm vệ sinh giày sneaker Crep Protect The Ultimate Tube Kit&nbsp;thì bộ sản phẩm này là bộ VIP nhất dành cho dân sneaker. Bộ Tube Kit này được ra mắt 2019 trong bộ này có đủ phụ kiện để giúp bạn làm sạch, bảo vệ, khử mùi…cho giày cưng từ A-Z.</li></ul><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/crep-catalog-tube_2fccad56109749e9a705002cde3c7c71_grande.jpg\" width=\"600\" height=\"360\"></p><p>&nbsp;</p><p><strong>&nbsp; Crep Protect The Ultimate Tube Kit gồm:</strong></p><p>&nbsp;</p><ul><li>Sản phẩm thứ 1&nbsp;là Bộ vệ sinh giày dơ&nbsp;Crep Protect Cure Kit&nbsp;gồm có: một chai dung dịch Crep Protect 100ml dùng được cho mọi chất liệu giày và làm sạch được khoảng 40-50 đôi giày, một bàn chải lông mềm chà được mọi chất liệu giày, một khăn lau cotton giúp lau sạch tổng thể sau khi vệ sinh.</li><li>Sản phẩm thứ 2&nbsp;là Bình xịt nano chống thấm nước cho giày&nbsp;Crep Protect Spray 200ml&nbsp;giúp bảo vệ giày không ướt không bám dơ. Dùng được cho mọi chất liệu giày và một lần xịt hiệu quả khoảng 4 tuần.</li><li>Sản phẩm thứ 3&nbsp;là Hai nhộng khử mùi giày hôi&nbsp;Crep Protect Pill&nbsp;giúp giày luôn thơm và khô thoáng. Dùng được cho mọi loại giày và cách sử dụng dễ dàng.</li><li>Sản phẩm thứ 4&nbsp;là Một cặp shoe tree cây giữ form giày&nbsp;Crep Protect Trees&nbsp;giúp giữ dáng giày luôn thẳng đẹp. Giữ được size 35-46 và lò xo được sơn chống gỉ.</li><li>Sản phẩm thứ 5&nbsp;là Sáu khăn ướt lau giày dơ khẩn cấp&nbsp;Crep Protect Wipes. Giúp xử lý những vết bẩn nhanh chóng và tiện lợi.</li></ul><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/crep-protect-tube-kit-v4_b8931bf0b62c4481973431b578ff0363_grande.jpg\" alt=\"\" width=\"490\" height=\"600\"></p><p>&nbsp;</p><p><strong>&nbsp; Cách sử dụng:</strong></p><ul><li><a href=\"https://urixx.com/collections/protect/products/bo-ve-sinh-giay-crep-protect-cure-ultimate-cleaning-kit\">Sản phẩm thứ 1&nbsp;là Bộ vệ sinh giày dơ&nbsp;Crep Protect Cure Kit.&nbsp;</a></li><li><a href=\"https://urixx.com/collections/protect/products/binh-xit-nano-chong-nuoc-crep-protect-200ml\">Sản phẩm thứ 2&nbsp;là Bình xịt nano chống thấm nước cho giày&nbsp;Crep Protect Spray</a></li><li><a href=\"https://urixx.com/collections/protect/products/vien-nang-khu-mui-chong-moc-giay-crep-protect-pills\">Sản phẩm thứ 3&nbsp;là Hai nhộng khử mùi giày hôi&nbsp;Crep Protect Pill</a></li><li><a href=\"https://urixx.com/collections/protect/products/cay-giu-form-giay-cao-cap-crep-protect\">Sản phẩm thứ 4&nbsp;là Một cặp shoe tree cây giữ form giày&nbsp;Crep Protect Trees</a></li><li><a href=\"https://urixx.com/collections/protect/products/khan-uot-ve-sinh-giay-crep-protect-wipes\">Sản phẩm thứ 5&nbsp;là Sáu khăn ướt lau giày dơ khẩn cấp&nbsp;Crep Protect Wipes</a></li></ul>', '2024-05-18 14:42:01', 1, 4, 11, 1, 0),
(151, 'BỘ VỆ SINH GIÀY CREP PROTECT - ULTIMATE GIFT PACK', '<h2><strong>BỘ VỆ SINH GIÀY CREP PROTECT - ULTIMATE GIFT PACK</strong></h2><p>&nbsp;</p><p><strong>Giới thiệu:</strong></p><p>&nbsp;</p><p>&nbsp;</p><p>Crep Protect Ultimate Gift Pack&nbsp;là một bộ sản phẩm làm sạch, chăm sóc và bảo vệ giày một cách TUYỆT VỜI - NHANH CHÓNG - CẤP TỐC cũng có thể được xem là bộ vệ sinh VIP và được dân sneaker ưa chuộng nhất.&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/92943028_2842372032510743_109210276624072704_o_566bbe8df090466681dd8a744bfadbe9_grande.jpg\" width=\"600\" height=\"400\"></p><p>&nbsp;</p><p>Sau khi bạn sở hữu được bộ full này thì chẳng phải sợ giày của bạn bị dơ hay ướt nữa đôi giày cưng của bạn sẽ được ở trạng thái lúc nào cũng sạch.&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/119875_a52991a5d73e4b2f9e743c4bb9a17025_grande.jpg\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><p>&nbsp;</p><p><strong>Bộ Crep Protect - Ultimate Gift Pack gồm:</strong></p><p>&nbsp;</p><ul><li>Một bộ vệ sinh làm sạch giày <a href=\"https://urixx.com/collections/protect/products/bo-ve-sinh-giay-crep-protect-cure-ultimate-cleaning-kit\"><strong>Crep Protect Cure</strong></a>&nbsp;gồm 1 bàn chải lông cực mềm (Premium Brush) thích hợp vệ sinh được mọi chất liệu, 1 chai vệ sinh Crep Protect Cure 100ml (vệ sinh được 40-50 đôi giày), 1 khăn lau cotton mềm hút ẩm thích hợp cho việc lau sạch tổng thể đôi giày.</li><li>&nbsp;Một bình xịt nano chống thấm, chống bám dơ bẩn <a href=\"https://urixx.com/collections/protect/products/binh-xit-nano-chong-nuoc-crep-protect-200ml\"><strong>Crep Protect Spray</strong></a>&nbsp;giúp đôi giày của bạn tránh xa mọi dơ bẩn lỏng và nước.</li><li>&nbsp;Và sau cùng là một sản phẩm giúp cho bộ set full này&nbsp;<strong>ĐẶC BIỆT</strong>&nbsp;đó là 12 miếng <a href=\"https://urixx.com/collections/protect/products/khan-uot-ve-sinh-giay-crep-protect-wipes\"><strong>Crep Protect Wipes</strong></a>&nbsp;lau sạch vết bẩn bám trên giày SẠCH NHANH - CẤP TỐC - TIỆN LỢI.</li></ul><p>&nbsp;</p><p>&nbsp;</p><p><strong>Hướng dẫn sử dụng:</strong></p><p>&nbsp;</p><p>Crep Protect Cure: <a href=\"https://urixx.com/collections/protect/products/bo-ve-sinh-giay-crep-protect-cure-ultimate-cleaning-kit\">Tại đây</a>.</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/crepprotect-curekit-usage_19c43683c70c4be9b6c45337b5aa13b1_grande.jpg\" alt=\"\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><p>Crep Protect Spray: <a href=\"https://urixx.com/collections/protect/products/binh-xit-nano-chong-nuoc-crep-protect-200ml\">Tại đây</a>.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/page5_270d21f9c223403383e19da234465ea1_grande.jpg\" alt=\"\" width=\"600\" height=\"360\"></p><p>Khăn ướt Crep Protect Wipes: <a href=\"https://urixx.com/collections/protect/products/khan-uot-ve-sinh-giay-crep-protect-wipes\">Tại đây</a></p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/page8_13ed37cc06764722b3af8b8c796e31d1_grande.jpg\" alt=\"\" width=\"600\" height=\"360\"></p>', '2024-05-18 14:43:37', 1, 4, 11, 1, 0),
(152, 'BỘ VỆ SINH GIÀY CREP PROTECT CURE ULTIMATE CLEANING KIT', '<h2><strong>BỘ VỆ SINH GIÀY CREP PROTECT CURE ULTIMATE CLEANING KIT</strong></h2><p><strong>Giới thiệu:</strong></p><p>&nbsp;</p><p>Crep Protect Cure là bộ vệ sinh làm sạch giày tuyệt vời của&nbsp;<strong>&nbsp;Crep Protect</strong>. Giúp&nbsp; tiết kiệm chi phí việc giặt giày. Chỉ vài thao tác đơn giản và mất khoảng 15 - 20 phút là đôi giày của bạn sạch ngay. Crep Protect Cure Kit 100ml là một bộ vệ sinh giày dơ cơ bản nhất cần phải có cho giày sneaker.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/crep-protect-kit-elements_4efed8ba0ded4246a9d515dd216cb465_grande.jpg\" width=\"600\" height=\"317\"></p><p>&nbsp;</p><p><strong>TẠI SAO NÊN CHỌN BỘ VỆ SINH GIÀY SNEAKER CREP PROTECT CURE KIT LÀM SẠCH GIÀY DƠ?</strong></p><p>- Thành phần 98% từ thiên nhiên nên không sợ hư hại đến giày.</p><p>- Chà sạch được dơ bẩn trên mọi chất liệu giày: vải, vải lưới, da, da lộn, boost…</p><p>- Là dạng vệ sinh khô nên khi vệ sinh giày xong giày chỉ ẩm không ướt hoàn toàn nên giày nhanh khô và không gây ảnh hưởng tới keo giày.</p><p>- Giúp xử lý dơ bẩn một cách sạch tốt</p><p>nhất.</p><p>- Dễ sử dụng và an toàn tuyệt đối cho giày vì đây là bộ vệ sinh giày dơ chuyên dụng có nồng độ tẩy phù hợp dành cho giày sneaker.</p><p>- Dung dịch có mùi thơm nhẹ dễ chịu.</p><p>- Dung dịch ít nhờn nên không gây khó chịu khi dùng.</p><p>- Có nguồn gốc xuất xứ từ một quốc gia lớn là Vương Quốc Anh.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/cure_refil_images_6f36fc7247c5496bb7ec71f08ef61789_grande.jpg\" width=\"600\" height=\"400\"></p><p>&nbsp;</p><h3><strong>VẬY BỘ VỆ SINH GIÀY CREP PROTECT CURE KIT GỒM CÓ NHỮNG GÌ?</strong></h3><p>- Một chai dung dịch vệ sinh Crep Protect Cure 100ml. Một chai bạn có thể làm sạch được 40 đến 50 đôi giày. Nếu&nbsp;bạn dùng hết chai 100ml thì bạn có thể mua lẻ chai vệ sinh <strong>Crep Protect Cure Refill 200ml.</strong></p><p>- Một bàn chải lông mềm giúp bạn chà vệ sinh được trên mọi chất liệu giày: vải, da, da lộn, cao su…Do lông mềm nên không gây xù lông khi vệ sinh trên vải, không gây trầy xước khi vệ sinh trên giày da.</p><p>- Một khăn lau cotton cực mềm và hút ẩm giúp bạn lau sạch tổng thể được trên mọi đôi giày sau khi vệ sinh xong.</p><p>- Một khay đựng nước nhỏ gọn giúp bạn tiện lợi vệ sinh đôi giày dù bất cứ ở nơi đâu.</p><p>- Và cuối cùng là một túi đựng nhỏ gọn có dây kéo khóa an toàn giúp bạn có thể đem đi mọi lúc mọi nơi.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/crep-catalog-curekit_ff79a597ba98436ab76c214f8fb05a52_grande.jpg\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><p><strong>Cách sử dụng:</strong></p><p>&nbsp;</p><p><strong>Bước 1:</strong>&nbsp;Cho nước ấm vào khay, nhúng ướt bàn chải chuyên dụng.</p><p><strong>Bước 2:</strong>&nbsp;Cho một lượng dung dịch vệ sinh giày Crep Protect Cure khoảng 5-6 giọt trực tiếp lên bàn chải.&nbsp;</p><p><strong>Bước 3:</strong>&nbsp;Chà nhẹ bàn chải lên bề mặt giày để tẩy sạch vết bẩn&nbsp;</p><p><strong>Bước 4:</strong>&nbsp;Dùng khăn lau Crep Protect thấm nhẹ lên bề mặt giày để hút nước và để giày khô tự nhiên với nhiệt độ thường.&nbsp;Tuyệt đối không phơi nắng. Vì phơi nắng làm mau hư, phai màu giày của bạn.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/crepprotect-curekit-usage_0bb165e600bd49d09e5f1163257c97d6_grande.jpg\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><p><strong>Mẹo giúp giày nhanh khô:&nbsp;</strong>Nhét giấy vệ sinh hoặc giấy ăn vào giày cho hút khô nước rồi lấy giấy ra. Và sau đó đem đi phơi quạt.</p><p><strong>Nhưng lưu ý đặc biệt đối với những giày vải full trắng.</strong>&nbsp;Bắt buộc chúng ta cần làm thêm 2 bước nữa giày vải trắng mới sạch hoàn toàn. Sau khi chúng ta vệ sinh sạch, lau sạch xong (hoàn thành ở bước 6) thì chúng ta cần phải xả lại với nước sạch và lấy giấy vệ sinh hoặc giấy ăn quấn quanh từng chiếc giày và nhét vào trong giày cho nó hút ẩm, hút dơ sau đó ta mới phơi trước quạt hoặc để khô tự nhiên.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/upper_brush_2ad876bd3c2d48ba850323078b55443a_grande.jpg\" width=\"480\" height=\"600\"></p>', '2024-05-18 14:44:54', 1, 4, 11, 1, 0),
(153, 'BÚT REPAINT ĐẾ GIÀY CREP PROTECT MARK-ON (WHITE) MIDSOLE CUSTOM PEN', '<p><strong>BÚT REPAINT ĐẾ GIÀY CREP PROTECT MARK-ON (WHITE) MIDSOLE CUSTOM PEN</strong></p><p><strong>Giới thiệu:</strong></p><p>&nbsp;</p><p><strong>Bút repaint đế giày Crep Protect Mark On Pen White</strong>&nbsp;được thiết kế với đầu to 4mm để giúp bạn sơn chính xác và dễ dàng hơn trên đế giày của bạn. Màu của cây bút là màu trắng.</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/page9_32694f45525f400694446334faab23ba_grande.jpg\" width=\"600\" height=\"360\"></p><p>&nbsp;</p><p>&nbsp;</p><p><strong>&nbsp;Lợi ích:</strong></p><p>&nbsp;</p><ul><li>Khi đế giày đã cũ thì có thể sơn mới lại.</li><li>Dùng repaint lại đế giày đã bị ố vàng hoặc đế giày bị bẩn vệ sinh không ra.</li></ul><p><strong>Những trường hợp dùng bút Crep Protect Mark On Pen White sơn là: đế giày bị ố vàng, bị cũ, bị phai màu, rạn nứt màu...</strong></p><ul><li>Một cây bạn có thể repaint lên đến 4-6 đế giày.</li><li>Crep Protect Mark On Pen White được làm bằng sơn oil based vì vậy không sợ bị phai hay tróc sau khi repaint.</li></ul><p><strong>&nbsp; Cách sử dụng:</strong></p><p>&nbsp;</p><ul><li>&nbsp;Trước tiên hãy vệ sinh sạch bụi hoặc bẩn trên đế giày.</li><li>&nbsp;Tiếp theo dùng bút tô lớp thứ nhất và để khô 15-20 phút.</li><li>Sau khi khô lớp thứ nhất tô thêm lớp thứ hai để càng khô lâu càng tốt. Tốt nhất đợi khô hoàn toàn hãy đem giày ra mang.</li></ul><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/83673513_2689216104493004_6135940014510440448_o_ac6d470bfa0d4c4f8f88e76eb2c20f3c_grande.jpg\" width=\"546\" height=\"600\"></p>', '2024-05-18 14:45:39', 1, 4, 11, 2, 0),
(154, 'CÂY GIỮ FORM GIÀY CAO CẤP CREP PROTECT', '<p><strong>CÂY GIỮ FORM GIÀY CAO CẤP CREP PROTECT</strong></p><p><strong>&nbsp; Giới thiệu:</strong></p><ul><li>Crep Protect Trees cây giữ form giày cao cấp. Được thiết kế độc đáo lò xo thân giữa cực mềm và đàn hồi. Vì vậy bạn có thể để giữ form được giày size 35-46 là chuyện đơn giản. Ngoài ra lò xo được sơn chống rỉ nên bạn không cần phải sợ lâu ngày lò xo bị rỉ. Còn về mủi form thì có lớp vải nỉ bao bọc và chữ Crep Protect in nhũ vàng nhìn cực chất. Cái đuôi form cũng được vải nỉ bao bọc xung quanh.</li></ul><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/82134718_2632622093485739_3896768005970853888_o_5425d8b9abb549e581d028ee5239fcb3_grande.jpg\" width=\"600\" height=\"412\"></p><p>&nbsp;</p><ul><li>Công dụng của cây giữ form giúp cho đôi giày của bạn luôn được giữ thẳng, không bị móp méo, mất form, nhăn nhúm mũi giày hoặc thân giày.</li></ul><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/crep-trees-1_e7d22dc0482c4cdbb9feba28f06a273e_grande.jpg\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><ul><li>&nbsp;Một set có 2 cặp. Giữ được 2 đôi giày. Giữ được mọi loại giày sneaker, giày tây…</li><li>&nbsp;Giữ được mọi size giày 35-46 size nữ lẫn size nam.</li></ul><p><strong>Cách sử dụng:</strong></p><p><strong>Bước 1:</strong> Lấy trees ra khỏi hộp</p><p><strong>Bước 2: </strong>Đặt phần mũi bọc nhung chèn sát vào mũi giày</p><p><strong>Bước 3:</strong> Uốn cong lò xo ở thân trees và đặt sát vào gót giày sao cho giày được căng và đúng form dáng.</p><p><strong>Bước 4:</strong> Uốn cong thân trees để tháo ra khỏi giày</p><p><img src=\"https://file.hstatic.net/1000403328/file/81602676_2621768354571113_7339236361603383296_o_186de0d8cf2b4dfda325802baea15fec_grande.jpg\" width=\"600\" height=\"490\"></p>', '2024-05-18 14:47:28', 1, 4, 11, 1, 0);
INSERT INTO `sanpham` (`masp`, `tensp`, `mota`, `ngaythem`, `trangthai`, `maloai`, `math`, `luotmua`, `luotxem`) VALUES
(155, 'CHAI DUNG DỊCH VỆ SINH GIÀY CREP PROTECT CURE REFILL', '<h2><strong>CHAI DUNG DỊCH VỆ SINH GIÀY CREP PROTECT CURE REFILL</strong></h2><p>&nbsp;</p><p><strong>\"</strong><i><strong>Đừng lấy Omo chà giày nữa nhé bạn\"</strong></i></p><p><strong>Giới thiệu:</strong></p><p>&nbsp;</p><p>Nói đến bộ vệ sinh làm sạch giày <strong>Crep Protect Cure</strong>&nbsp;thì ai cũng đều biết đây là bộ vệ sinh đỉnh nhất dành cho giày. Ai cũng đều thích dùng Crep Protect Cure bởi vì nó làm sạch cực nhanh và rất sạch vết bẩn, nguyên liệu làm từ thiên nhiên nên không sợ gây ảnh hưởng tới chất liệu hay màu của giày. Ngoài ra nó có mùi hương nhẹ, ít nhờn tạo cảm giác dễ chịu cho người sử dụng.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/img_5325_0a5422463534490fbc55fb4dbcc4b824_grande.jpg\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><p>Vì vậy những người mang giày cực thích dùng Crep Protect Cure để làm sạch đôi giày cưng của họ và nhu cầu người sử dụng càng nhiều. Nhưng bộ Crep Protect Cure Kit thì chai Crep Protect Cure chỉ có 100ml người sử dụng chỉ làm sạch được 40-50 đôi giày là hết. Vậy sau khi dùng hết thì lại tiếp tục mua thêm bộ Crep Protect Cure Kit khác có thêm bàn chải, khăn lau…nữa sao?</p><p>Tất nhiên là không như thế. Bởi vì Crep Protect đã cho ra thêm một chai&nbsp;<strong>Crep Protect Cure Refill 200ml</strong>&nbsp;dành cho những ai đã từng dùng Crep Protect Cure Kit mà hết dung dịch làm sạch để họ có thể mua chai lẻ để tiếp tục làm sạch đôi giày cưng của họ. Tìm hiểu thêm về Bộ vệ sinh giày Crep Protect Cure Ultimate Cleaning Kit<a href=\"https://urixx.com/products/bo-ve-sinh-giay-crep-protect-cure-ultimate-cleaning-kit\">&nbsp;tại đây</a>.</p><p><img src=\"https://file.hstatic.net/1000403328/file/86860256_2712918292122785_4305245930128408576_o_fb882824c4f64d01b65cb0c6509359ca_grande.jpg\" width=\"600\" height=\"400\"></p><p>&nbsp;</p><h3><strong>Vậy Crep Protect Cure Refill 200ml có khác nhau gì với Crep Protect Cure Kit 100ml không?</strong></h3><p>Về công dụng và hiệu quả thì Crep Protect Cure Refill 200ml với Crep Protect Cure Kit 100ml hoàn toàn giống nhau không khác nhau gì cả. Công dụng vẫn là làm sạch giày. Hiệu quả vẫn như nhau đều làm sạch được mọi vết bẩn bám lên giày và dùng được trên mọi chất liệu của giày.</p><p>Nhưng nó chỉ khác nhau một điểm đó là thể tích Crep Protect Cure Kit 100ml làm sạch được 40-50 đôi giày thì Crep Protect Cure Refill 200ml làm sạch được gấp đôi số lần đó.</p><p>Vậy bạn&nbsp;còn đợi gì nữa nhanh tay hốt ngay Crep Protect Cure Refill 200ml để tiếp tục trải nghiệm sự tuyệt vời của Crep Protect Cure đem tới đôi giày của bạn nào.</p><p><strong>Cách sử dụng:&nbsp;</strong></p><p>&nbsp;</p><p>Tham khảo kỹ hơn tại đây:&nbsp;<a href=\"https://urixx.com/products/bo-ve-sinh-giay-crep-protect-cure-ultimate-cleaning-kit\">Bộ vệ sinh giày Crep Protect Cure Ultimate Cleaning Kit</a></p><p><img src=\"https://file.hstatic.net/1000403328/file/page14_caa0af708c55443c91d0801e9698b12d_grande.jpg\" width=\"600\" height=\"360\"></p>', '2024-05-18 14:48:37', 1, 4, 11, 0, 0),
(156, 'CỤC TẨY CREP PROTECT, CREP PROTECT ERASER', '<h2><strong>CỤC TẨY CREP PROTECT, CREP PROTECT ERASER</strong></h2><p>&nbsp;</p><p><strong>&nbsp; Giới Thiệu:</strong></p><p>&nbsp;</p><ul><li>Vệ sinh giày có chất liệu da lộn hoặc da là vấn đề đáng lo ngại dành cho những ai có giày da lộn hoặc da. Đối với hai chất liệu này nó rất khó vệ sinh nếu bạn không biết cách vệ sinh đúng có thể gây hư hỏng đến đôi giày làm cho giày bạn bạc màu, lem màu, trầy xước đối với da...</li><li>Những dòng giày như là jordan, nike air, adidas super...là những dòng có chất liệu da và da lộn. Nếu bạn mang những dòng giày này thì không thể nào vệ sinh như bình thường được. Vì nó rất dễ hư hỏng và trầy xước.</li></ul><p>&nbsp;</p><p>&nbsp; <strong>Cách khắc phục:</strong></p><p>&nbsp;</p><ul><li>Cục tẩy dơ những vết bẩn nhẹ dành cho giày da lộn và giày da Crep Protect Eraser sẽ giúp bạn làm điều đó. Chỉ việc cầm cục tẩy chà là vết bẩn sẽ sạch ngay. Không làm ảnh hưởng tới màu giày, chất liệu, trầy xước và ướt giày.</li><li>Một cách vệ sinh tiện lợi và hiệu quả dành riêng cho giày da và giày da lộn. Với một cục tẩy Crep Protect Eraser bạn có thể làm sạch được rất nhiều đôi giày. Ngoài ra ưu điểm dễ dùng, nhỏ gọn bạn có thể để túi đem đi mọi lúc mọi nơi bạn cần.</li></ul><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/eraser-crepprotect-sneakers_2cfb3ab095e64da982a30e4bc2378e8d_grande.jpg\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><p><strong>Hướng dẫn sử dụng:</strong></p><p><strong>Bước 1:</strong> Lấy cục tẩy ra khỏi hộp</p><p><strong>Bước 2:</strong> Chà nhẹ lên bề mặt cần làm sạch</p><p><strong>Bước 3:</strong> Phủi sạch những vụn gôm sót lại</p><p><strong>Bước 4:</strong> Khi không sử dụng, bảo quản cục tẩy trong hộp</p><p><img src=\"https://file.hstatic.net/1000403328/file/page7_542f9b7ceab648b29de4bdff8c7fdac7_grande.jpg\" width=\"600\" height=\"360\"></p><p>&nbsp;</p><p>*<strong>Lưu ý: cục tẩy Crep Protect Eraser chỉ dùng được trên giày da và giày da lộn dành cho những vết bẩn nhẹ. Còn vết bẩn nặng thì tốt nhất nên dùng&nbsp;</strong><a href=\"https://vesinhgiaycrepvn.com/products/bo-ve-sinh-giay-crep-protect-cure\"><strong>bộ vệ sinh giày sneaker Crep Protect Cure Kit</strong></a><a href=\"https://urixx.com/collections/protect/products/bo-ve-sinh-giay-crep-protect-cure-ultimate-cleaning-kit\"><strong>.</strong></a></p>', '2024-05-18 14:49:45', 1, 4, 11, 0, 0),
(157, 'HỘP GIÀY CAO CẤP CREP PROTECT CRATES', '<h2><strong>HỘP GIÀY CAO CẤP CREP PROTECT CRATES</strong></h2><p><strong>Giới thiệu:</strong></p><p>&nbsp;</p><p>&nbsp;</p><p>Nói đến cách bảo quản giày thì có nhiều cách. Nhưng cách bảo quản giày để trong hộp là sạch sẽ, an&nbsp; toàn, tránh khỏi bụi bậm, không bị thú nuôi cắn phá và cuối cùng là gọn gàng khung gian nhà bạn. Đây&nbsp; cũng là cách mà dân sneaker lựa chọn bảo vệ đôi giày nhiều nhất.</p><p>Ropee xin giới thiệu với các bạn một hộp đựng giày cao cấp của Crep Protect mang tên là Crep Protect&nbsp; Crate với 1 set có 2 hộp (đựng được 2 đôi giày). Với thiết kế thông minh và bảo quản đôi giày cưng của&nbsp; bạn một cách tuyệt đối.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/ca9cce892ab771d9d30de986f8193477_e4b198586fb646c196576d44eddade1e_grande.jpg\" width=\"600\" height=\"600\"></p><h3><strong>&nbsp;Thông tin về hộp đựng giày Crep Protect Crate:</strong></h3><p>&nbsp;</p><p>&nbsp;- Đựng được all size từ 35 - 46. Kể cả cổ cao lẫn cổ thấp.</p><p>&nbsp;- Dễ dàng thay đổi vị trí của hộp với nhau.</p><p>&nbsp;- Dễ dàng lắp rắp và tháo rời để di chuyển.</p><p>&nbsp;- Chống tia UV giúp bảo vệ giày bạn khỏi ánh nắng tuyệt đối.</p><p>&nbsp;- Nắp hộp được thiết kế trong suốt nên dễ dàng nhận biết được đôi giày khi bạn cần.</p><p>&nbsp;- Hộp được thiết kế với chất liệu đặc biệt nên chịu được sức nặng bạn chắc chồng nhiều vẫn không&nbsp; sao. Crep Protect Crate hộp đựng giày cao cấp là sự lựa chọn hoàn hảo và thông minh để bảo vệ đôi&nbsp; giày của bạn.</p><p><img src=\"https://file.hstatic.net/1000403328/file/crate-3_bc662115d1974ba790b24412eab77689_grande.jpg\" width=\"600\" height=\"346\"></p><p>&nbsp;</p><p><strong>Cách sử dụng:</strong></p><p>&nbsp;</p><p>Bước 1: Lắp phần nắp trong suốt vào lỗ có sẵn ở phần đáy hộp</p><p>Bước 2: Lắp các phần cạnh hộp</p><p>Bước 3: Lắp các phần cạnh và đáy hộp</p><p>Bước 4: Lắp phần trên cùng để cố định hộp</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/page11_99b845a8afbc4d6d97daf0edecf9e729_grande.jpg\" width=\"600\" height=\"360\"></p>', '2024-05-18 14:50:45', 1, 4, 11, 0, 0),
(158, 'KHĂN ƯỚT VỆ SINH GIÀY CREP PROTECT WIPES', '<h2><strong>KHĂN ƯỚT VỆ SINH GIÀY CREP PROTECT WIPES</strong></h2><p>&nbsp;</p><p><strong>\"Chữa cháy cấp tốc cho giày bẩn\"</strong></p><h3>&nbsp;</h3><h3><strong>Giới thiệu:</strong></h3><p>&nbsp;</p><p>Khăn lau WIPES là sản phẩm \"chữa cháy\" cấp tốc cho giày bẩn, gồm 1 miếng khăn ướt được thấm đẫm dung dịch vệ sinh giày trong túi kín. Kích thước nhỏ gọn vô cùng tiện lợi khi có thể cất trong ví hoặc túi quần. Đặc biệt, Wipes còn có thiết kế 1 mặt nhám giúp làm sạch những vết bẩn khó chịu nhất và 1 mặt mềm giúp dễ dàng vệ sinh tổng thể đôi giày.</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/76784589_2542568495824433_7263978647562747904_o_8b4c3ff28ce046a8a4a276a7e8e2d8ff_grande.jpg\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><p>&nbsp;</p><h3><strong>Với thiết kế độc lạ và nhiều ưu điểm vượt trội như là:</strong></h3><p>- 1 Hộp gồm 12 miếng (12 gói nhỏ).</p><p>- Khăn lau có 2 mặt một mặt trơn giúp bạn lau sạch mọi dơ bẩn đơn giản và một mặt có độ nhám giúp bạn lau sạch vết bẩn khó hơn.</p><p>- Bạn có thể dùng CREP PROTECT WIPES lau sạch mọi dơ bẩn khi cần dù bất cứ nơi đâu và dơ bẩn thế nào cũng đều lau sạch được.</p><p>- Do CREP PROTECT WIPES là khăn lau nên đôi giày của bạn không bị ướt khi vết bẩn đã được lau sạch.</p><p>- Với thiết kế nhỏ gọn nên bạn có thể đem đi mọi lúc mọi nơi. Khi giày bạn bị dơ là có khăn lau ngay.</p><p>- 1 Khăn bạn có thể sử dụng được nhiều lần. Sử dụng khi nào khăn dơ hoàn toàn bạn có thể bỏ đi.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/crepprotect-wipes_e2e91afd51b041ef913cb6dd1d9c95b0_grande.jpg\" alt=\"\" width=\"600\" height=\"600\"></p>', '2024-05-18 14:51:39', 1, 4, 11, 0, 0),
(159, 'LÓT GIÀY CREP PROTECT COMFORT INSOLE', '<h2><strong>LÓT GIÀY CREP PROTECT COMFORT INSOLE</strong></h2><p><strong>&nbsp; Giới thiệu:</strong></p><p>&nbsp;</p><ul><li>Lót giày thương hiệu Crep Protect,&nbsp;phục vụ mục đích&nbsp;đi bộ và vận động nhẹ.&nbsp;Sản phẩm có thể thay đổi kích thước theo size chân bằng cách cắt viền.</li></ul><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/92683524_2827098314038115_733272370512396288_o_2a219abd1be740ed8c5c983150017cc2_grande.jpg\" width=\"600\" height=\"400\"></p><p><strong>&nbsp; Lợi ích:</strong></p><ul><li>Giữ cho sự thoải mái của đôi chân trong một khoảng thời gian rất dài.</li><li>Sử dụng công nghệ \"tế bào mở\" giúp cho không khí được lưu thông nên có thể giúp ta loại bỏ được những mùi khó chịu.</li><li>Giữ nguyên FORM dáng sau thời gian dài sử dụng, kích thước và độ FIT sẽ không bị thay đổi.</li></ul>', '2024-05-18 14:54:40', 1, 4, 11, 0, 0),
(160, 'LÓT GIÀY CREP PROTECT GEL INSOLES', '<h2><strong>LÓT GIÀY CREP PROTECT GEL INSOLES</strong></h2><p><strong>&nbsp; Giới thiệu:</strong></p><p>&nbsp;</p><ul><li>Lót giày thương hiệu Crep Protect, chất liệu là GEL,&nbsp;phục vụ mục đích chạy trong thời gian dài.</li></ul><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/gel-insole-v2_6d6b071e4a7e48c39d8bcb6999e28074_grande.jpg\" width=\"490\" height=\"600\"></p><p>&nbsp; <strong>Các chức năng chính:</strong></p><ul><li>Bảo vệ da bằng cách giảm ma sát gây ra cọ xát, nóng và mồ hôi.</li><li>Kháng khuẩn. Lá chắn hiệu quả, chống lại sự phát triển của vi khuẩn gây mùi.</li><li>Cấu trúc đệm đế giúp phân tán năng lượng xung quanh bàn chân.</li><li>Lực hấp thụ bong bóng GEL làm giảm căng thẳng khi va chạm.</li></ul><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/gel-insole_1f6b9654e7484cc3975652a743b844c4_grande.jpg\" width=\"490\" height=\"600\"></p>', '2024-05-18 14:55:35', 1, 4, 11, 0, 0),
(161, 'LÓT GIÀY CREP PROTECT IMPACT INSOLE', '<h2><strong>LÓT GIÀY CREP PROTECT IMPACT INSOLE</strong></h2><p><strong>&nbsp; Giới thiệu:</strong></p><p>&nbsp;</p><ul><li>Lót giày thương hiệu Crep Protect, phục vụ mục đích bật nhảy tức thời. Sản phẩm có thể thay đổi kích thước theo size chân bằng cách cắt viền.</li></ul><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/92354149_2827179430696670_6034987959269195776_o_4df5bd2020a444e68c1004e797abaaca_grande.jpg\" width=\"400\" height=\"600\"></p><p>&nbsp;</p><p>&nbsp;<strong> Lợi ích:</strong></p><p>&nbsp;</p><ul><li>Hoàn trả năng lượng lên đến 90% khiến cho đôi giày trở nên đặc biệt êm ái ngay cả với những tác động mạnh như bức tốc hay dậm nhảy trên cao.</li><li>Cực kỳ thoáng khí do sử dụng công nghệ tế bào mở tiên tiến nhất.</li><li>Giữ nguyên FORM đáng kể cả ở trong môi trường hoạt động với cường độ cao liên tục.</li></ul><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/91940809_2827179594029987_2550304520408137728_o_4f09b47e5f774c32ad506be98f52e026_grande.jpg\" width=\"480\" height=\"600\"></p>', '2024-05-18 14:56:21', 1, 4, 11, 0, 0),
(162, 'LÓT GIÀY CREP PROTECT SPORT INSOLE', '<p><strong>LÓT GIÀY CREP PROTECT SPORT INSOLE</strong></p><p><strong>&nbsp; Giới thiệu:</strong></p><ul><li>Lót giày thương hiệu Crep Protect, Phục vụ mục đích chạy trong thời gian dài. Sản phẩm có thể thay đổi kích thước theo size chân bằng cách cắt viền.</li></ul><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/92812383_2827222107359069_4238498113964212224_o_78e48a36dad241f2ba52108cff593211_grande.jpg\" width=\"600\" height=\"400\"></p><p>&nbsp;</p><p><strong>&nbsp; Lợi ích:</strong></p><ul><li>Phản ứng tức thời trong mỗi bước chạy.</li><li>Hỗ trợ trên 55% độ bật lên trong mỗi bước dậm đà hoặc tăng tốc.</li><li>Giảm thiểu và đổi hướng năng lượng hoàn trả.</li><li>Khả năng giữ FORM và êm ái đạt đến tối đa.</li></ul>', '2024-05-18 14:57:03', 1, 4, 11, 0, 0),
(163, 'VIÊN NANG KHỬ MÙI, CHỐNG MỐC GIÀY CREP PROTECT PILLS', '<h2><strong>VIÊN NANG KHỬ MÙI, CHỐNG MỐC GIÀY CREP PROTECT PILLS</strong></h2><p>&nbsp;</p><p>&nbsp;</p><p><strong>Giới thiệu:</strong></p><p>Crep Protect Pill&nbsp;là sản phẩm hai viên nhộng giúp bạn khử mùi toàn bộ mùi hôi và chống ẩm mốc từ đôi giày của bạn khi gặp nước. Đây cũng là sản phẩm tuyệt vời của Crep Protect đem đến cho giới dân sneaker chúng ta.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/78866408_2542568615824421_3494365261513883648_o_f6965c27ed7d488cbf0038b3d02def59_grande.jpg\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><p>Khi giày bị hôi thì bạn sẽ tự ti không dám đi chổ đông người hoặc tháo giày ra chổ đông người. Vì mùi hôi từ giày rất kinh tởm nhưng ai mang giày đều hiểu. Do đó vấn đề giày bị hôi là không thể tránh khỏi cho những ai mang giày thường xuyên.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/74275879_2509288659152417_285874943072141312_o_6f6c87cf8a7c4c989bbb4f9adbbb2e30_grande.jpg\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><p>Những ai thường mang giày đi ra đường hoặc những ai mang giày chân ưa tiết ra mồ hôi tạo ra mùi hôi khó chịu cho giày thì sự lựa chọn Crep Protect Pill là tuyệt vời.</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/dsc09555_8e44e4d021434c9ba5c81df1b0fc89e7_grande.jpg\" width=\"400\" height=\"600\"></p><p>&nbsp;</p><p><strong>Cách sử dụng:</strong></p><p>Bước 1: Xoắn nhẹ để mở</p><p>Bước 2: Đặt viên Pills vào trong giày</p><p>Bước 3: Giữ nơi khô và thoáng mát</p><p>Bước 4: Khi không sử dụng xoắn nhẹ để đóng</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/page6_a54a2eae02c54ddd811ff04662794f3b_grande.jpg\" width=\"600\" height=\"360\"></p><p>&nbsp;</p><p>Nếu bạn đã đọc đến đây bạn là người thường mang giày, bạn là người chân tiết ra mồ hôi nhiều tạo cho giày có mùi khó chịu thì mua cho mình 1 hộp nhé. Sản phẩm tuyệt vời này sẽ giúp bạn bảo vệ đôi giày khỏi mùi hôi và vi khuẩn tuyệt đối giúp bạn tự tin đi giày mọi lúc mọi nơi.</p>', '2024-05-18 14:57:49', 1, 4, 11, 1, 0),
(164, 'Bảo vệ ống đồng Adidas X Club Shin Guards - GR1519 - size S', '<h2><strong>ADIDAS X CLUB SHIN GUARDS</strong></h2><p><strong>Tên sản phẩm</strong>:&nbsp;Adidas X Club Shin Guards<br><strong>Màu sắc</strong>: Cam<br><strong>Mã sản phẩm</strong>:&nbsp;GR1519</p>', '2024-05-18 15:00:41', 1, 4, 1, 0, 0),
(165, 'Băng cuốn cổ chân chính hãng Aolikes AL1527 (1 cái)', '<h3><strong>Băng cuốn cổ chân chính hãng Aolikes AL1527 (1 cái)</strong></h3><p>Chấn thương cổ chân và mắt cá chân thường gặp ở những VĐV hoặc người chơi các môn thể thao như: Bóng đá, bóng chuyền, bóng rổ, leo núi, chạy bền, đạp xe, cầu lông, nhảy aerobics,…Bạn cũng nên sử dụng&nbsp;<strong>Băng cuốn cổ chân Aolikes AL1527</strong>&nbsp;sau thời gian thực hiện phẫu thuật mắt cá chân để đảm bảo tính ổn định của khớp xương, nhanh hồi phục và tránh bị tái chấn thương.</p><h2><strong>ĐẶC ĐIỂM NỔI BẬT&nbsp;</strong></h2><p>Loại chất liệu của&nbsp;<strong>đai bảo vệ cổ chân</strong>&nbsp;đó là sợi đàn hồi giúp gia tăng tính co giãn, thoải mái di chuyển, cử động mà không bị cứng, gây tê hoặc đau chân.</p><p><img src=\"https://aolikesvietnam.com/wp-content/uploads/2018/12/bang-cuon-co-chan-chinh-hang-Aolikes-1.jpg\" alt=\"Băng cuốn bảo vệ cổ chân Aolikes AL1527\" width=\"960\" height=\"772\"></p><p><img src=\"https://aolikesvietnam.com/wp-content/uploads/2018/12/bang-cuon-co-chan-chinh-hang-Aolikes-8.jpg\" alt=\"Hình ảnh thực tế đai bảo vệ cổ chân trong thể thao \" width=\"960\" height=\"1229\"></p><p>&nbsp;</p><p>&nbsp;</p><p>Thiết kế tối giản nhưng tiện ích. Mỗi sản phẩm&nbsp;<strong>băng cổ chân thể thao</strong>&nbsp;đều có dây quấn dài, có móc đệm gót chân ở đầu giúp giữ băng cuốn không bị tuột khỏi gót chân người mang.</p><p>&nbsp;</p><p><img src=\"https://aolikesvietnam.com/wp-content/uploads/2018/12/bang-cuon-co-chan-chinh-hang-Aolikes-2.jpg\" alt=\"Băng cổ chân thể thao có đa dạng màu sắc cho bạn lựa chọn \" width=\"960\" height=\"933\"></p><p><img src=\"https://aolikesvietnam.com/wp-content/uploads/2018/12/bang-cuon-co-chan-chinh-hang-Aolikes-3.jpg\" alt=\"Đai bảo vệ có khả năng co giãn rất tốt \" width=\"960\" height=\"740\"></p><p>Thao tác quấn quanh vùng mắt cả và cổ chân dễ dàng, chọn lựa độ chặt phù hợp, giữ vị trí băng cuốn bằng miếng dán tiện dụng.&nbsp;Mặt trong của&nbsp;<strong>băng quấn bảo vệ cổ chân</strong>&nbsp;có 4 đường cao su uốn sóng tuần tự chạy dọc băng. Chúng có tác dụng tạo độ bám với chân người đeo. Giảm thiểu tối đa độ trơn ngay cả khi bị ướt, khác biệt hoàn toàn với các dòng băng cuốn trên thị trường.</p><p>&nbsp;</p><p><img src=\"https://aolikesvietnam.com/wp-content/uploads/2018/12/bang-cuon-co-chan-chinh-hang-Aolikes-4.jpg\" alt=\"Thiết kế tinh tế với nhiều đường vân silicone chống trơn trượt \" width=\"960\" height=\"740\"></p><p><img src=\"https://aolikesvietnam.com/wp-content/uploads/2018/12/bang-cuon-co-chan-chinh-hang-Aolikes-5.jpg\" alt=\"Móc giữ gót chân \" width=\"960\" height=\"740\"></p><p>&nbsp;</p><p><i>Kích thước sản phẩm&nbsp;</i></p><ul><li>Chiều dài: 85cm</li><li>Chiều ngang: 8cm</li></ul><p><img src=\"https://aolikesvietnam.com/wp-content/uploads/2018/12/bang-cuon-co-chan-chinh-hang-Aolikes-6.jpg\" alt=\"Có giãn tốt giúp thoải mái di chuyển \" width=\"960\" height=\"607\"></p><p>&nbsp;</p><p>&nbsp;</p><h2><strong>HƯỚNG DẪN SỬ DỤNG</strong></h2><ul><li>Đặt phần gót chân vào dây móc tròn</li><li>Quấn băng quanh vùng mắt cá, gót chân, bàn chân</li><li>Lưu ý mặt vân cao su quay vào bên trong</li><li>Tùy chỉnh độ chặt lỏng của băng cuốn</li><li>Sử dụng miếng dán để cố định vị trí</li></ul><p><img src=\"https://aolikesvietnam.com/wp-content/uploads/2018/12/bang-cuon-co-chan-chinh-hang-Aolikes-7.jpg\" alt=\"Hướng dẫn đeo đai bảo vệ cổ chân đúng cách \" width=\"960\" height=\"1057\"></p>', '2024-05-18 22:37:51', 1, 4, 6, 1, 0),
(166, 'Bộ bó gối đàn hồi bảo vệ khớp Aolikes AL7718 (1 cặp)', '<p><strong>Bộ bó gối đàn hồi bảo vệ khớp Aolikes AL7718 (1 cặp)</strong></p><p>Bạn đã thực sự biết cách bảo vệ bản thân khi chơi bóng đá? Việc sử dụng phụ kiện bảo vệ các khớp, nhất là đầu gối là một phần cực kỳ quan trọng trong bóng đá, ảnh hưởng trực tiếp đến chất lượng chơi bóng của bạn. Các loại chấn thương thường gặp trong bóng đá liên quan đến vị trí gối như giãn&nbsp;dây chằng, đứt dây chằng trước/sau, viêm sụn trên gối...&nbsp;Đừng để mình gặp chấn thương ảnh hưởng đến sức khỏe lập tức và đau nhức lâu dài. Trang bị&nbsp;<strong>Bó gối đàn hồi bảo vệ khớp Aolikes AL7718&nbsp;</strong>trước khi bắt đầu tập luyện, ngoài ra bộ phụ kiện còn hỗ trợ rất tốt cho những người đang bị chấn thương mà cần tập luyện, hỗ trợ chấn thương giúp cầu thủ sớm hồi phục và quay lại sân cỏ.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/htb1agr_cyermejjsspjq6apoxxau_1bef09dbcfd6420fbe38305d139c6513_1024x1024.jpg\" width=\"750\" height=\"415\"></p><p>&nbsp;</p><p><strong>Bó gối đàn hồi</strong>&nbsp;là sản phẩm không thể thiếu đối với bất kì người tập luyện thể thao nào nói chung và bóng đá nói riêng. Nó giúp tạo sự an toàn tối đa để bạn tự tin hơn trong mỗi tranh chấp&nbsp;hoặc các pha đặt trụ sút bóng.</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/htb1u62kebchl1jjszfbq6yigxxak_654f0528d3774779a634c9559bb05f42_1024x1024.jpg\" width=\"900\" height=\"492\"></p><p>&nbsp;</p><p>Khác với các sản phẩm khác trên thị trường,&nbsp;bao gối thể thao&nbsp;với chất liệu co giãn tuyệt vời hỗ trợ di chuyển tốt nhất, ngoài ra còn rất bền, đẹp, tiết kiệm. Bảo vệ tối đa đầu gối trong lúc tập luyện.</p><p>&nbsp;</p><p>Nếu bạn đang phải lắng nghe tiếng lạo xạo của các khớp khi chơi bóng&nbsp;thì sản phẩm này sẽ ngăn chặn điều đó. Ngoài ra, các sản phẩm chính hãng Aolikes đều đã được nghiêm cứu để hạn chế thấp nhất lực tác động gây đau mỏi xương khớp.</p><p><br>DÀNH CHO NHỮNG AI?</p><ul><li>Dành cho những người chơi thể thao, bảo vệ tối đa đầu gối trong tập luyện, hạn chế lực tác động gây đau mỏi xương khớp</li><li>Hỗ trợ rất tốt cho những người đang bị chấn thương mà cần cử động, vận động mạnh.</li><li>Nó giúp tạo sự an toàn tối đa để bạn tự tin hơn trong mỗi pha tăng tốc&nbsp;hoặc các pha đặt trụ để&nbsp;sút bóng.</li><li>Nếu bạn đang phải lắng nghe tiếng lạo xạo của các khớp thì bó gối AL7718 này sẽ ngăn chặn điều đó</li><li>Chất liệu co giãn tuyệt vời hỗ trợ di chuyển tốt nhất, ngoài ra còn rất bền, đẹp, tiết kiệm</li></ul><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/e9b28c2dd700898011528ef9abafc6b5_65892e853b694cf39b2c8b9c1f324893_grande.jpg\" width=\"600\" height=\"600\"></p><p><img src=\"https://file.hstatic.net/1000403328/file/72bbf1479c16db4e26fd104cbdd56753_cb67a85c0d8a4e63a9df325bcf911688_grande.jpg\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><p><strong>ƯU ĐIỂM CỦA&nbsp;BÓ GỐI AL7718</strong></p><p>Kết hợp của Nylon 60%, 25% caosu, 5% silicon,10% Spandex</p><p>&nbsp;</p><p><strong>BẢO VỆ TỐI ĐA ĐẦU GỐI</strong></p><p>Bảo vệ tối đa đầu gối trong tập luyện thể dục, thể thao, hạn chế thấp nhất lực tác động gây đau mỏi xương khớp</p><p><strong>CO GIÃN LINH HOẠT</strong></p><p>Chất liệu co giãn tuyệt vời thuận tiện cho việc di chuyển, bền đẹp, tiết kiệm</p><p><strong>Ý DO KHIẾN BẠN NÊN SỬ DỤNG&nbsp;BÓ GỐI AL7718</strong></p><ul><li>&nbsp;Hỗ trợ tốt cho những người bị chấn thương cần vận động</li><li>&nbsp;Kéo dãn hoặc rút gọn kích cỡ đai theo nhu cầu</li><li>&nbsp;Hạn chế lực tác động gây đau mỏi xương khớp khi tập luyện</li><li>&nbsp;Chất liệu co giãn, bền đẹp, tiết kiệm, êm ái, thoải mái khi sử dụng</li><li>&nbsp;Ba màu sắc tuỳ chọn</li><li>&nbsp;Lý tưởng cho cả nam và nữ</li></ul><p>&nbsp;</p><p>&nbsp;</p><p><strong>HƯỚNG DẪN SỬ DỤNG</strong></p><ul><li>Trước khi tập luyện đeo bó gối bảo vệ vào phần đầu gối</li><li>Kéo giãn hoặc rút gọn kích cỡ đai theo nhu cầu</li><li>Hỗ trợ tốt cho những người bị chấn thương cần vận động</li></ul><p><img src=\"https://aolikesvietnam.com/wp-content/uploads/2018/08/dai-bao-ve-dau-goi-Aolikes-1-3.jpg\" alt=\"Thông số kỹ thuật của bó gối đàn hồi bảo vệ khớp Aolikes\" width=\"900\" height=\"1019\"></p>', '2024-05-18 22:45:00', 1, 4, 6, 0, 0),
(167, 'BĂNG KEO VẢI THỂ THAO', '<h2><strong>1. Cấu tạo băng keo vải thể thao</strong></h2><p>Băng keo vải thể thao&nbsp;được cấu tạo từ 2 lớp:</p><ul><li><strong>Lớp nền:</strong>&nbsp;Chất liệu vải cotton mềm mại, vải cao su tổng hợp hoặc sợi cordura có nguồn gốc từ thiên nhiên.</li><li><strong>Lớp keo:</strong>&nbsp;Được quét trên lớp nền vải dệt, là chất liệu này, người ta quét một lớp keo kẽm oxit có độ bám dính cao. Đặc điểm của chất keo này là an toàn, không gây dị ứng cho làn da khi sử dụng.</li></ul><p><img src=\"https://file.hstatic.net/1000403328/file/2_e68687b9e4534049b5dd2071a1e305b2_grande.jpg\" width=\"600\" height=\"600\"></p><p><i>Màu sắc đa dạng</i></p><h2><strong>2. Băng keo vải thể thao dùng để làm gì?</strong></h2><p>Trong thể thao, đặc biệt là các bộ môn cần vận động mạnh và có tính đối kháng, như bóng đá, bóng chuyền, futsal, cầu lông… chấn thương là vấn đề không thể tránh khỏi. Khi xảy ra những va chạm, ảnh hưởng đến khớp gối, cổ tay, ngón tay,… bạn cần dùng băng keo vải thể thao để quấn quanh những vị trí này. Nó sẽ giúp ổn định các bộ phận này, giúp cải thiện tuần hoàn máu, giảm đau, giảm sưng. Từ đó, việc phục hồi sẽ diễn ra nhanh chóng hơn và tránh tái phát.</p><p><img src=\"https://file.hstatic.net/1000403328/file/3_a9d5fe6a5c174751a614c08e79e2e59f_grande.jpg\" width=\"600\" height=\"600\"></p><p><i>Các vị trí thường cần đến băng keo để&nbsp;hỗ trợ tránh&nbsp;chấn thương</i></p><h3><strong>3. Hỗ trợ cơ</strong></h3><p>Không chỉ sử dụng khi chấn thương, trong điều kiện bình thường, băng dính thể thao hỗ trợ phần cơ rất tốt. Đặc biệt là khi bạn hoạt động quá mạnh, dễ dẫn đến đau, dãn, rách phần cơ. Nó sẽ làm giảm đau, mỏi cơ hiệu quả và tăng lực cho cơ.</p><h3><strong>4. Hạn chế chấn thương không mong muốn</strong></h3><p>Đối với những môn thể thao mà khả năng va chạm xảy ra cao, quấn băng dính vải thể thao trước trận đấu là điều các vận động viên cần làm. Nó sẽ giúp cho các cơ xương hoạt động nhịp nhàng hơn trong quá trình di chuyển. Giúp giảm khả năng căng cơ, hạn chế chấn thương xảy ra trong quá trình hoạt động.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/6_24a2db2ab4d84b7fb282734292aa83f5_grande.jpg\" width=\"600\" height=\"600\"></p><p>&nbsp;</p><p>Mặc dù băng keo vải thể thao có nhiều công dụng nổi bật. Tuy nhiên, nó chỉ phát huy tác dụng thực khi bạn sử dụng đúng cách.</p><h2><strong>5. Cách quấn băng keo thể thao khi gặp vấn đề như thế nào?</strong></h2><ul><li>Đế quấn băng keo vải thể thao, làm theo những bước sau:</li><li>Xác định vị trí cần quấn băng dính.</li><li>Gỡ cuộn băng keo từ từ và quấn quanh vị trí theo hình số 8. Trong quá trình quấn băng dính, đảm bảo băng luôn được căng để tránh bị rơi ra khi vận động.</li><li>Sử dụng dây nhỏ, băng thun hoặc kẹp nhỏ để cố định băng dính chắc chắn hơn.</li></ul><p>Bằng những bước này, vị trí cần bảo vệ của bạn sẽ được bao bọc cẩn thận.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/4_a01a2f66eb52441d91b4c551ebca9776_grande.jpg\" width=\"500\" height=\"500\"></p><p><i>Một số hướng dẫn quấn băng keo</i></p>', '2024-05-18 22:46:44', 1, 4, 10, 1, 0),
(168, 'Băng đầu gối Speedwick Reebok - Speedwick Knee Support', '<p>- Xuất xứ: Trung Quốc<br>- Thương hiệu: Reebok<br>- Màu sắc: trắng xanh<br>- Chất liệu: Nylon, Polyester<br>- Kích thước:&nbsp;Chọn size bằng cách: gập cánh tay một góc 45 độ rồi đo vòng của khuỷu tay.</p><p>+ Size S (25~30cm)<br>+ Size M (30~35cm)<br>+ Size L (35~40cm)<br>+ Size XL (40cm trở lên)</p><p>Được đan để có độ nén lớn hơn, Băng đầu gối Speedwick giúp cố định chắc chắn hơn.<br>Được thiết kế với cấu trúc đường may kép chắc chắn, bền và tạo sự thoải mái với mặt sau có lỗ thông gió</p><p>Giúp hỗ trợ đầu gối mà không hạn chế chuyển động của bạn, băng đầu gối Speedwick giúp cho việc tập luyện của bạn ở mức 100% ngay cả khi bạn không tập.</p><p>Công nghệ Speedwick hút ẩm<br>Mặt sau thông gió<br>Hỗ trợ chấm silicone bên trong<br>Thiết kế đường may kép tạo sự thoải mái và bền bỉ<br>Được dệt kim để nén nhiều hơn</p><p>Bảo quản ở nơi khô ráo, thoáng mát.</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/8-bang-dau-goi-speedwick-reebok-rrsu-14323_b39b5849724f4578860a7ab1fe08d895_grande.jpg\" width=\"600\" height=\"600\"></p>', '2024-05-18 23:11:23', 1, 4, 12, 0, 0),
