(174, 'Tất vớ bóng đá cổ trung màu trắng Under Armour', '<ul><li>Tất Cổ Trung dài từ 16 -18cm, siêu xịn&nbsp;</li><li>Chất liệu 100% cotton, mềm, mỏng, không dão, không xù.&nbsp;</li><li>Đặc biệt thông thoáng, kháng khuẩn, không tạo mùi hôi.&nbsp;</li><li>Tất co dãn tốt, thấm hút mồ hôi và giữ ấm tốt</li><li>Sử dụng: tập thể thao, đá bóng, tập gym, đi chơi.</li></ul>', '2024-05-18 23:02:32', 1, 4, 10, 3, 0),
(175, 'Tất vớ bóng đá cổ trung UPPER YOU', '<p>- Tất đá bóng chống trượt Upper You 8 màu thời trang:&nbsp;</p><p>✔️ Freesize: Chân Nam từ 26 – 28&nbsp;</p><p>✔️ Thương hiệu: Upper You&nbsp;</p><p>✔️ Xuất xứ: Việt Nam&nbsp;</p><p>------------------------------------------------------------------------------------------------------------&nbsp;</p><p>ĐẶC ĐIỂM NỔI BẬT&nbsp;</p><p>Tất bóng đá Nam chống trượt - Upper You:&nbsp;</p><p>✔️ Mềm mại, thấm hút mồ hôi, hạn chế nấm mốc phát triển, mang lại cảm giác mát mẻ khô thoáng suốt 4 mùa.&nbsp;</p><p>✔️ Chất liệu: Vớ thể thao được gia công với 80% Nylon, 20% cotton &amp; spandex&nbsp;</p><p>✔️ Phần đế cotton dệt xù - có đường vân chống trượt&nbsp;</p><p>✔️ Co dãn mạnh giúp ôm sát chân</p><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/sg-11134202-22110-7n4r61l16mjv8b_4b349912d9c742ffb1209e0db37eba3c.jpg\" width=\"1024\" height=\"1024\"></p><p><img src=\"https://file.hstatic.net/1000403328/file/sg-11134202-22110-y1azg7xcwfjv40_a317bd0a6ace4e3aa9d35d1483859cde.jpg\" width=\"1024\" height=\"1024\"></p>', '2024-05-18 23:04:44', 1, 4, 10, 1, 0),
(176, 'DÂY GIÀY CREP PROTECT', '<p><strong>DÂY GIÀY CREP PROTECT</strong></p><ul><li>Công nghệ Crep Protect truyền trong các sợi của dây buộc để đảm bảo bảo vệ tối đa.&nbsp;Đẩy lùi chất lỏng và ngăn ngừa vết bẩn.</li><li>Bảo vệ kéo dài đến 10 lần giặt.</li><li>Được đóng gói trong một ống có thể tái sử dụng.</li><li>Dây buộc chất lượng cao được hoàn thiện với các đầu bằng vàng.</li><li>Dây buộc màu trắng hoặc đen có sẵn theo kiểu phẳng hoặc tròn.</li></ul><p>&nbsp;</p><p>&nbsp;</p><p><img src=\"https://file.hstatic.net/1000403328/file/page10_05f06dbd33a74650a950a75fbe2c978c_grande.jpg\" width=\"600\" height=\"360\"></p><p>&nbsp;</p><ul><li>Dây giày Crep Protect&nbsp;giúp cho đôi giày của bạn trở nên đẹp, độc đáo, có điểm nhấn và tạo nên cá tính riêng. Nếu bạn là một người thích sự độc lạ thì dây giày Crep Protect này là sự lựa chọn hoàn hảo dành cho bạn.</li></ul>', '2024-05-18 23:05:37', 1, 4, 11, 0, 0),
