(190, 'QUẢ BÓNG ĐÁ ADIDAS FOOTBALL CHAMPIONS LEAGUE BILBAO 2024 LEAGUE WOMEN - WHITE/BLACK/SOLAR RED IN7017', '<p><strong>Bề mặt :&nbsp;</strong>khâu máy</p><p><strong>Bộ Sưu Tập:</strong> Champions League Bilbao 2024 League Women</p><p><strong>Chất liệu vỏ :</strong>vỏ bóng làm từ 100% TPU</p><p><strong>Công Nghệ:</strong>&nbsp;</p><p><strong>Ruột bóng :&nbsp;</strong>Ruột bóng bằng cao su butyl.</p><p><strong>Chứng nhận FIFA Quality Pro:&nbsp;</strong>Đây là chứng nhận chất lượng tốt nhất theo đánh giá của FIFA sau các thử nghiệm về độ chuẩn của chu vi, cân nặng, độ nảy và độ thấm nước.</p><p><strong>Huy hiệu in Champion League:&nbsp;</strong>Huy hiệu chỉ dành riêng cho những trái bóng đã đạt chuẩn thi đấu và sẽ chính thức xuất hiện trong các trận đấu của Cúp C1.</p><p><strong>Size :</strong> 4-5.</p><p><strong>Mã sản phẩm: </strong>IN7017</p>', '2024-05-19 02:18:14', 1, 36, 1, 1, 0),
(191, 'QUẢ BÓNG ĐÁ ZOCKER SANTA SX-S1023', '<p><strong>Quả bóng đá size 5 Zocker Santa</strong>&nbsp;là bóng được sử dụng trong luyện tập và thi đấu của thương hiệu Zocker, đáp ứng nhu cầu chơi bóng ở cấp độ bán chuyên nghiệp, phong trào.</p><p>Bóng được thiết kế theo phong cách truyền thống với 32 miếng da hình lục giác và ngũ giác ghép vào nhau, khâu tay chắc chắn. Màu sắc trắng chủ đạo, các họa tiết xanh - đen - cam sắc nét.</p><p>Sản phẩm được bồi 4 lớp, 3 lớp vải và 1 lớp EVA có độ dầy 1.5 mm. Điều này giúp Zocker Santa êm hơn và hỗ trợ tăng tốc độ bóng trong khi bay (với cùng lực sút) so với các trái bóng không có lớp này.</p><p>Zocker Santa có độ tròn và độ nảy đạt chuẩn. Được ứng dụng công nghệ All Condition tiên tiến của hãng giúp thích nghi với nhiều điều kiện thời tiết khác nhau.</p>', '2024-05-19 02:41:37', 1, 36, 13, 0, 0),
(192, 'QUẢ BÓNG ĐÁ NIKE FOOTBALL FLIGHT PREMIER LEAGUE HI-VIS - YELLOW/PURPLE/PINK BLAST', '<p>Quả bóng thi đấu mùa đông Nike Premier League Flight<br>Gặp quả bóng được làm để chịu đựng tất cả. Các rãnh đúc để giảm lực cản, kết cấu bám dính giúp kiểm soát trong mọi thời tiết—tất cả đều được tích hợp để bạn có thể xuất sắc trên sân mỗi khi chơi.</p><p>Công nghệ Nike Aerowsculpt sử dụng các rãnh đúc để phá vỡ luồng không khí đi qua quả bóng để giảm lực cản và bay ổn định hơn.<br>Công nghệ Kiểm soát mọi điều kiện (ACC) bổ sung thêm kết cấu bám dính trong cả điều kiện ẩm ướt và khô.<br>Lớp phủ mực in 3D tinh chỉnh đường bay của bóng để giúp bạn đánh trúng mục tiêu sau cú sút, chuyền nối tiếp đường chuyền.</p>', '2024-05-19 02:25:16', 1, 36, 2, 0, 0),
(193, 'QUẢ BÓNG ĐÁ NIKE FOOTBALL FUTSAL MAESTRO - GREEN GLOW/HYPER VIOLET/WHITE', '<p>Nike Football Ball Nk Futsal Maestro-Ho23 Trắng Xanh Tím FJ5547 342. Quả bóng đá trong nhà có thiết kế chân thực. Quả bóng nặng hơn một quả bóng đá thông thường, nó không nảy lên khỏi mặt đất - nó được thiết kế để chơi bóng đá trong nhà. Bóng có kích thước, trọng lượng chính thức và đạt tiêu chuẩn futsal quốc tế.</p>', '2024-05-19 02:26:15', 1, 36, 2, 0, 0),
(194, 'QUẢ BÓNG ĐÁ NIKE FOOTBALL ACADEMY PREMIER LEAGUE 2023/24 - YELLOW/PURPLE', '<p>Bạn không bao giờ ngừng cải thiện kỹ năng của mình, vì vậy hãy sử dụng quả bóng chăm chỉ nhất có thể. Bạn có thể dễ dàng nhìn thấy các đặc điểm màu sắc&nbsp;tươi sáng trên sân khi đang luyện tập và các rãnh cải tiến của nó tạo ra độ xoáy nhất quán cho cú sút&nbsp;về phía khung thành.</p><p>Công nghệ Nike Aerowsculpt sử dụng các rãnh đúc để phá vỡ luồng không khí đi qua quả bóng để giảm lực cản và bay ổn định hơn.<br>Thiết kế màu sắc&nbsp;có độ tương phản cao giúp bạn dễ dàng theo dõi đường bóng.<br>Thiết kế 12 tấm mang lại đường bay bóng chân thực và chính xác.</p>', '2024-05-19 02:27:32', 1, 36, 2, 0, 0),
(195, 'BÓNG ĐÁ FUTSAL AKPRO TIÊU CHUẨN AF3300', '<p><strong>Bộ sưu tập:</strong> AF3300.&nbsp;</p><p><strong>Size:</strong> F.</p><p><strong>Miếng ghép:</strong> 32.</p><p><strong>Công nghệ:</strong> Da tổng hợp PU và AcentecPro.&nbsp;</p><p><strong>Ruột bóng:</strong>&nbsp;Cao nhân tạo Butyl.</p><p><strong>Nơi sản xuất:</strong> INSERT INTO `sanpham` (`masp`, `tensp`, `mota`, `ngaythem`, `trangthai`, `maloai`, `math`, `luotmua`, `luotxem`) VALUES
(201, 'QUẢ BÓNG ĐÁ ZOCKER EMPIRE ZK5-EN205', '<p><strong>Size bóng</strong>: 5</p><p><strong>Chất liệu</strong>: Da PU cao cấp<strong>,</strong>&nbsp;bề mặt rất mềm mại, đàn hồi cực tốt. Độ êm, cảm giác bóng tốt; tốc độ và quỹ đạo bay ổn định, chính xác cao.&nbsp;</p><p><strong>Ruột bóng:&nbsp;</strong>&nbsp;sử dụng 4 lớp vải bồi có độ bền cao, xen kẽ giữa các lớp là cao su non. Điều này giúp cho bóng giữ hơi tốt hơn, tạo ra độ bền cao, ổn định trong thời gian sử dụng lâu dài.</p><p><strong>Sản Xuất:</strong> &nbsp;Pakistan</p>', '2024-05-19 02:41:08', 1, 36, 13, 0, 0),
