(206, 'BÓNG ĐÁ NIKE FOOTBALL ACADEMY PREMIER LEAGUE - WHITE/BRIGHT CRIMSON/BLACK', '<p><strong>Bề mặt :</strong>Thiết kế 12 tấm giúp bóng bay chân thực và chính xác, họa tiết được khâu bằng máy giúp bạn kiểm soát bóng</p><p><strong>Bộ Sưu Tập:</strong>White/Bright Crimson/Black.</p><p><strong>Chất liệu vỏ :</strong>&nbsp;60% cao su, 15% polyurethane, 13% polyester, 12% EVA</p><p><strong>Công Nghệ:</strong> Các rãnh đúc của Nike Aerowsculpt tạo ra đường bay chân thực hơn</p><p><strong>Ruột bóng : </strong>Ruột bóng bằng cao su butyl.</p><p><strong>Size :</strong> 4-5.</p>', '2024-05-19 02:48:26', 1, 36, 2, 0, 0),
(207, 'BÓNG ĐÁ NIKE FOOTBALL ACADEMY TEAM - WHITE/BLACK/VOLT', '<p><strong>Lớp phủ bề mặt :</strong> Cao bóng.</p><p><strong>Bộ Sưu Tập: </strong>White/Black/Volt</p><p><strong>Chất liệu vỏ : </strong>37% da tổng hợp / 33% cao su / 20% polyester / 10% cotton.</p><p><strong>Công Nghệ:</strong> Nike Aerow Sculpt sử dụng các rãnh khí động học để giảm lực cản của không khít, công nghệ ACC.</p><p><strong>Ruột bóng :</strong> Cao su non tự nhiên Latex.</p><p><strong>Size:</strong> 4- 5.</p><p>&nbsp;</p>', '2024-05-19 02:49:26', 1, 36, 2, 0, 0),
(208, 'BÓNG ĐÁ ADIDAS FOOTBALL CHAMPIONS LEAGUE 2023 PRO MATCH BALL - WHITE/ROYAL BLUE/ORANGE', '<p><strong>Bộ Sưu Tập: </strong>Champions League Knock Out 2023.</p><p><strong>Lớp phủ bề mặt :</strong> Cao bóng.</p><p><strong>Chất liệu vỏ :</strong> Da PU chống ma sát và bào mòn bề mặt.</p><p><strong>Công Nghệ: </strong>ACENTEC được sản xuất hoàn toàn từ dây chuyền sản xuất tiên tiến tự động và bề mặt nối ghép bằng nhiệt.</p><p><strong>Ruột bóng :</strong> Cao su non tự nhiên Latex.</p><p><strong>Nơi sản xuất :</strong> PAKISTAN.</p><p><strong>Size :</strong> 5.</p><p><strong>Độ Tiêu Chuẩn: </strong>FIFA QUALITY PRO chứng nhận chất lượng tốt nhất theo đánh giá của FIFA.</p><p><strong>Số miếng ghép:&nbsp;</strong>32</p><p><strong>Huy hiệu in UEFA Champions League: </strong>Huy hiệu chỉ dành riêng cho những trái bóng đã đạt chuẩn thi đấu và sẽ chính thức xuất hiện trong các trận đấu của giải UEFA Champions League.</p>', '2024-05-19 02:50:33', 1, 36, 1, 1, 0),
