(196, 'QUẢ BÓNG ĐÁ NIKE FOOTBALL ACADEMY - WHITE/BLACK/BRIGHT CRIMSON', '<p><strong>Bề mặt :</strong>Thiết kế 12 tấm giúp bóng bay chân thực và chính xác, họa tiết được khâu bằng máy giúp bạn kiểm soát bóng</p><p><strong>Bộ Sưu Tập: </strong>White/Black/Bright Crimson.</p><p><strong>Chất liệu vỏ :</strong>&nbsp;60% cao su, 15% polyurethane, 13% polyester, 12% EVA</p><p><strong>Công Nghệ:</strong> Các rãnh đúc của Nike Aerowsculpt tạo ra đường bay chân thực hơn</p><p><strong>Ruột bóng : </strong>Ruột bóng bằng cao su butyl.</p><p><strong>Size :</strong> 4-5.</p><p>&nbsp;</p>', '2024-05-19 02:30:39', 1, 36, 2, 0, 0),
(197, 'QUẢ BÓNG ĐÁ NIKE FOOTBALL FLIGHT PREMIER LEAGUE - WHITE/TOTAL ORANGE/BLACK', '<p><strong>Lớp phủ bề mặt :</strong> Cao bóng.</p><p><strong>Bộ Sưu Tập:</strong>White/Total Orange/Black.</p><p><strong>Chất liệu vỏ : </strong>37% da tổng hợp / 33% cao su / 20% polyester / 10% cotton.</p><p><strong>Công Nghệ:</strong> Nike Aerow Sculpt sử dụng các rãnh khí động học để giảm lực cản của không khít, công nghệ ACC.</p><p><strong>Ruột bóng :</strong> Cao su non tự nhiên Latex.</p><p><strong>Size:</strong> 5.</p><p><strong>Chứng nhận FIFA Quality Pro: </strong>Đây là chứng nhận chất lượng tốt nhất theo đánh giá của FIFA sau các thử nghiệm về độ chuẩn của chu vi, cân nặng, độ nảy và độ thấm nước.</p><p><strong>Huy hiệu in Premier League: </strong>Huy hiệu chỉ dành riêng cho những trái bóng đã đạt chuẩn thi đấu và sẽ chính thức xuất hiện trong các trận đấu của giải Premier League.</p>', '2024-05-19 02:31:43', 1, 36, 2, 0, 0),
(198, 'QUẢ BÓNG ĐÁ SIZE 5 ZOCKER INSPIRE ZK5-IN205', '<p><strong>Size bóng</strong>: 5</p><p><strong>Chất liệu</strong>: Da PU cao cấp<strong>,</strong>&nbsp;bề mặt rất mềm mại, đàn hồi cực tốt. Độ êm, cảm giác bóng tốt; tốc độ và quỹ đạo bay ổn định, chính xác cao.&nbsp;</p><p><strong>Ruột bóng:&nbsp;</strong>&nbsp;sử dụng 4 lớp vải bồi có độ bền cao, xen kẽ giữa các lớp là cao su non. Điều này giúp cho bóng giữ hơi tốt hơn, tạo ra độ bền cao, ổn định trong thời gian sử dụng lâu dài.</p><p><strong>Sản Xuất:</strong> &nbsp;Pakistan</p>', '2024-05-19 02:41:20', 1, 36, 13, 0, 0),
(199, 'BÓNG ĐÁ FUTSAL MOLTEN TIÊU CHUẨN F9A1510', '<p><strong>Số miếng ghép :</strong>&nbsp;32<br><strong>Lớp phủ bề mặt :&nbsp;</strong>Mat Finish<br><strong>Chất liệu da : </strong>Da tổng hợp<br><strong>Ruột bóng :</strong>&nbsp;cao su nhân tạo Butyl Vantiggio.<br><strong>Nơi sản xuất :</strong>&nbsp;Thailand<br><strong>Size :</strong>&nbsp;4<br><strong>Công nghệ chế tạo :</strong>&nbsp;Dán tự động</p>', '2024-05-19 02:34:41', 1, 36, 10, 0, 0),
(200, 'BÓNG ĐÁ ADIDAS FOOTBALL CHAMPIONS LEAGUE 2024 PRO MATCH BALL - WHITE/BLUE/SILVER', '<p><strong>Lớp phủ bề mặt: </strong>Cao bóng.</p><p><strong>Chất liệu vỏ: </strong>Da PU chống ma sát và bào mòn bề mặt.</p><p><strong>Ruột bóng:</strong> Cao su non tự nhiên Latex giúp đảm bảo độ nẩy và đàn hồi tiêu chuẩn.</p><p><strong>Công nghệ ACENTEC</strong> được sản xuất hoàn toàn từ dây chuyền sản xuất tiên tiến tự động làm cho bề mặt bóng đồng đều tròn trịa nhất, đạt được tiêu chuẩn cao nhất, cho người chơi cảm giác tốt nhất với quả bóng.</p><p><strong>Chứng nhận FIFA Quality Pro: </strong>Đây là chứng nhận chất lượng tốt nhất theo đánh giá của FIFA sau các thử nghiệm về độ chuẩn của chu vi, cân nặng, độ nảy và độ thấm nước.</p><p><strong>Huy hiệu in UEFA Champions League:</strong> Huy hiệu chỉ dành riêng cho những trái bóng đã đạt chuẩn thi đấu và sẽ chính thức xuất hiện trong các trận đấu của giải UEFA Champions League.</p><p><strong>Màu sắc nổi bật, bắt mắt:</strong> White/Blue/Silver</p><p><strong>Size:</strong> 5</p>', '2024-05-19 02:38:18', 1, 36, 1, 1, 0);
