(217, 'ÁO BÓNG ĐÁ CHÍNH HÃNG ARSENAL SÂN KHÁCH 2021/22', '<p><strong>Đội:</strong> Arsenal.</p><p><strong>Năm sản xuất:&nbsp;</strong>2021/22.</p><p><strong>Kiểu dáng:</strong> Regular fit</p><p><strong>Chất liệu: </strong>Vải piqué làm từ 100% polyester tái chế</p><p><strong>Công nghệ:</strong> AEROREADY thấm hút ẩm, các mảng lưới dưới cánh tay tạo độ thoáng.</p><p><strong>Màu sản phẩm:</strong>Pearl Citrine</p><p><strong>Mã sản phẩm:</strong> GM0218</p>', '2024-05-19 15:25:11', 1, 3, 1, 3, 0),
(218, 'ÁO BÓNG ĐÁ CHÍNH HÃNG MANCHESTER UNITED SÂN KHÁCH 2023/24', '<h3>CHIẾC ÁO ĐẤU MAN UTD MANG CẢM HỨNG LỊCH SỬ VÀ LÀM TỪ CHẤT LIỆU TÁI CHẾ.</h3><p>Cách đây một thế kỷ, các đường sọc dọc là điểm nhấn quen thuộc trên mẫu áo đấu sân khách Manchester United. Ở mùa giải 23/24, adidas tìm về DNA của CLB để tạo nên mẫu áo đấu bóng đá với thiết kế đúng chất Man Utd — ở cả trong và ngoài sân cỏ. Chiếc Áo Đấu Sân Khách Man United 23/24 mang lại cảm giác thoải mái cho người hâm mộ nhờ công nghệ AEROREADY thoát ẩm và các mảng phối lưới. Nổi bật trên các đường sọc ấy là huy hiệu CLB thêu nổi thể hiện lòng hâm mộ của bạn dành cho CLB huyền thoại. Làm từ 100% chất liệu tái chế, sản phẩm này đại diện cho một trong số rất nhiều các giải pháp của chúng tôi hướng tới Chấm Dứt Rác Thải Nhựa.</p>', '2024-05-19 15:26:59', 1, 3, 1, 0, 0),
(219, 'ÁO BÓNG ĐÁ CHÍNH HÃNG MANCHESTER UNITED SÂN NHÀ 2023/24', '<p><strong>Đội:</strong> Manchester United.</p><p><strong>Năm sản xuất:&nbsp;</strong>2023/24.</p><p><strong>Kiểu dáng:</strong> Slim fit</p><p><strong>Chất liệu:</strong>Vải dệt tricot làm từ 100% polyester tái chế</p><p><strong>Công nghệ:</strong> AEROREADY thấm hút ẩm, các mảng lưới dưới cánh tay tạo độ thoáng.</p><p><strong>Màu sản phẩm: </strong>Team Collegiate Red</p><p><strong>Mã sản phẩm:</strong> IP1726</p>', '2024-05-21 06:19:08', 1, 3, 1, 0, 0),
(220, 'ÁO BÓNG ĐÁ CHÍNH HÃNG ARSENAL SÂN KHÁCH 2023/24', '<p><strong>ÁO BẮT MẮT VỚI HÌNH ẢNH ĐƯỢC NGƯỜI HÂM MỘ LẤY CẢM HỨNG KHI DI CHUYỂN.</strong><br>Không có nơi nào bằng nhà, nhưng các Gooner sẽ đi rất xa để theo chân Arsenal đến vinh quang — và cho dù đó là chuyến hành hương đến Sân vận động Emirates hay một chuyến đi xa ở nước ngoài, những ngày diễn ra trận đấu là về hành trình cũng như về trận đấu đẹp mắt.</p>', '2024-05-21 06:59:17', 1, 3, 1, 1, 0),
(221, 'GRANDSPORT ÁO THI ĐẤU ĐT VIỆT NAM SÂN KHÁCH 2023', '<p>GRAND SPORT - thương hiệu trang phục và thiết bị thể thao “Made in Thailand” - được thành lập năm 1961. Với hơn 50 năm kinh nghiệm, GRAND SPORT được biết đến trong khu vực Châu Á, đặc biệt là khu vực Đông Nam Á bởi các sản phẩm mẫu mã đẹp, chất lượng cao và giá thành hợp lý.Tại Việt Nam, GRAND SPORT là đơn vị tài trợ trang phục chính thức của các Đội Tuyển Bóng Đá Quốc gia và là lựa chọn hàng đầu của hàng trăm đội bóng đá chuyên nghiệp, phong trào và bóng chuyền trên khắp Việt Nam.</p><p><strong>Grandsport Áo thi đấu ĐT Việt Nam sân khách&nbsp;2023&nbsp;</strong>là sản phẩm áo đấu đội tuyển Việt Nam mới nhất 2023. Với thiết kế kiểu dáng thời trang và nổi bật nét cá tính riêng của khách hàng. Điều đặc biệt nhất áo đội tuyển Việt Nam được Grandsport làm với vật liệu tái chế.&nbsp;<i>\"Các chai nhựa tái chế là chất liệu chính để sản xuất mẫu áo thi đấu của Đội tuyển Việt Nam năm 2022-2023. Trải qua quá trình phân loại, xử lý, khử khuẩn Anti Bacterial bằng công nghệ tiên tiến để chuyển hóa thành sợi dệt, mỗi chiếc áo thi đấu của Đội tuyển Việt Nam được dệt nên bởi các sợi đặc biệt này. Trong 2 năm 2022 và 2023, dự kiến hơn 300.000 chai nhựa sẽ được phân loại và tái chế để sản xuất trang phục thi đấu dành cho các Đội tuyển quốc gia và câu lạc bộ hiện đang là đối tác của Grand Sport.\"</i></p><p><strong>Đặc điểm nổi bật của áo&nbsp;thi đấu Đội Tuyển Việt Nam Sân Khách 2023:</strong></p><p>Chất liệu&nbsp;từ sợi Polyester tái chế được&nbsp;Grand Sport áp dụng công nghệ độc quyền tiên tiến nhất - siêu nhẹ, thoáng khí mang lại sự thoải mái và linh hoạt khi vận động.</p><p>Thiết kế dành riêng cho Đội Tuyển Việt Nam.</p><p>Công nghệ dệt&nbsp;độc quyền từ sợi Polyester Recycle khử khuẩn Anti Bacterial.</p><p>Công nghệ in 3D Bagde cao cấp.&nbsp;</p><p>Công nghệ dệt định hình giúp trọng lượng trung bình của mẫu áo 2022-2023 nhẹ hơn 15% và thoáng khí hơn tới 30% so với những mẫu thiết kế trước đây.</p><p>Huy hiệu \"CHIẾN BINH SAO VÀNG\" ở cổ áo.</p><p><br>&nbsp;</p>', '2024-05-21 07:04:53', 1, 3, 10, 0, 0),
(222, 'ÁO THUN GRANDSPORT WARRIOR12 CỔ ĐỘNG VIÊN ĐT VIỆT NAM SÂN NHÀ', '<p>Công nghệ dệt độc quyền 100% Cotton.</p><p>Chất liệu logo Sao Vàng: Thêu.</p><p>Siêu nhẹ, thoáng khí.</p><p>Thiết kế đặc biệt.</p><p>Kiểu dáng thời trang.</p>', '2024-05-21 07:12:52', 1, 3, 10, 2, 0),
(223, 'ÁO BÓNG ĐÁ CHÍNH HÃNG MANCHESTER UNITED THỨ 3 2022/23', '<p><strong>Đội: </strong>Manchester United.</p><p><strong>Năm sản xuất:&nbsp;</strong>2022/23.</p><p><strong>Chất liệu:</strong> Vải dệt kim đôi làm từ 100% polyester tái chế.</p><p><strong>Công nghệ:</strong> AEROREADY thấm hút ẩm, các mảng lưới dưới cánh tay tạo độ thoáng.</p><p><strong>Mã sản phẩm: </strong>HE2981.</p><p><br>&nbsp;</p>', '2024-05-21 07:15:38', 1, 3, 1, 0, 0),
(224, 'ÁO BÓNG ĐÁ CHÍNH HÃNG CROATIA SÂN NHÀ WORLD CUP 2022 1,299,000', '<p><strong>Đội: </strong>Croatia.</p><p><strong>Thiết kế form:</strong> Slim Fit</p><p><strong>Năm sản xuất:</strong> 2022-2023.</p><p><strong>Chất liệu:</strong> 100% polyester.</p><p><strong>Công nghệ:&nbsp;</strong>Dri-Fit Technology và Move to zero chất liệu tái chế bảo vệ môi trường.</p><p><strong>Bảo quản:</strong> Machine wash.</p><p><strong>Style:</strong> DN0687-100.</p>', '2024-05-21 07:18:50', 1, 3, 2, 0, 0),
(225, 'ÁO BÓNG ĐÁ CHÍNH HÃNG PARIS SAINT GERMAIN SÂN KHÁCH 2022/23', '<p><strong>Đội:&nbsp;</strong>Paris Saint Germain.</p><p><strong>Thiết kế form:</strong> Slim Fit</p><p><strong>Năm sản xuất:</strong> 2022-2023.</p><p><strong>Chất liệu:</strong> 100% polyester.</p><p><strong>Công nghệ:&nbsp;</strong>Dri-Fit Technology và Move to zero chất liệu tái chế bảo vệ môi trường.</p><p><strong>Bảo quản:</strong> Machine wash.</p><p><strong>Style:</strong> DJ7682-078.</p>', '2024-05-21 07:19:51', 1, 3, 2, 1, 0),
(226, 'ÁO BÓNG ĐÁ CHÍNH HÃNG CHELSEA SÂN KHÁCH 2022/23', '<p><strong>Đội:&nbsp;</strong>Chelsea.</p><p><strong>Thiết kế form:</strong> Slim Fit</p><p><strong>Năm sản xuất:</strong> 2022-2023.</p><p><strong>Chất liệu:</strong> 100% polyester.</p><p><strong>Công nghệ:&nbsp;</strong>Dri-Fit Technology và Move to zero chất liệu tái chế bảo vệ môi trường.</p><p><strong>Bảo quản:</strong> Machine wash.</p><p><strong>Style:</strong> DM1834-101.</p>', '2024-05-21 07:21:18', 1, 3, 2, 1, 0),
(227, 'ÁO BÓNG ĐÁ CHÍNH HÃNG REAL MADRID SÂN KHÁCH 2022/23', '<p><strong>Đội:&nbsp;</strong>Real Madrid.</p><p><strong>Năm sản xuất:&nbsp;</strong>2022/23.</p><p><strong>Chất liệu:</strong> Vải dệt tricot làm từ 100% polyester tái chế</p><p><strong>Công nghệ:</strong> AEROREADY thấm hút ẩm, các mảng lưới dưới cánh tay tạo độ thoáng.</p><p><strong>Màu sản phẩm:</strong> Light Purple.</p><p><strong>Mã sản phẩm:</strong> H18489.</p>', '2024-05-21 07:23:45', 1, 3, 1, 0, 0),
(228, 'ÁO BÓNG ĐÁ CHÍNH HÃNG BAYERN MÜNCHEN SÂN NHÀ 2022/23', '<p><strong>Đội: </strong>Bayern München.</p><p><strong>Năm sản xuất:&nbsp;</strong>2022/23.</p><p><strong>Chất liệu:</strong> Vải dệt kim đôi làm từ 100% polyester tái chế.</p><p><strong>Công nghệ:</strong> AEROREADY thấm hút ẩm, các mảng lưới dưới cánh tay tạo độ thoáng.</p><p><strong>Màu sản phẩm:</strong>&nbsp;Red.</p><p><strong>Mã sản phẩm:</strong> H39900.</p>', '2024-05-21 07:25:08', 1, 3, 1, 1, 0);

